INSERT INTO `company_prospects_templates` (`prospect_template_id`, `company_id`, `author_id`, `updated_by_id`, `name`, `subject`, `from`, `to`, `cc`, `bcc`, `message`, `template_default`, `create_date`, `update_date`) VALUES
	(2243, 4, 109721, 109721, 'Thank you', '', '', '', '', '', '<div>Dear {fName} {lName}\n<div>&nbsp;</div>\n\n<div>Thank you!<br />\n<br />\n<br />\nYour questionnaire has been received. You will hear from us shortly.</div>\n</div>\n', 'N', '2013-12-11 00:00:00', '2013-12-11 00:00:00'),
	(2244, 4, 109721, 109721, 'Negative Response', 'Immigration to Canada', '', '', '', '', 'Dear {fName} {lName},<br><br>Thank you for submitting your preliminary questionnaire.<br><br>We reviewed your questionnaire, and unfortunately you are not qualified to apply for immigration to Australia at this time based on the information you have provided us. <br><br>The assessment criteria to determine eligibility to immigrate to Australia are complex and change from time to time. Your inadmissibility now does not mean that you will be inadmissible in the future. We encourage you to contact us again in the future for a reassessment of your circumstances.<br><br>If you have any questions, or need to further assistance, please do not hesitate to contact us.<br><br>Regards,<br><br>{company}<br><br>', 'N', '2013-12-11 00:00:00', '2013-12-11 00:00:00'),
	(2245, 4, 109721, 109721, 'Need More Information', 'RE: Need Further Information', '', '', '', '', 'Dear {fName} {lName}<div><br></div><div>Thank you for submitting the preliminary questionnaire. In order for us to assess your enquiry further, please provide us the following information:</div><div><br></div><div><font color="#ff0000">&lt;Agent Lists further information required&gt;</font></div><div><font color="#ff0000"><br></font></div><div>Please do not hesitate to contact us if you have any further questions.</div><div><br></div><div>Thank You,</div><div><br></div><div>{company}</div>', 'N', '2014-05-27 00:00:00', '2014-05-27 00:00:00'),
	(2246, 4, 109721, 109721, 'Positive Response', 'RE: You Qualify to apply for an Australian Visa', '', '', '', '', 'Dear {fName} {lName},<div><br></div><div>Thank you for completing our preliminary questionnaire.</div><div><br></div><div>According to the information you have provided us, we are pleased to inform you that you qualify to apply for [subclass] visa.</div><div><br></div><div>We would be more than happy to assist you in this matter. Please find attached our Client Service Agreement. If you are happy with the terms, please sign and return this to us at your earliest so that we can start assisting you.</div><div><br></div><div>one of our friendly staff will contact you soon on [phone number.]&nbsp;</div><div><br></div><div>Thank you,</div><div><br></div><div>{company}</div>', 'N', '2014-05-27 00:00:00', '2014-05-27 00:00:00'),
	(2247, 0, 1, 1, 'Thank you', '', '', '', '', '', '<font size="2">Dear {fName} {lName}</font><br><div style="font-size: 12px;"><font size="6"><br></font></div><div style="font-size: 12px;"><font size="6">Thank you!<br></font><br><br><font size="3">Your questionnaire has been received. You will hear from us shortly.</font></div>', 'N', '2013-12-11 00:00:00', '2013-12-11 00:00:00'),
	(2248, 0, 1, 1, 'Negative Response', 'Immigration to Canada', '', '', '', '', 'Dear {fName} {lName},<br><br>Thank you for submitting your preliminary questionnaire.<br><br>We reviewed your questionnaire, and unfortunately you are not qualified to apply for immigration to Australia at this time based on the information you have provided us. <br><br>The assessment criteria to determine eligibility to immigrate to Australia are complex and change from time to time. Your inadmissibility now does not mean that you will be inadmissible in the future. We encourage you to contact us again in the future for a reassessment of your circumstances.<br><br>If you have any questions, or need to further assistance, please do not hesitate to contact us.<br><br>Regards,<br><br>{company}<br><br>', 'N', '2013-12-11 00:00:00', '2013-12-11 00:00:00'),
	(2249, 0, 1, 1, 'Need More Information', 'RE: Need Further Information', '', '', '', '', 'Dear {fName} {lName}<div><br></div><div>Thank you for submitting the preliminary questionnaire. In order for us to assess your enquiry further, please provide us the following information:</div><div><br></div><div><font color="#ff0000">&lt;Agent Lists further information required&gt;</font></div><div><font color="#ff0000"><br></font></div><div>Please do not hesitate to contact us if you have any further questions.</div><div><br></div><div>Thank You,</div><div><br></div><div>{company}</div>', 'N', '2014-05-27 00:00:00', '2014-05-27 00:00:00'),
	(2250, 0, 1, 1, 'Positive Response', 'RE: You Qualify to apply for an Australian Visa', '', '', '', '', 'Dear {fName} {lName},<div><br></div><div>Thank you for completing our preliminary questionnaire.</div><div><br></div><div>According to the information you have provided us, we are pleased to inform you that you qualify to apply for [subclass] visa.</div><div><br></div><div>We would be more than happy to assist you in this matter. Please find attached our Client Service Agreement. If you are happy with the terms, please sign and return this to us at your earliest so that we can start assisting you.</div><div><br></div><div>one of our friendly staff will contact you soon on [phone number.]&nbsp;</div><div><br></div><div>Thank you,</div><div><br></div><div>{company}</div>', 'N', '2014-05-27 00:00:00', '2014-05-27 00:00:00'),
	(2311, 4, 109721, 109721, 'Launch Invitation', 'Officio Launch Invitation', 'support@officio.com.au', '', '', '', '<div style="text-align: center;"><img src="http://tof.r.mailjet.com/img/124g/s22uz/xk1pt.jpg" alt="" width="600" class="image_uploaded resizable"></div><div style="text-align: center;"><span><br></span></div><div><span>Dear {lName}<first>,<br><br></first><p>Finally. A complete web-based Migration Management System designed specifically for Australian Migration Practitioners. Officio.</p><p></p><p>We would like to invite you to be a part the launch of a new way to manage a migration practice. On-line. Easy to use. No lock-in contracts. Because we\'re sure you\'ll like it and use it.</p><p></p><p "msonormal"="">Our\nearly adopters will be there too. They are Migration Agents, like you, who were\nlooking for a better way to do things. Come and chat.&nbsp;</p><span><first>The launch will be on Friday 12 September at 5:00 PM at AMVL Migrations - Level 7, 199 George Street, Brisbane where drinks and nibbles are on the house.<br><br>Please find below an RSVP link. We hope to see you and your colleagues.<br><br><a href="https://adobeformscentral.com/?f=r7Q6pRcFzjo5**oQOaKMjQ">https://adobeformscentral.com/?f=r7Q6pRcFzjo5**oQOaKMjQ</a></first></span></span></div><font face="arial" size="2"><div><font face="arial" size="2"><br></font></div><div><font face="arial" size="2">Please feel free to contact me if you have any questions.</font></div><div style="font-style: italic; color: rgb(51, 102, 255);"><font face="arial" color="#3366ff" size="2"><i><br></i></font></div><font color="#3366ff" style="font-style: italic;"><b>Abhishek Vora</b></font></font><div style="font-size: 12px;"><font face="arial"><i>Client Experience Manager, Officio Australia</i></font></div><div style="font-size: 12px;"><div style="text-align: left;"><img src="http://www.officio.com.au/images/logo-officio.jpg" border="0"></div></div><div style="font-size: 12px;"><span style="font-family: arial;">T: +61 7 3212-2266 &nbsp;F: +61 7 3212-2211</span></div><div style="font-size: 12px;"><font face="arial"><a href="vora@officio.com.au">vora@officio.com.au</a>; <a href="support@officio.com.au">support@officio.com.au</a></font></div><div style="font-size: 12px;"><a href="www.officio.com.au" style="font-family: arial;">www.officio.com.au</a></div><div style="font-size: 12px;"><font face="arial">Level 7, 199 George Street, Brisbane, QLD, 4000</font></div><div style="font-size: 12px; font-family: tahoma, arial, helvetica, sans-serif;"><br></div><div style="font-size: 12px; font-family: tahoma, arial, helvetica, sans-serif;"><br></div>', 'N', '2014-09-02 00:00:00', '2014-09-02 00:00:00'),
	(2312, 4, 109721, 109721, 'Launch Invitation - AMVL', 'Officio Launch Invitation', 'support@officio.com.au', '', '', '', '<div style="text-align: center;"><img src="http://tof.r.mailjet.com/img/124g/s22uz/xk1pt.jpg" alt="" width="600"></div><p>Dear {lName}<first>,<br><br></first></p><p>Finally. It gives me immense pleasure to invite you - the extended family of Officio, for the launch party.</p><p></p><p>Our early adopters and few other Migration Agents will be there too. Come and chat.</p><first>The launch will be on Friday 12 September at 5:00 PM. Drinks and finger food are on the house.&nbsp;<br><br>Please find below an RSVP link. Please RSVP latest by Wednesday 10 September.</first><div><first><br><a href="https://adobeformscentral.com/?f=r7Q6pRcFzjo5**oQOaKMjQ">https://adobeformscentral.com/?f=r7Q6pRcFzjo5**oQOaKMjQ</a></first><p></p><font face="arial" size="2"><p>Please feel free to contact me if you have any questions.</p><p><font face="arial" color="#3366ff" size="2"><i><br></i></font></p><font color="#3366ff"><b>Abhishek Vora</b></font></font><p><font face="arial"><i>Client Experience Manager, Officio Australia</i></font></p><p><img src="http://www.officio.com.au/images/logo-officio.jpg" border="0"></p><p>T: +61 7 3212-2266 F: +61 7 3212-2211</p><p><font face="arial"><a>vora@officio.com.au</a>;<a>support@officio.com.au</a></font></p><p><a>www.officio.com.au</a></p><p><font face="arial">Level 7, 199 George Street, Brisbane, QLD, 4000</font></p><p><br></p></div>', 'N', '2014-09-08 00:00:00', '2014-09-08 00:00:00');
