INSERT INTO `faq` (`faq_id`, `faq_section_id`, `question`, `answer`, `meta_tags`, `featured`, `content_type`, `order`, `client_view`) VALUES
	(1, 3, 'Can a payment in payment schedule be due right away?', '<p>Yes, to do this you can set the date of the payment schedule to today.</p>\n<p>&nbsp;</p>\n<p>For more:</p>\n<p>&nbsp;</p>\n<p>Contact Support on:</p>\n<p>&nbsp;</p>\n<p>Telephone: 07 3212 2266</p>\n<p>Email: support@officio.com.au</p>\n<p>&nbsp;</p>\n<p>Phone Support times: 9:00am to 3:30pm. Monday to Friday.</p>\n<p>Email Turnaround: 24 hours</p>', NULL, 'N', 'text', 1, 'Y'),
	(3, 3, 'Officio asking for an Import of our Client Account.   Where can we download the file to import to Officio?', '<p>Coming Soon. Contact Support on:</p>\n<p>&nbsp;</p>\n<p>Telephone: 07 3212 2266</p>\n<p>Email: support@officio.com.au</p>\n<p>&nbsp;</p>\n<p>Phone Support times: 9:00am to 3:30pm. Monday to Friday.</p>\n<p>Email Turnaround: 24 hours</p>', NULL, 'N', 'text', 3, 'Y'),
	(4, 3, 'Can I have multiple Client Accounts?', '<p>?Yes, you can create multiple trust accounts by going to the "Admin" link on the top right side of Officio (just below your company logo) &amp; clicking on "Define Trust Accounts."<br /><br />Your trust accounts can be in various currencies and from different banks.</p>', NULL, 'N', 'text', 4, 'Y'),
	(5, 3, 'Why do i need multiple Client Accounts?', '<p>You don\'t need multiple client&nbsp;accounts but some companies organise their Client&nbsp;Accounts by the location&nbsp;they are working in or by currencies they accept fees from clients.<br /><br />Also some consultants may choose to accept their fees in one currency and all government fees only in Australian&nbsp;dollars.<br /><br />Officio supports one Australian&nbsp;client account and one None Australian&nbsp;fund client&nbsp;account for each client.&nbsp; <br /><br /></p>\n<p>Not happy with the answer or want more?</p>\n<p>&nbsp;</p>\n<p>Contact Support on:</p>\n<p>&nbsp;</p>\n<p>Telephone: 07 3212 2266</p>\n<p>Email: support@officio.com.au</p>\n<p>&nbsp;</p>\n<p>Phone Support times: 9:00am to 3:30pm. Monday to Friday.</p>\n<p>Email Turnaround: 24 hours</p>', NULL, 'N', 'text', 5, 'Y'),
	(6, 3, 'How do i assign a client to a Client Account?', '<p>?If you only have one trust account in Officio, then as soon as you click on Accounting tab of a client, that one trust account will be automatically assigned to that client.<br /><br />If you have more than one Trust Account, then when you go to the Client\'s Accounting tab, you will be asked to decide the currency and the trust account that you will receive the funds for that client.<br /><br />As long as there no Financial transaction related to a trust account is entered for client, you can change the Trust Account account assigned to a client. </p>', NULL, 'N', 'text', 6, 'Y'),
	(7, 3, 'I made a mistake in a client account entry. How can I reverse the transaction?', '<p>?To reverse a transaction in trust account that is assigned to a client or an invoice, please click on the date part of that transaction. A window will pop up. Click on<strong> Unassign this transaction</strong> button. The transaction will be unassigned.</p>\n<p>This feature is only available for transactions that are not reconciled.</p>\n<p><img src="http://uniques.ca/officio_support/2010-03-23_trust_account.gif" alt="" /></p>\n<p><br /><br />If you initially do not see all transactions in your trust account, please change the drop down menu<strong> Display transactions</strong> to All.<br /><br /><br /><img src="http://uniques.ca/officio_support/2010-03-23_trust_account_2.gif" alt="" /></p>', NULL, 'N', 'text', 7, 'Y'),
	(8, 4, 'My client can open the forms, but get a message that forms are locked and cannot be saved?', 'Officio lets you control write-access to the forms. Click on the icon circled in red to define access level.<div><br><div><img src="http://uniques.ca/officio_support/2010-03-15_forms_locked.gif"><br><br><br></div><div><img src="http://uniques.ca/officio_support/2010-03-15_forms_enabled.gif"></div></div>', NULL, 'N', 'text', 1, 'Y'),
	(9, 4, 'How can my clients access the program? What User ID and Password should I give them?', 'When you create a client profile for the first time, please ensure to enter a <span style="font-weight: bold;">Primary Email</span> under Contact info. Once you click on Save Profile, the system automatically generates a User ID and Password for your client and prompts you to email the instructions to your client.<br><br><img src="http://uniques.ca/officio_support/2010-03-18_contact_info.gif"><br><br><br>If you missed this step, you can always go to <span style="font-weight: bold;">Client Login</span> section and click on Change to enter a User Id and Password and choose to email to your client.<br><br><img src="http://uniques.ca/officio_support/2010-03-18_client_login.gif"><br>', NULL, 'N', 'text', 2, 'Y'),
	(10, 4, 'I want to put a link on my website so my clients can access Officio. How can I do this?', '<p>You can put a link on your website that once clicked will take your clients to the following page:<br /><a href="http://secure.officio.ca/?no_logo" target="_blank" class="blulinkun"><br /></a><a href="/?no_logo" target="_blank" class="blulinkun">http://secure.officio.com.au/?no_logo</a><br /><br />This login page has no logo of Officio and can be embedded within a frame or iFrame in your website to maintain the general look and feel of your website. <br /><br />If you implement it in this fashion, your clients will not see the Officio\'s web address. They only see your website.<br /><br /></p>', NULL, 'N', 'text', 3, 'Y'),
	(13, 2, 'When I open a form, my form is blank and I get a message that the \'Data from this site is blocked...\'. What should I do?', '<p><img src="H:\\Website\\Forms Blocked SS" alt="" /></p>\n<p>&nbsp;</p>\n<p><span style="font-size: 13.5pt; line-height: 115%; font-family: Arial, sans-serif;">1. Simply click on Options.</span><br /> 2. In the menu, choose<span class="apple-converted-space">&nbsp;</span><strong><span style="font-family: Arial, sans-serif;">Add host to Privileged&nbsp;Locations</span></strong><br /> 3. You need to close this form and try opening it again.</p>\n<ol>\n<li>&nbsp;</li>\n</ol>', NULL, 'N', 'text', 1, 'Y'),
	(14, 2, 'I\'m using a Mac, and I cannot save the forms. What should I do?', '<p><br />We take pride that Officio is Mac-compatible. But, you need to have Adobe Reader Plug-in installed to use all the advanced features used in Officio. Most Mac computers don\'t have this plug-in installed. Please take the steps in the following link to ensure your configuration is set properly:<br /><br /><a href="http://uniques.ca/officio_support/mac/step1.htm" target="_blank" class="blulinkun">Configure my Mac</a><br /><br /><br /><br /></p>', NULL, 'N', 'text', 2, 'Y'),
	(15, 2, 'What is the proper behaviour of the forms?', '<p>Forms in Officio are in PDF format. You need to have <strong>Adobe Reader</strong> or<strong> Adobe Acrobat 7.0</strong> or higher to operate these forms. Other PDF programs such as FoxIt Reader, or Nitro PDF, lack all the features needed to send and receive data with Officio, and they can negatively interact with your operation. We highly recommend that you uninstall those programs, and ensure you have the latest version of Adobe Reader for best performance.<br /><br />When you open a form, <br /><br />1. It should open within your browser. Not outside your browser. <br />2. Your form needs to be opened using the Adobe Toolbar.<br />3. The "<strong>Save to Officio</strong>" button should appear in blue.<br /><br />In the example below the form has opened within the Mozilla FireFox browser.<br /><br /><img src="http://uniques.ca/officio_support/proper_form1_.gif" alt="" /><br /><br /><br /><br />When you click on "<strong>Save to Officio</strong>" button, the form must be saved, and you should get a confirmation that your form was saved successfully.<br /><br /><img src="http://uniques.ca/officio_support/proper_form2.gif" alt="" /><br /><br /></p>', NULL, 'N', 'text', 3, 'Y'),
	(16, 2, 'I cannot save my forms in Google Chrome. What should I do?', '<p>Unfortunately, Google Chrome has removed its support for Adobe Reader Plugin. As a result, Government forms cannot be opened and populated in Chrome. While you can continue to enjoy other features of Officio on all browsers, we recommend that you use FireFox to work with the forms. To download the latest version of FireFox, please click on <a href="https://www.mozilla.org/firefox/new/?scene=2" target="_blank" class="blulinkun">this link</a>.</p>', NULL, 'N', 'text', 4, 'Y'),
	(17, 2, 'When I open a form, it\'s not opening within the browser. It\'s downloaded or shown in my Adobe Reader (or Adobe Acrobat). What should I do?', '<p>You need to ensure the option <strong>Display PDF in browser</strong> is checked in your Adobe Reader (or Adobe Acrobat). Please open your Adobe Reader (or Adobe Acrobat), and follow the steps in the following image:<br /><br /><img src="http://uniques.ca/officio_support/display_in_browser.gif" alt="" /></p>', NULL, 'N', 'text', 5, 'Y'),
	(18, 8, 'I have paid for my subscription to Officio. How can I get my invoices?', 'Officio is an online software and all of your invoices are kept online. You can see your payment history by going to <br><br>Admin | Update Company Details | Company Invoices<br><br><img src="http://uniques.ca/officio_support/2010_07_15.gif"><br>', NULL, 'N', 'text', 1, 'Y'),
	(19, 8, 'How can I update or change the credit card that subscription is charged on?', 'Please follow the steps in the following image to update your credit card details.<br><br><img src="http://uniques.ca/officio_support/2010-08-06-billing.gif"><br>', NULL, 'N', 'text', 2, 'Y'),
	(20, 7, 'When I login to Officio\'s calendar I only see an image. I cannot enter any data into my calendar?', '<br>The Calendar in Officio is linked to the email component. You need to set up your email first before the Calendar can be activated. Please refer to the section on how to setup your email.<br><br><br>', NULL, 'N', 'text', 1, 'Y'),
	(21, 7, 'How can I share my Calendar?', '<font size="2"><br>In order to share a calendar,<br><br>1. Log in to the account of the user whom you want to share his/her calendar with other users.<br><br>2. Follow the steps in the attached image to share this calendar with other users.<br><br><img src="http://www.uniques.ca/officio_support/2010-09-29-share_calendar.gif"><br><br><br>3. Other users when they login to their calendars will see this shared calendar on the bottom right corner of the screen.<br><br><br>Please note: Calendar and email are linked in Officio. Other users who you are sharing your Calendar with need to have setup their email accounts first, before they can see your Calendar. Please refer to the section on how to setup email.<br><br><br></font>', NULL, 'N', 'text', 2, 'Y'),
	(22, 7, 'How can I change the colour settings or name of my Calendar?', 'Take the steps in the following image:<br><br><img src="http://uniques.ca/officio_support/2010-09-29-share_calendar2.gif"><br>', NULL, 'N', 'text', 3, 'Y'),
	(23, 7, 'Can I have multiple Calendars in Officio?', '<br>Yes. <br><br>1. While you are in the Calendar page, simply click on <b>New Calendar</b>. <br>2. Give your new Calendar a name (eg, Business Calendar, Personal Calendar, etc.). <br>3. You can also choose a different colour for your various calendars so you can visually distinguish among different calendar entries.<br><br>Please note: you cannot have apostrophes, single quotes, or double quotes in your Calendar name.<br><br><br><br>', NULL, 'N', 'text', 4, 'Y'),
	(24, 1, 'Are you New to Officio? Looking for Video tutorials?', '<p>An Introduction to Officio </p>\n<p>&nbsp;</p>\n<p><iframe src="https://player.vimeo.com/video/207009599" width="640" height="360" frameborder="0" allowfullscreen=""></iframe></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><iframe src="https://player.vimeo.com/video/143571503" width="500" height="281" frameborder="0" allowfullscreen=""></iframe></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><iframe src="https://player.vimeo.com/video/143576157" width="500" height="375" frameborder="0" allowfullscreen=""></iframe></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><iframe src="https://player.vimeo.com/video/143578375" width="500" height="281" frameborder="0" allowfullscreen=""></iframe></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><iframe src="https://player.vimeo.com/video/143579542" width="500" height="281" frameborder="0" allowfullscreen=""></iframe></p>', NULL, 'N', 'text', 1, 'N'),
	(25, 9, 'How can I automate Case Reference #?', '<p>Case Reference number automation is a setting in your Administrative panel within Officio.</p>\n<p>&nbsp;</p>\n<p>You can access the settings for Case Reference number automation here:</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/CaseRef.PNG" alt="Case Reference Number Settings" width="222" height="339" /></p>\n<p>&nbsp;</p>\n<p>Once you click this link from the menu, you\'ll have access to the complete set of settings for defining your case reference naming convention automation. What this means is that you\'ll be able to use the settings here to choose how the case reference is generated. <br /><br /><img src="/help_files/CaseRef-Settings.PNG" alt="Case Reference Specific Settings" width="663" height="523" /></p>\n<p>&nbsp;</p>\n<p>In order to change the creation of Case Reference numbers to automated, simply check the box for automation and define your settings. The default is:<br />[Family Name (short) / Given Names (short) / Number of case for this client / Subclass Abbreviation / Total Count of cases]</p>\n<p>&nbsp;</p>\n<p>To re-order the Case Reference formatting, just use the up and down-arrows next to the various settings to reposition them in the logical order.</p>\n<p>&nbsp;</p>\n<p>You can also choose how many letters of the given and family names are included in the case number.</p>', NULL, 'N', 'text', 8, 'N'),
	(26, 9, 'How can I turn off auto Case Reference #?', '<p>To turn off automatic Case Reference numbering, simply open the Case Reference Settings (covered above in the settings details), and choosing the option "Manually Enter Case Reference Number"</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/CaseRef-Settings.PNG" alt="Case Reference Settings" width="663" height="523" /></p>', NULL, 'N', 'text', 9, 'N'),
	(27, 10, 'What is the difference between a Client and a Case?', '<p>A &ldquo;Client&rdquo; is an entity that is seeking your services. A &ldquo;Case&rdquo; is the category of the service your client is seeking from you.</p>\n<p>&nbsp;</p>\n<p>For Example: John Smith is your Client and John Smith&rsquo;s 457 Visa application is his case.</p>\n<p>&nbsp;</p>\n<p>A client will not have sub-tabs such as file note, tasks, documents, accounting etc. until a case is added to that client.</p>\n<p>&nbsp;</p>\n<p>Client View:</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Client View 1.png" alt="" width="628" height="350" /></p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Case View 2.png" alt="" width="635" height="377" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>A client can have multiple cases as seen in the &ldquo;client management&rdquo; section before.</p>\n<p>&nbsp;</p>\n<p>When you use the search feature, Officio automatically retrieves case information of your clients.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Note, how the search result is accompanied by a case reference #</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Client with CRN.png" alt="" width="205" height="122" /></p>\n<p>&nbsp;</p>\n<p>If a case is not assigned to your client, then it will simply show you the name of that client.</p>\n<p>&nbsp;</p>\n<p>Note, how the search result has no Case reference # indicating that there is no case assigned to the client.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Client without CRN.png" alt="" width="255" height="64" /></p>', NULL, 'N', 'text', 12, 'N'),
	(28, 10, 'How can I link an individual client\'s case to an Employer\'s case?', '<p>A case can be linked with an employer in two ways.</p>\n<p>&nbsp;</p>\n<p>Scenario 1 - Linking from the employer&rsquo;s profile:</p>\n<p>&nbsp;</p>\n<p>Go to Sponsoring Employer&rsquo;s Profile</p>\n<p>&nbsp;</p>\n<p>&nbsp;<img src="/help_files/Link Employer 1.png" alt="" width="585" height="301" /></p>\n<p>&nbsp;</p>\n<p>Click on &ldquo;Add a New Case&rdquo; button</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;<img src="/help_files/Link Employer 2.png" alt="" width="560" height="274" /></p>\n<p>&nbsp;</p>\n<p>Select the case type as &ldquo;Employer Sponsored Migration&rdquo;</p>\n<p>&nbsp;</p>\n<p>&nbsp;<img src="/help_files/Link Employer 3.png" alt="" width="500" height="129" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>If you wish to create a new client that does not exist in your database, click on &ldquo;this is a new client&rdquo;</p>\n<p>If you wish to add a case to an existing client, click on &ldquo;this is an existing client&rdquo; If you have chosen exiting client - select the client&rsquo;s name from the dropdown box</p>\n<p>Click "Next"</p>\n<p>&nbsp;</p>\n<p>&nbsp;<img src="/help_files/Link Employer 4.png" alt="" width="579" height="140" /></p>\n<p>&nbsp;</p>\n<p>Fill-in the required data Click Save</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Link Employer 5.png" alt="" width="562" height="262" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Scenario 2 - Linking from an Individual case</p>\n<p>&nbsp;</p>\n<p>Go to the &ldquo;Case-Details&rdquo; sub tab</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Link Employer 6.png" alt="" width="563" height="242" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Click on &ldquo;Link to Employer button&rdquo;</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Link Employer 7.png" alt="" width="510" height="212" /></p>\n<p>&nbsp;</p>\n<p>Type the name of the sponsoring employer or select from the drop-down box and click on the Link button</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;<img src="/help_files/Link Employer 9.png" alt="" width="406" height="146" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;Specify the employer case individual client is linked with -</p>\n<p>&nbsp;</p>\n<p>Go to Case Details section</p>\n<p>Click on the "Employer Sponsorship Case" dropdown button</p>\n<p>Select Employer\'s case fromt the dropdown list</p>\n<p>Cick Save</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Link Employer 12.png" alt="" width="518" height="203" /></p>\n<p>&nbsp;</p>\n<p>Watch Video:</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><iframe src="https://player.vimeo.com/video/143568351?color=ff9933&amp;title=0&amp;byline=0&amp;portrait=0" width="500" height="265" frameborder="0" allowfullscreen=""></iframe></p>\n<p><a href="https://vimeo.com/143568351" target="_blank" class="blulinkun">Linking an Employer</a> from <a href="https://vimeo.com/user43380339" target="_blank" class="blulinkun">Abhishek Vora</a> on <a href="https://vimeo.com" target="_blank" class="blulinkun">Vimeo</a>.</p>', NULL, 'N', 'text', 13, 'N'),
	(29, 10, 'Can I link my client\'s case to more than one employer\'s case?', '<p>No, one case can be linked only with one employer case.</p>\n<p>&nbsp;</p>\n<p>To link a client with another employer, simply create a new case for the client and link it to the emmployer.</p>', NULL, 'N', 'text', 14, 'N'),
	(30, 2, 'What is the difference between a Client Questionnaire and a Wizard?', '<p>A questionnaire is a type of interactive form designed to gather sufficient information to help the agent prepare and complete immigration forms.</p>\n<p>&nbsp;</p>\n<p>A wizard can be considered as an advanced form of questionnaire, with conditional logic that adds additional questions depending on the answers you give.</p>\n<p>&nbsp;</p>\n<p>For example, if the first question is, "Do you have more than $1.4M in assets or holdings?", then the next logical question might be, "Do you plan to invest or open a company office in Australia?"</p>\n<p>&nbsp;</p>\n<p>If you answer no, then the additional questions don\'t apply and don\'t appear.</p>', NULL, 'N', 'text', 15, 'Y'),
	(32, 10, 'How do I create a new client and add a case?', '<ol>\n<li>&nbsp;</li>\n<li>1. Go to the Clients Module</li>\n<li>2. Click on the "Add a New Client" button</li>\n</ol>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Add Client FNL 1.png" alt="" width="400" height="164" /></p>\n<p>&nbsp;</p>\n<p>3. Select the "Individual" option</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Add Client FNL 2.png" alt="" width="350" height="96" /></p>\n<p>&nbsp;</p>\n<p>4. There are three compulsory fields on this page. Please ensure to populate all three of them. Compulsory fields are marked with an orange asterisk.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Add Client 3.png" alt="" width="800" height="361" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Add Client 4.png" alt="" width="750" height="90" /></p>\n<p>5. Click on the "Save &amp; Add a New Case" button</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Add Client FNL 3.png" alt="" width="438" height="259" /></p>\n<p>&nbsp;</p>\n<p>6. Select a case type based on the Visa subclass. For example - Choose Employer Sponsored Migration as your case type if your client is applying for a 457 visa. Similarly, choose Review as your case type if your client is applying for an MRT application.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Select Case Tyype.png" alt="" width="434" height="175" /></p>\n<p>&nbsp;</p>\n<p>7.&nbsp;Complete all the compulsory fields on the page marked with an asterisk and then click on the orange &ldquo;Save&rdquo; button. Remember, you can always return to your case to update fields.</p>\n<p>&nbsp;</p>\n<p>TIP - The non-compulsory&nbsp;fields can populate automatically if your client completes a questionnaire using the client portal.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Save Button.png" alt="" width="455" height="186" /></p>\n<p>&nbsp;</p>\n<p>Note -&nbsp;It is important to&nbsp;set responsible staff for a case. This way, you can allocate role specific tasks and also control who has access to this case.&nbsp;Automatic tasks allocation may not work properly if staff responsible is not selected correctly.</p>\n<p>&nbsp;</p>\n<p>Don\'t forget to check out&nbsp;"How to create an Employer Client and Case" in the Help section.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><iframe src="https://player.vimeo.com/video/141759477" width="500" height="313" frameborder="0" allowfullscreen=""></iframe></p>\n<p><a href="https://vimeo.com/141759477" target="_blank" class="blulinkun">Create new client</a> from <a href="https://vimeo.com/user43380339" target="_blank" class="blulinkun">Abhishek Vora</a> on <a href="https://vimeo.com" target="_blank" class="blulinkun">Vimeo</a>.</p>', NULL, 'N', 'text', 10, 'N'),
	(33, 10, 'How do I create a Sponsoring Employer\'s Profile and add a case to it?', '<ol>\n<li></li>\n<li></li>\n<li>1. Go to the clients Module</li>\n</ol>\n<p>&nbsp;</p>\n<p>2.&nbsp;Click on the "Create a New Client" button</p>\n<ol>\n<li></li>\n<li></li>\n<li></li>\n<li></li>\n<li><img src="/help_files/Add Client FNL 1.png" alt="" width="500" height="205" /></li>\n<li></li>\n<li></li>\n<li></li>\n<li>3. Select "employer option"</li>\n</ol>\n<p>&nbsp;</p>\n<p><img src="/help_files/Create Employer Client 1.png" alt="" width="500" height="114" /></p>\n<p>&nbsp;</p>\n<ol>\n<li>\n<ul>\n<li></li>\n<li></li>\n<li>4. Complete the compulsory fields</li>\n</ul>\n</li>\n</ol>\n<p>&nbsp;</p>\n<p><img src="/help_files/Add Employer 2.png" alt="" width="500" height="106" /></p>\n<p><img src="/help_files/Add Employer 3.png" alt="" width="500" height="76" /></p>\n<ol>\n<li>&nbsp;\n<ul>\n<li></li>\n<li></li>\n<li>5. Click on the "Save &amp; Add a New Case" button</li>\n</ul>\n</li>\n</ol>\n<p>&nbsp;</p>\n<ol>\n<li><img src="/help_files/Add Employer 4.png" alt="" width="500" height="142" /></li>\n<li>&nbsp;\n<ul>\n<li></li>\n<li></li>\n<li>6. Select an&nbsp;appropriate case type. For example - choose "Employer Case - Temp" if you are adding a Standard Business Sponsorship case. Choose "Employer Case - Perm" for Employer Nomination or Regional Sponsored Migration Scheme. Similarly choose "Advice", if you are assisting the sponsoring employer for a monitoring enquiry or simply advising them on any other matter. You can also choose to link an existing individual client or a new individual client to the sponsoring employer by selecting &ldquo;Employer Sponsored Migration&rdquo; case type.</li>\n</ul>\n</li>\n</ol>\n<p>&nbsp;</p>\n<p><img src="/help_files/Add Employer 5.png" alt="" width="500" height="212" /></p>\n<p>&nbsp;</p>\n<ol>\n<li>7. Complete the compulsory fields, choose the responsible staff and click on the &ldquo;Save&rdquo; button</li>\n</ol>\n<p>&nbsp;</p>\n<p><img src="/help_files/Add Employer 6.png" alt="" width="500" height="259" /></p>\n<p>&nbsp;</p>\n<p>Watch Video Here:</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><iframe src="https://player.vimeo.com/video/142204832" width="500" height="277" frameborder="0" allowfullscreen=""></iframe></p>\n<p><a href="https://vimeo.com/142204832" target="_blank" class="blulinkun">Add an employer and case</a> from <a href="https://vimeo.com/user43380339" target="_blank" class="blulinkun">Abhishek Vora</a> on <a href="https://vimeo.com" target="_blank" class="blulinkun">Vimeo</a>.</p>', NULL, 'N', 'text', 11, 'N'),
	(34, 12, 'Home Module Help', '<p>&nbsp;</p>\n<p style="text-align: left;"><span style="text-decoration: underline;">TODAY AT A GLANCE</span></p>\n<p>&nbsp;</p>\n<p>1.Today at a Glance shows Tasks that have become due either today or have become due in the past but haven\'t been taken care of yet</p>\n<p>2. It Also shows if any payments have become due</p>\n<p>3. Notification for a new prospect and new calendar event are shown here</p>\n<p>4. Finally, Today at a glance also shows notifications if your&nbsp;client has uploaded documents to their case or have completed a form using the client portal</p>\n<p>5. Notifications will go away as soon as you action them</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Today at a Glance.png" alt="" width="300" height="196" /></p>\n<p>&nbsp;</p>\n<p><span style="text-decoration: underline;">MY BOOKMARKS</span></p>\n<p>&nbsp;</p>\n<p>1. Add Frequently Visited Websites here</p>\n<p>2. To add a website, click on add Type a label for the website. For example - DIBP for Department of Immigration and Border Protection&rsquo;s website</p>\n<p>3. Provide the URL of the website. For example - www.dibp.gov.au</p>\n<p>4. You can also copy/paster URL from your browser address bar and paste it here (watch video for further explanation.)</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/My Bookmarks.png" alt="" width="300" height="207" /></p>\n<p>&nbsp;</p>\n<p><span style="text-decoration: underline;">ANNOUNCEMENTS</span></p>\n<p>&nbsp;</p>\n<p>Officio releases updates from time to time. You will see those&nbsp;updates&nbsp;in the announcement area.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Announcements.png" alt="" width="300" height="193" /></p>\n<p>&nbsp;</p>\n<p><span style="text-decoration: underline;">MY NOTES</span></p>\n<p>&nbsp;</p>\n<p>You can add general notes here. To add a note:</p>\n<p>&nbsp;</p>\n<p>1. Click on the "Add" button</p>\n<p>2. Type your note</p>\n<p>3. Click on the "Save" button</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/My Notes.png" alt="" width="300" height="200" /></p>\n<p>&nbsp;</p>\n<p><span style="text-decoration: underline;">IMMIGRATION NEWS FEED</span></p>\n<p>&nbsp;</p>\n<p>Officio brings Australian Immigration related news articles from various sources and displays in this section. As you click on an article, it will take you to the source website so that you can ready the full article. Note: Officio does not control what articles are shown here and does not endorse any&nbsp;news articles reported in this section and Officio Pty Ltd is not responsible for the tone, validity, and accuracy of this content.&nbsp;</p>\n<p>&nbsp;</p>\n<p>Please go to "Admin | Define Roles" and disable the News option for selected users and roles, if you do not wish to see the news feed.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/News Feed.png" alt="" width="300" height="398" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', NULL, 'N', 'text', 17, 'N'),
	(35, 13, 'How to create a prospect?', '<p>&nbsp;</p>\n<p>1.Go to the Prospect module</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Add Prospect_1.png" alt="" width="750" height="91" /></p>\n<p>&nbsp;</p>\n<p>2. Click on &ldquo;Add a New Prospect&rdquo;</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Add Prospect 2.png" alt="" width="397" height="135" /></p>\n<p>&nbsp;</p>\n<p>3. Complete compulsory fields</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>4. Click on the &ldquo;Save&rdquo; button</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Add Prospect 3.png" alt="" width="500" height="137" /></p>', NULL, 'N', 'text', 18, 'N'),
	(36, 13, 'Prospects Manager - Working with Prospect Email Templates', '<p>Go to Admin</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Prospect Templates 1.png" alt="" width="757" height="56" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Select Prospects Manager</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Pros Template 2.png" alt="" width="202" height="320" /></p>\n<p>&nbsp;</p>\n<p><br /><span style="font-family: Verdana, Arial, Helvetica, sans-serif;">Select Prospects Templates tab</span></p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Pros template 3.png" alt="" width="300" height="59" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>To add a template click on the &ldquo;New Template&rdquo; button</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Pros template 4.png" alt="" width="300" height="146" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Name your template</p>\n<p>You can choose to designate an email address from which this email will be sent out. Type the email address in the From field to do this (Optional)</p>\n<p>Choose a Subject for the template email</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Pros Template 5.png" alt="" width="433" height="179" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<ul>\n<li>Type the body of the email in the &ldquo;Body of the Template&rdquo; area</li>\n</ul>\n<p>Select &ldquo;Placeholders&rdquo; from the right-hand panel. For example to add name of your prospects to the template - select {fName}</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Pros Template 6.png" alt="" width="627" height="178" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Use formatting to format the body of the email</p>\n<p>Select &ldquo;maximiser&rdquo; button to maximise the &ldquo;Body of the Template&rdquo; area</p>\n<p>&nbsp;</p>\n<p>If you choose to copy content from a Word document - choose &ldquo;Paste from Word&rdquo; button</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Pros Template 7.png" alt="" width="629" height="160" /></p>\n<p>&nbsp;</p>\n<p>Click on the &ldquo;Save Template&rdquo; button</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Pros Template 8.png" alt="" width="367" height="276" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>To Edit a template, select the template to be edited and then click on the &ldquo;Edit Template&rdquo; button or simply double click on the template</p>\n<p>To Delete a template, select the template to be deleted and then click on the &ldquo;Delete Template&rdquo; button</p>\n<p>To set a template as a default template, click on the &ldquo;Set as Default&rdquo; button</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Pros Template 9 Correct.png" alt="" width="500" height="137" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Tip - Your default template can be an email with blank body with a placeholder called - {current_user_email_signature}. This will automatically open a blank email with your signature every time you click on the email button for prospects.</p>\n<p>&nbsp;</p>\n<p>Watch Video Here:</p>\n<p><object width="425" height="344"><param name="movie" value="http://www.youtube.com/v/XhkaNERB3EA&amp;hl=en&amp;fs=1" /><param name="allowFullScreen" value="true" /><embed src="http://www.youtube.com/v/XhkaNERB3EA&amp;hl=en&amp;fs=1" type="application/x-shockwave-flash" width="800" height="550" /></object></p>', NULL, 'N', 'text', 19, 'N'),
	(37, 13, 'Prospects Management - Questionnaires', '<p>Prospects Manager - Settings up Prospects Questionnaire</p>\n<p>&nbsp;</p>\n<p>Go to admin Click on Prospects Manager</p>\n<p>&nbsp;</p>\n<p><img style="undefined" src="/help_files/Prospects Help/Prospect 1.png" alt="" width="504" height="247" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Go to the Questionnaires tab</p>\n<p>A default questionnaire is added to your account when you signed up to Officio</p>\n<p>&nbsp;</p>\n<p><img style="undefined" src="/help_files/Prospects Help/Prospect 2.png" alt="" width="700" height="300" /></p>\n<p>&nbsp;</p>\n<p><strong>Customising your&nbsp;questionnaire:</strong></p>\n<p>&nbsp;</p>\n<p>Select the questionnaire and then click on the &ldquo;Edit&rdquo; button</p>\n<p>&nbsp;</p>\n<p><img style="undefined" src="/help_files/Prospects Help/Prospects 3 (1).png" alt="" width="652" height="219" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Name&nbsp;your questionnaire. For Example - Gold Migration - English</p>\n<p>&nbsp;</p>\n<p>The URL location is a unique location where your Prospects Wizard questionnaire is saved at.</p>\n<p>&nbsp;</p>\n<p>You can either send this link to your prospects via email or embed this link on your website. Embedding the Prospects questionnaire URL on your website in a frame or an iframe will open the questionnaire within your website and will not redirect your prospect to a celebrate page. Speak to your web developer or contact your web designer for this</p>\n<p>&nbsp;</p>\n<p>Select the office for which this questionnaire is for. For example - select &ldquo;main&rdquo; if you have only one office, select a&nbsp;specific office if the prospect questionnaire is for the&nbsp;specific office.</p>\n<p>&nbsp;</p>\n<p>Select a Sales Agent if you have one from the dropdown list if you wish to allocate the questionnaire to a specific sales agent.</p>\n<p>&nbsp;</p>\n<p><img style="undefined" src="/help_files/Prospects Help/Prospects 4.png" alt="" width="776" height="282" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>You can then start customising each field of the questionnaire. For example, if you want change background colour for your questionnaire to match the look of your website, select the colour you like and then click on save</p>\n<p>&nbsp;</p>\n<p>To add or change help text, click on the button shown below</p>\n<p>&nbsp;</p>\n<p>You can type your questions in any language that your computer supports</p>\n<p>&nbsp;</p>\n<p><img style="undefined" src="/help_files/Prospects Help/Prospects 5.png" alt="" width="733" height="490" /></p>\n<p>&nbsp;</p>\n<p><img style="undefined" src="/help_files/Prospects Help/Prospects 6.png" alt="" width="539" height="121" /></p>\n<p>&nbsp;</p>\n<p><img style="undefined" src="/help_files/Prospects Help/Prospects 7.png" alt="" width="540" height="131" /></p>\n<p><img style="undefined" src="/help_files/Prospects Help/Prospect 8.png" alt="" width="410" height="329" /></p>\n<p><img style="undefined" src="/help_files/Prospects Help/Prospects 9.png" alt="" width="412" height="330" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>To customise a closing template, choose the desired template from the drop down list and click on the &ldquo;Save Changes&rdquo; button. Please see the &ldquo;Working with Prospects templates&rdquo; for more information on how to add prospects email templates.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Prospects Help/Prospects 10.png" alt="" width="669" height="130" /></p>\n<p>&nbsp;</p>\n<p>TIP: You can then save a seperate template for each language and choose to embed them on your website</p>\n<p>&nbsp;</p>', NULL, 'N', 'text', 20, 'N'),
	(40, 17, 'How do I login to Officio?', '<p>1.Make sure you are using Mozilla Firefox on Windows or Safari on Mac. Officio works in other browsers but Firefox on Windows allows the best experience of all features.</p>\n\n<p>2.Go to Officio link : secure.officio.com.au &nbsp;</p>\n\n<p>3.Log in with your ID and Password</p>\n\n<p><img alt="" src="/help_files/Picture1.jpg" style="height:179px; margin:10px; width:250px" /></p>\n\n<p>It&rsquo;s most important to enable SSL if you are using a shared public network like a caf&eacute; or airport.</p>', NULL, 'N', 'text', 22, 'Y'),
	(41, 18, 'How do I create an individual prospect?', '<p>1.Choose the &lsquo;Prospects&rsquo; tab</p>\n\n<p>2.Choose <em>&lsquo;</em>Add a New Prospect&rsquo;</p>\n\n<p>3. Complete the prospects form. Look for compulsory fields marked with an asterisk. Choose the Area of interest as per the prospects interview. Once you have created the prospect by completing the necessary fields, Click on the Save button.</p>\n\n<p><img alt="" src="/help_files/Picture2.jpg" style="height:179px; margin:10px; width:750px" /></p>\n\n<p>4. File Notes, and Documents can be added to a prospect only once it has been saved. Once the prospect has been assessed, the relevant subclass can be selected from the &quot;Assessment&quot; tab. Additional Assessment Notes can be added, however they are saved as a document when the case is converted to a client. For more convenient access to notes use file notes or tasks.</p>', NULL, 'N', 'text', 23, 'N'),
	(42, 19, 'How do I convert an individual prospect to a client?', '<p>1. Once the prospect has been assessed, it can be converted into a client. Click on the &quot;Convert to Client&quot; button to do so. Choose the Case Type based on your assessed subclass. For example: Choose Employer Sponsored Migration if the prospect has been assessed suitable for a subclass 457 visa. Once you convert your prospect to a client, you cannot re-assign the case type so choose your case type well. All the file notes and documents from the prospect tab will be automatically transferred to the Clients tab.</p>\n\n<p><img alt="" src="/help_files/Picture3.png" style="height:161px; margin:10px; width:350px" /></p>\n\n<p>2. If you have more than one office, select your Agent&rsquo;s Office from the dropdown (at the bottom of the Primary Applicant Personal Info section).</p>\n\n<p>3. Go to case details and complete the necessary information. Look for compulsory fields marked with an asterisk. Once you have created the client by completing the compulsory fields, you can always return to the form and add more detail later</p>\n\n<p>4. At the bottom of the page, select the appropriate staff as the RMA, Sales &amp; Marketing, Processing Staff and Accounting Staff in the dropdowns under <em>&lsquo;Staff</em><em>Responsible</em><em>for this</em><em>Case&rsquo;</em></p>\n\n<p>5. Remember to save the client by clicking on the &quot;Save&quot; button, just below &lsquo;Case details&rsquo;.</p>\n\n<p>6. A case reference # is automatically generated for your case, incorporating the subclass you have selected. You can click the &quot;Generate New&quot; link which will automatically assign a new case reference #.</p>', NULL, 'N', 'text', 24, 'N'),
	(43, 20, 'How do I create a sponsoring employer?', '<p>1. Choose the &lsquo;Clients&rsquo; tab</p>\n\n<p>2. Choose <em>&lsquo;</em>Add a New Client&rsquo;</p>\n\n<p>3. Select &lsquo;employer&rsquo; as the new client option</p>\n\n<p><img alt="" src="/help_files/Picture15.png" style="height:214px; margin:10px; width:550px" /></p>\n\n<p>4. Select the appropriate office from the &quot;Agent&#39;s Office&quot; dropdown. This will be set by default to the office that you have access to.</p>\n\n<p>5. Complete the form. Look for compulsory fields marked with an orange asterisk. Once you have created the employer entity by completing the compulsory fields, you can always return to the form and add more detail later.</p>\n\n<p>6. Remember to save. The Save &amp; Add a New Case button is on the extreme right of the window.</p>\n\n<p>7. Save &amp; Add a New Case will take you directly to a window that lets you create a new case. A &lsquo;case&rsquo; is needed before you can save documents relating to that sponsorship or nomination.</p>\n\n<p>8. Select the appropriate case type from the dropdown in the &lsquo;Select Case Type&rsquo; field. For example: select &lsquo;Employer Sponsorship - Temp&rsquo; if you think that this employer needs to apply for a Standard Business Sponsorship.</p>\n\n<p><img alt="" src="/help_files/Picture16.png" style="height:166px; margin:10px; width:550px" /></p>\n\n<p>9. At the bottom of the page, select the appropriate staff as the RMA, Sales &amp; Marketing, Processing Staff and Accounting Staff in the dropdowns under <em>&lsquo;Staff</em><em>Responsible for this</em><em>Case&rsquo;</em></p>\n\n<p>10. Remember to Save. The orange &lsquo;Save&rsquo; button is at the top of the page, just below &lsquo;Case details&rsquo;.</p>\n\n<p>11. A case reference # is assigned to the Employer&#39;s case when you save.</p>', NULL, 'N', 'text', 26, 'N'),
	(44, 21, 'How do I link a case to Client\'s case to an Employer\'s case?', '<p>1. Where the individual client and the employer have already been created:</p>\n\n<p>2. Select an existing individual Client&rsquo;s case. The case type should be Employer Sponsored Migration.</p>\n\n<p>3. Select the &lsquo;Case Details&rsquo; subtab (once selected it will show an orange arrow on the right in the case list)</p>\n\n<p>4. Select &lsquo;Link to an Employer&rsquo; button, which is located in the same row as the orange save button.</p>\n\n<p>5. Select the appropriate employer from the dropdown list. Or type the name of the employer.</p>\n\n<p>6. Select the Link button.</p>', NULL, 'N', 'text', 27, 'N'),
	(45, 22, 'What are cases?', '<p>Officio uses a case management structure that allows you to allocate multiple cases to a single client. Your client might have a Student Visa, then a subclass 485, then a 457 linked to an employer. See the following example:</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture4.png" alt="" width="1044" height="402" /></p>\n<p>&nbsp;</p>\n<p>If I search for Toy Story, I can see all his cases displayed in the Search box. In this example, one of those cases is linked to an employer.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture5.png" alt="" width="590" height="576" /></p>\n<p>&nbsp;</p>\n<p>If I was searching for Hardcore Hardware, it would show all cases associated with that employer (not just Toy Story). See:</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture6.png" alt="" width="716" height="565" /></p>', NULL, 'N', 'text', 28, 'N'),
	(46, 23, 'What are case types?', '<p>Case types show you different information for different types of applications, and gives you a place for the documents and notes relevant to that application. For an employer type record, there are four types of cases:</p>\n<p><img src="/help_files/Picture7.png" alt="" width="854" height="480" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Employer Case &ndash; Temp is for any sort of employer sponsorship, like an SBS, Occupational Trainee Sponsorship or a Labour Agreement.</p>\n<p>Employer Case &ndash; Perm is for a permanent visa nomination (like ENS or RSMS)</p>\n<p>Employer Advice is for advice only to an employer &ndash; such as monitoring, or audit.</p>\n<p>Employer Sponsored Migration is for an individual employee&rsquo;s specific visa application. This is a quick way to create an individual client that is already linked to this employer.</p>\n<p>For an individual record, there are 7 types of cases:</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture8.png" alt="" width="916" height="583" /></p>\n<p>&nbsp;</p>\n<p>Employer Sponsored Migration is for any employer sponsored visa application, temporary or permanent, like a 457, ENS, RSMS.</p>\n<p>&nbsp;</p>\n<p>An Independent Application is for any application that does not require sponsorship, including an Independent Permanent Skilled, Protection, Visitor, Resident Return, Student etc</p>\n<p>&nbsp;</p>\n<p>A State/Territory Sponsored Application is for any application that requires state sponsorship, including Business Innovation, Subclass 190 etc.</p>\n<p>&nbsp;</p>\n<p>A Family Sponsored application includes partner, child and parent visa applications.</p>\n<p>&nbsp;</p>\n<p>A review case is any merits or judicial review, including Ministerial Intervention.</p>\n<p>&nbsp;</p>\n<p>An advice case is simply advice, not necessarily associated with an application.</p>\n<p>&nbsp;</p>\n<p>Citizenship cases are self explanatory.</p>', NULL, 'N', 'text', 29, 'N'),
	(47, 24, 'How does the Accounting work?', '<p>1. Select your Client</p>\n<p>&nbsp;</p>\n<p>2. Choose the &lsquo;Accounting&rsquo; tab</p>\n<p>&nbsp;</p>\n<p>3. Choose &lsquo;Define Retainer Schedule&rsquo; to define a schedule for payment including professional fees and the department of immigration fee. The system will remind you automatically as soon as payment becomes due.</p>\n<p>&nbsp;</p>\n<p>4. If you have created an invoice template, choose the invoice template.</p>\n<p>&nbsp;</p>\n<p>5. Click on the invoice number to view, send, save as a document or delete the invoice.</p>\n<p>&nbsp;</p>\n<p>6. To send invoice and request payment from the client, click on the invoice number and then click on email</p>\n<p>&nbsp;</p>\n<p>7. Choose &lsquo;Send Request for Payment&rsquo; as a template in the email compose window to ask for fees from the Client. You can send the payment request by email or choose to print the request and send by post.</p>\n<p>&nbsp;</p>\n<p>8. Once the payment is made into the client Account, Choose the Client A/C Tab and assign the appropriate payment to the correct case. A prompt will ask if you want to send your client a receipt of payment. You can choose to send this by email or print it and send by post. If you have created a receipt template, you can attach a pdf of this in the email.</p>\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; To attach a receipt template to the receipt email &ndash;</p>\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Go to My Documents module</p>\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Go to templates</p>\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Select the folder in which you would like to add the receipt template (Eg: shred templates)</p>\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Choose add a template and then select add a letter template</p>\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Either start a receipt template from scratch or upload an existing word document as the receipt template.</p>\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Define the category of template as receipt of payment template</p>\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; After merging fields, save template</p>\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Go to the email template &ndash; attach the letter template with the email template and click on send as pdf</p>\n<p>&nbsp;</p>\n<p>9. Once the corresponding work is done associated with the payment, you can then add the fees from client A/C to the operating account. To do this, go to Client A/C and assign the corresponding withdrawal to the client&rsquo;s case. The system will automatically reconcile the amount in the client account summary table in the client&rsquo;s accounting sub-tab.</p>\n<p>&nbsp;</p>\n<p>10. All Communication with regards to the Request for payment, Receipts and Invoice will be automatically saved in the client\'s "correspondence" folder under the relevant case.</p>\n<p>&nbsp;</p>\n<p>11. <span style="text-decoration: underline;">IMPORTANT</span>: You will need to link your net-banking account to the \'client A/C\' tab by importing Bank statements before assigning a payment to the client. This can be done by clicking on the import button. You will not be able to transfer or allocate funds to a case without this. If you do not wish to link or import your bank statements, you can choose to manually enter the transactions in the \'Client A/C\' tab by selecting the Manual Entry option.</p>', NULL, 'N', 'text', 30, 'N'),
	(48, 25, 'How do I add tasks and file notes?', '<p>Adding Tasks:</p>\n<p>&nbsp;</p>\n<p>1. Choose your client&rsquo;s case&nbsp;</p>\n<p>&nbsp;</p>\n<p>2. Select &lsquo;Tasks&rsquo; tab&nbsp;</p>\n<p>&nbsp;</p>\n<p>3. Select &lsquo;New&rsquo;&nbsp;</p>\n<p>&nbsp;</p>\n<p>4. Set yourself a reminder according to a date, event or a specific timeframe. The task becomes active when it is due (ie when you need to begin action on it by, for example, writing to a client0, and should be completed by the deadline.</p>\n<p>&nbsp;</p>\n<p>5. To add file notes to your task, select &ldquo;reply&rdquo; and then add your file notes</p>\n<h1>&nbsp;</h1>\n<h1><img src="/help_files/Picture9.png" alt="" width="1026" height="451" />&nbsp;</h1>\n<p>&nbsp;</p>\n<h1><strong>Adding File Notes: File notes section can be used when a note is note related to a task or does not have a deadline. For those file notes that have a deadline or are related to a task &ndash; use tasks instead.</strong></h1>\n<p>&nbsp;</p>\n<p>1. Select your Client&rsquo;s case</p>\n<p>&nbsp;</p>\n<p>2. Choose the &lsquo;File Notes&rsquo; tab &nbsp;</p>\n<p>&nbsp;</p>\n<p>3. Select &lsquo;Add Note&rsquo; &nbsp;</p>\n<p>&nbsp;</p>\n<p>4. Type your File Note</p>', NULL, 'N', 'text', 31, 'N'),
	(49, 26, 'How does the Email function work?', '<p>Officio has built in email facilities. Your existing IMAP or POP emails can be linked to Officio. You will be able to use your own email from within Officio\'s interface without having the need to use external software. All Officio\'s Email related functions can be linked your email. You can choose to link multiple Email Accounts with Officio.</p>\n<p>&nbsp;</p>\n<p>Most users maintain their existing email, and supplement it by using Officio&rsquo;s email module where it adds the most value, for example saving emails to a case, or sending a template email directly from a case.</p>\n<p>&nbsp;</p>\n<p>1. Choose Email&nbsp;</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture99.png" alt="" width="728" height="322" /></p>\n<p>&nbsp;</p>\n<p>2. Click Settings &nbsp;</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture14.png" alt="" width="751" height="286" /></p>\n<p>&nbsp;</p>\n<p>3. Define your Email server co-ordinates. These can be found on your server settings or can be provided by your email host. For example it may look like - mail.company.net or pop.company.net or smtp.company.com</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture10.png" alt="" width="632" height="438" /></p>\n<p>&nbsp;</p>\n<p>4. Save an email into client\'s file by clicking on the \'save to\' button, the system recognises your client\'s email and saves it into the appropriate case.</p>\n<p>&nbsp;</p>\n<p>5. You can download attachment only by clicking on \'save attachment separately\' &nbsp;</p>\n<p>&nbsp;</p>\n<p>6. You can choose to remove the email from the inbox by clicking on &lsquo;remove from inbox after saving\' option. &nbsp;</p>\n<p>&nbsp;</p>\n<p>7. Click on \'new\' to send out an email, you can choose a pre-defined template or type an email. you can choose the account from which you want to send the email by clicking on the \'from\' dropdown. &nbsp;</p>\n<p>&nbsp;</p>\n<p>8. Click on \'Send &amp; Save to Case\' if you are sending an email to an existing client. The system will recognise the email address and save it into the corresponding client\'s case file. Choose \'send &amp; save to prospect\' if you are sending the email to a prospect. You can choose the \'send\' option to send it to someone that is not your client or prospect.</p>', NULL, 'N', 'text', 32, 'N'),
	(50, 27, 'How does the Calandar function work?', '<h1><strong><img src="/help_files/Picture11.png" alt="" width="1026" height="437" /></strong></h1>\n<h1>&nbsp;</h1>\n<h1><strong>1. Choose the calendar tab</strong></h1>\n<p>&nbsp;</p>\n<h1><strong>2. To assign a new calendar, click &lsquo;add calendar&rsquo;</strong></h1>\n<p>&nbsp;</p>\n<h1><strong>3. To share a calendar, click &lsquo;share and publish&rsquo;</strong></h1>\n<p>&nbsp;</p>\n<h1><strong>4. To share a calendar/event on an iOS device, choose &lsquo;Export to iCalendar&rsquo; option</strong></h1>\n<p>&nbsp;</p>\n<h1><strong>5. To share a calendar with staff, choose the calendar and then choose the staff from the &lsquo;share this calendar with&rsquo; dropdown box</strong></h1>\n<p>&nbsp;</p>\n<h1><strong>6. You can choose to colour code the calendar</strong></h1>', NULL, 'N', 'text', 33, 'N'),
	(51, 28, 'How do I create a Template?', '<h1><strong>1. Choose &lsquo;My Documents&rsquo; tab</strong></h1>\n<p>&nbsp;</p>\n<h1><strong>2. Go to &lsquo;Templates&rsquo; section</strong></h1>\n<p>&nbsp;</p>\n<h1><strong>3. Select a pre-defined template</strong></h1>\n<p>&nbsp;</p>\n<h1><strong>4. Choose &lsquo;edit&rsquo; to edit a pre-defined template, and edit the template</strong></h1>\n<p>&nbsp;</p>\n<h1><strong>5. Choose &lsquo;new&rsquo; to start a new template. Type within the template body box and select &lsquo;place holders&rsquo; from the list on the right to auto-populate the corresponding information in a template. For example: select &ldquo;&lt;first name&gt;&rdquo; to include client&rsquo;s Given Name in the template.</strong></h1>\n<p>&nbsp;</p>\n<h1><strong>6. Click save (bottom right) to save the template for future use</strong></h1>\n<p>&nbsp;</p>\n<h1><strong>7. Templates can be used in emails or in letter merge</strong></h1>\n<p>&nbsp;</p>\n<h1><strong>8. To merge a template to a letter, go to the client&rsquo;s &ldquo;Documents&rdquo; tab and select &ldquo;new Letter Merge&rdquo;, select the appropriate template and name the file. Officio will automatically merge information from the client&rsquo;s file and generate a file which can be edited straight from Officio</strong></h1>', NULL, 'N', 'text', 34, 'N'),
	(52, 29, 'How do I upload Documents?', '<p>1. Go to a case&rsquo;s Document tab</p>\n<p>&nbsp;</p>\n<p>2. Select upload to upload documents from a local computer</p>\n<p>&nbsp;</p>\n<p>3. Select &lsquo;New Document&rsquo; to create a new word processing document using Officio&rsquo;s online editing tool</p>\n<p>&nbsp;</p>\n<p>4. Select &lsquo;letter merge&rsquo; to create a new template letter</p>\n<p>&nbsp;</p>\n<p>5. You can add or delete folders to the Documents tab</p>\n<p>&nbsp;</p>\n<p>6. Default folder settings can be changed by the company admin &nbsp;</p>\n<!-- [if gte mso 9]><xml>\n <o:DocumentProperties>\n  <o:Version>12.00</o:Version>\n </o:DocumentProperties>\n</xml><![endif]-->\n<p class="MsoListParagraph" style="margin-left: 72.0pt; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><span style="font-size: 11.5pt; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; mso-bidi-font-weight: bold;"><span style="mso-list: Ignore;">1.<span style="font: 7.0pt \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style="font-size: 11.5pt; mso-fareast-font-family: Calibri; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;">Go to a case&rsquo;s Document tab</span></p>\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 11.5pt; mso-fareast-font-family: Calibri; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;">&nbsp;</span></p>\n<p class="MsoListParagraph" style="margin-left: 72.0pt; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><span style="font-size: 11.5pt; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; mso-bidi-font-weight: bold;"><span style="mso-list: Ignore;">2.<span style="font: 7.0pt \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style="font-size: 11.5pt; mso-fareast-font-family: Calibri; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;">Select upload to upload documents from a local computer</span></p>\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 11.5pt; mso-fareast-font-family: Calibri; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;">&nbsp;</span></p>\n<p class="MsoListParagraph" style="margin-left: 72.0pt; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><span style="font-size: 11.5pt; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; mso-bidi-font-weight: bold;"><span style="mso-list: Ignore;">3.<span style="font: 7.0pt \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style="font-size: 11.5pt; mso-fareast-font-family: Calibri; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;">Select &lsquo;New Document&rsquo; to create a new word processing document using Officio&rsquo;s online editing tool</span></p>\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 11.5pt; mso-fareast-font-family: Calibri; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;">&nbsp;</span></p>\n<p class="MsoListParagraph" style="margin-left: 72.0pt; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><span style="font-size: 11.5pt; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; mso-bidi-font-weight: bold;"><span style="mso-list: Ignore;">4.<span style="font: 7.0pt \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style="font-size: 11.5pt; mso-fareast-font-family: Calibri; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;">Select &lsquo;letter merge&rsquo; to create a new template letter</span></p>\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 11.5pt; mso-fareast-font-family: Calibri; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;">&nbsp;</span></p>\n<p class="MsoListParagraph" style="margin-left: 72.0pt; text-align: justify; tex