-size: 11.5pt; mso-fareast-font-family: Calibri; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;">Select &lsquo;letter merge&rsquo; to create a new template letter</span></p>\n<p class="MsoListParagraph" style="margin-left: 72.0pt; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><span style="font-size: 11.5pt; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; mso-bidi-font-weight: bold;"><span style="mso-list: Ignore;">5.<span style="font: 7.0pt \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style="font-size: 11.5pt; mso-fareast-font-family: Calibri; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;">You can add or delete folders to the Documents tab</span></p>\n<p class="MsoListParagraph" style="margin-left: 72.0pt; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><span style="font-size: 11.5pt; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; mso-bidi-font-weight: bold;"><span style="mso-list: Ignore;">6.<span style="font: 7.0pt \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style="font-size: 11.5pt; mso-fareast-font-family: Calibri; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;">Default folder settings can be changed by the company admin</span></p>\n<!-- [if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves/>\n  <w:TrackFormatting/>\n  <w:PunctuationKerning/>\n  <w:ValidateAgainstSchemas/>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF/>\n  <w:LidThemeOther>EN-AU</w:LidThemeOther>\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\n  <w:LidThemeComplexScript>HI</w:LidThemeComplexScript>\n  <w:Compatibility>\n   <w:BreakWrappedTables/>\n   <w:SnapToGridInCell/>\n   <w:WrapText