ed="false" Priority="73" SemiHidden="false"\n   UnhideWhenUsed="false" Name="Colorful Grid Accent 6"/>\n  <w:LsdException Locked="false" Priority="19" SemiHidden="false"\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Emphasis"/>\n  <w:LsdException Locked="false" Priority="21" SemiHidden="false"\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n	{mso-style-name:"Table Normal";\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-priority:99;\n	mso-style-qformat:yes;\n	mso-style-parent:"";\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\n	mso-para-margin:0cm;\n	mso-para-margin-bottom:.0001pt;\n	mso-pagination:none;\n	font-size:11.0pt;\n	font-family:"Calibri","sans-serif";\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:Mangal;\n	mso-bidi-theme-font:minor-bidi;\n	mso-ansi-language:EN-US;\n	mso-fareast-language:EN-US;\n	mso-bidi-language:AR-SA;}\n</style>\n<![endif]-->', NULL, 'N', 'text', 35, 'Y'),
	(53, 30, 'How do I create a Form?', '<p>1. Choose Forms tab &nbsp;</p>\n<p>&nbsp;</p>\n<p>2. Choose &lsquo;Add Form&rsquo; &nbsp;</p>\n<p>&nbsp;</p>\n<p>3. Select the applicant from the &lsquo;Family Member&rsquo; dropdown where you are assigning a form a family member. For example &ndash; if assigning a questionnaire to spouse, choose spouse&rsquo;s name from the dropdown list &nbsp;</p>\n<p>&nbsp;</p>\n<p>4. Choose forms category from the left panel or simply type the name or number of the form in the search box. &nbsp;</p>\n<p>&nbsp;</p>\n<p>5. Choose the form needed to be assigned from the left panel &nbsp;</p>\n<p>&nbsp;</p>\n<p>6. Common information is shared between related forms automatically once a form, questionnaire or profile field is filled with the relevant data. For example: when you assign Form 80 to an applicant, it will be pre-filled automatically if your client has filled out the &ldquo;Permanent Resident Visa Questionnaire.&rdquo; &nbsp;</p>\n<p>&nbsp;</p>\n<p>7. You can invite your clients to fill questionnaires from Client Portal. Once completed, you will get a notification to review these forms. &nbsp;</p>\n<p>&nbsp;</p>\n<p>8. Once reviewed, you can lock your client&rsquo;s access to the forms.</p>', NULL, 'N', 'text', 36, 'Y'),
	(55, 32, 'Why can\'t I see PDF documents in the browser?', '<p>Only the firefox browser has the capabilities of displaying PDFs within the browser. If you are using Chrome and cannot see PDF\'s then we suggest you switch to Firefox for using Officio</p>\n<p>&nbsp;</p>\n<p>How to use adobe acrobat in Firefox &nbsp;</p>\n<p>&nbsp;</p>\n<p>Firstly, open Firefox and select &ldquo;Tools&rdquo; at the top right of your browser. Then select &ldquo;Options&rdquo; from the dropdown menu.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture1.png" alt="" width="942" height="508" /></p>\n<p>&nbsp;</p>\n<p>A menu should then appear in your window, you must then select the &ldquo;Applications&rdquo; tab at the top.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture2.png" alt="" width="537" height="491" /></p>\n<p>&nbsp;</p>\n<p>From there you must navigate down to the &ldquo;Portable Document Format (PDF)&rdquo; option. From here you must click on the drop down menu to the right and select &ldquo;Use Adobe Acrobat (in Firefox)&rdquo;.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture33.png" alt="" width="537" height="491" /></p>\n<p>&nbsp;</p>\n<p>After this is done you must restart your browser for the changes to take effect.</p>', NULL, 'N', 'text', 38, 'Y'),
	(56, 32, 'How to clear cache in Firefox', '<p>Firstly, while in your Firefox browser, select the &ldquo;History&rdquo; option at the top right of the browser and then select &ldquo;Clear Recent History&rdquo;.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture44.png" alt="" width="1365" height="735" /></p>\n<p>&nbsp;</p>\n<p>In the menu that opens, for the &ldquo;Time range to clear&rdquo; option you must select &ldquo;Everything&rdquo; and in the &ldquo;Details&rdquo; menu below you must make sure that only &ldquo;Cookies&rdquo; and &ldquo;Cache&rdquo; are ticked. Once this is done you can then select &ldquo;Clear now&rdquo; and then close down your browser to finish.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture55.png" alt="" width="424" height="393" /></p>\n<p>&nbsp;</p>', NULL, 'N', 'text', 39, 'Y'),
	(57, 32, 'How to clear cache in Chrome', '<p>Firstly, while in your Chrome browser, select the &ldquo;Menu&rdquo; button at the top right of the browser and then select &ldquo;More Tools&rdquo; and then "Clear Browsing Data".</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture66.png" alt="" width="1365" height="740" /></p>\n<p>&nbsp;</p>\n<p>In the menu that opens, for the &ldquo;Obliterate the following items from:&rdquo; option you must select &ldquo;the beginning of time&rdquo; and in the menu below you must make sure that only &ldquo;Cookies and other site and plugin data&rdquo; and &ldquo;Cached images and files&rdquo; are ticked. Once this is done you can then select &ldquo;Clear browsing data&rdquo; and then close down your browser to finish.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture77.png" alt="" width="501" height="453" /></p>', NULL, 'N', 'text', 40, 'Y'),
	(58, 32, 'Why is my screen blank when I log in?', '<p>If when you log into officio your screen loads like this:</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture88.png" alt="" width="720" height="314" /></p>\n<p>&nbsp;</p>\n<p>Then you most likely are using internet explorer to load officio. Unfortunately internet explorer is not supported by officio and to fix this we recommend you use Firefox to access your officio.</p>', NULL, 'N', 'text', 41, 'Y'),
	(59, 33, 'The \'Attach file\' button for emails is not showing, how do I fix this?', '<p>This is the button which should normally appear: <a href="http://screencast.com/t/ZgSZAoof2RJ" target="_blank" class="blulinkun">Click for Screenshot</a></p>\n<p>&nbsp;</p>\n<p>If you are not able to see the displayed \'Attach file\' button when attempting to add attachments to an email, please download the latest version of Adobe Flash by clicking <a href="http://get.adobe.com/flash" target="_blank" class="blulinkun">this link.</a></p>\n<p>&nbsp;</p>\n<p>Once you have downloaded and installed the latest version of Adobe Flash, you will need to close all of your browser windows and reopen Officio. This should resolve the issue.</p>', NULL, 'N', 'text', 42, 'N'),
	(60, 33, 'How do I park an email to a client or prospect case?', '<p>Saving an email to a client or prospect case in Officio is easy!</p>\n<p>&nbsp;</p>\n<p>The first step is to navigate to the email module in Officio and select the email you wish to park to a client or prospect case.</p>\n<p>&nbsp;</p>\n<p>Select the email, and then click <a href="http://screencast.com/t/5qwaxQh6z9p" target="_blank" class="blulinkun">\'Save To\' </a>from the menu icons.</p>\n<p>&nbsp;</p>\n<p>Then choose either "Save to Case" or "Save to Prospect".</p>\n<p>&nbsp;</p>\n<p>Once you have made your choice, a new <a href="http://screencast.com/t/t7F6XUCt4" target="_blank" class="blulinkun">context menu</a> will appear. From this menu, you will be able to choose the case or prospect in which you wish to save the email.</p>\n<p>&nbsp;</p>\n<p>Enter the name of the client and choose the correct case from the<a href="http://screencast.com/t/l9DSJasyk" target="_blank" class="blulinkun"> list of options </a>presented.</p>\n<p>&nbsp;</p>\n<p>Then you have <a href="http://screencast.com/t/oai3W8VL" target="_blank" class="blulinkun">a couple of options</a> on how you save the email. The options are to either save the email and attachments separately, and/or to remove the original email from your inbox*.</p>\n<p>&nbsp;</p>\n<p>Once you click \'Save\' the email and any attacments will be <a href="http://screencast.com/t/CHQGH1nuB" target="_blank" class="blulinkun">saved in the \'Correspondence\' folder</a> in the \'Documents\' tab of the active case. If you chose to save the attachments separately, they will appear in the same folder in the Documents tab, as separate files.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><strong>*Please note:</strong> if your email is setup as IMAP, removing the email original from your inbox removes it from the inbox on your computer iPhone/Android device, and tablet as well. It is advisable only to remove the original if you expect to have no further interaction with that email (replying, forwarding, etc).</p>', NULL, 'N', 'text', 43, 'N'),
	(61, 33, 'How do I return a parked message to my inbox?', '<p>Messages parked in a prospect or client\'s Correspondence folder (under the Documents tab) may be returned to the Inbox by following <a href="http://screencast.com/t/RXEHv0f34Gy" target="_blank" class="blulinkun">these steps</a>:</p>\n<p>&nbsp;</p>\n<p>1. Check the box next to the email you wish to return to the Inbox.</p>\n<p>2. From the menu icons in the Documents tab, choose "Send to Inbox".</p>\n<p>&nbsp;</p>\n<p>That\'s it!</p>\n<p>&nbsp;</p>', NULL, 'N', 'text', 44, 'N'),
	(62, 3, 'How can I enter funds received from a client against an amount owing in the Financial Transaction Table?', '<p>A good practice requires you to deposit all fees received from your client into your Trust Account. If your client has a deposit in your Trust Account, in the Financial Transaction table of that client, simply click on <span style="font-size: small;"><span style="font-weight: bold;">Transfer from Trust A/C</span> and enter the amount you wish to transfer. The system will allow you to transfer an amount not exceeding the amount owing from trust account to pay off the outstanding balance of your client.<br /></span><span style="font-size: small;"><br />If you do not use a Trust Account, in the Financial Transaction table choose </span><span style="font-size: small;"> <span style="font-weight: bold;">Transfer from a Non-Trust A/C Source</span> and enter the amount you have received from your client.<br /><br /><img src="http://uniques.ca/officio_support/2010-03-07_trust_account.gif" alt="" /><br /></span></p>\n<p>&nbsp;</p>\n<p><span style="font-size: small;">For More:</span></p>\n<p>&nbsp;</p>\n<p>Contact Support on:</p>\n<p>&nbsp;</p>\n<p>Telephone: 07 3212 2266</p>\n<p>Email: support@officio.com.au</p>\n<p>&nbsp;</p>\n<p>Phone Support times: 9:00am to 3:30pm. Monday to Friday.</p>\n<p>&nbsp;</p>\n<p>Email Turnaround: 24 hours</p>', NULL, 'N', 'text', 45, 'Y'),
	(63, 10, 'How do I create a new subclass?', '<p>To create a new subclass for Officio you first have to access the Admin module up the top right of Officio.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture17.png" alt="" width="1367" height="609" /></p>\n<p>&nbsp;</p>\n<p>Once there you can select the &ldquo;All Subclasses&rdquo; option at the left of your screen to access a list of all existing subclasses.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture18.png" alt="" width="1367" height="609" /></p>\n<p>&nbsp;</p>\n<p>You then have the ability to add new subclass options or to remove existing subclass options. It is also important to remember to click &ldquo;Save Changes&rdquo; once you have made all the changes you wish to make.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture19.png" alt="" width="1367" height="609" /></p>\n<p>&nbsp;</p>\n<p>When creating a new option it is important to remember that you must enter both a name and an abbreviation for the subclass (The abbreviation is used in creating file notes). An abbreviation can either be added by tabbing across from the name section or some double clicking in the abbreviation section.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture20.png" alt="" width="1115" height="484" /></p>', NULL, 'N', 'text', 46, 'N'),
	(64, 32, 'How do I add a new Migration Office?', '<p>1.Access the Admin module in Officio at the top right of the Officio website</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture21.png" alt="" width="848" height="521" /></p>\n<p>&nbsp;</p>\n<p>2.Select the &ldquo;Agent&rsquo;s Office&rdquo; tab on the left panel of the Admin screen</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture22.png" alt="" width="1297" height="482" /></p>\n<p>&nbsp;</p>\n<p>3.From this screen you can see all the current offices that you have. To add a new office you can simply click the &ldquo;Add New Option&rdquo; button and enter the name of your office into the text box. Offices can also be removes by clicking the &ldquo;Remove Option&rdquo; button.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture23.png" alt="" width="1088" height="461" /></p>\n<p>&nbsp;</p>\n<p>4.Once all the changes have been made you can click the &ldquo;Save Changes&rdquo; button to save all the changes you have made.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>5.The order of how the Offices will appear in a list can also be changes on the right side of this screen by clicking the arrows.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture24.png" alt="" width="1087" height="408" /></p>\n<p>&nbsp;</p>\n<p>6.When creating a client you can assign them to an agents office to determine which users can view this specific client.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture25.png" alt="" width="713" height="414" /></p>\n<p>&nbsp;</p>\n<p>7.Admin users automatically have access to all offices, but non-admin users must be given access to new offices. This can be done in the &ldquo;Users&rdquo; section of Admin when editing a user.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture26.png" alt="" width="848" height="521" /></p>\n<p>&nbsp;</p>', NULL, 'N', 'text', 47, 'Y'),
	(65, 35, 'User Settings', '<p>To edit the users for your company in Officio you first have to access the Admin tab up the top right of Officio.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture0.png" alt="" /></p>\n<p>&nbsp;</p>\n<p>From there you simply need to click on &ldquo;Users&rdquo; in the left section under &ldquo;Manage Users&rdquo; </p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture27.png" alt="" width="1334" height="514" /></p>\n<p>&nbsp;</p>\n<p>From this screen you are able to edit and log in as certain users as well as being able to activate/deactivate/delete certain roles through the check boxes on the right. At the top right of the screen you are also able to add a new user.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture28.png" alt="" width="1125" height="484" /></p>\n<p>&nbsp;</p>\n<p>When adding a new user you are able to set their username/password as well as their personal details and what role they will use. Once you are done creating the user you can press the &ldquo;Create New User&rdquo; button at the bottom of the page to create it.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture29.png" alt="" width="1102" height="592" /></p>', NULL, 'N', 'text', 48, 'Y'),
	(66, 35, 'Company Details and Invoices', '<p>To access the details and invoices for your company in Officio you first have to access the Admin tab up the top right of Officio.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture0.png" alt="" width="1363" height="608" /></p>\n<p>&nbsp;</p>\n<p>From here you can simply click on the &ldquo;Company Details&rdquo; tab on the left to access the company details. You can then click on any of the various tabs up the top of the company details page to access the things such as the account details and invoices.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture30.png" alt="" width="1336" height="515" /></p>\n<p>&nbsp;</p>\n<p>You can also edit your company&rsquo;s details from this page. Remember to click the &ldquo;Update Company Info&rdquo; button down the bottom once you are finished.</p>', NULL, 'N', 'text', 49, 'Y'),
	(67, 35, 'Company Details Exports', '<p>To export company details data for your company in Officio you first have to access the Admin tab up the top right of Officio.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture0.png" alt="" width="1363" height="608" /></p>\n<p>&nbsp;</p>\n<p>From here you can simply click on the &ldquo;Company Details&rdquo; tab on the left to access the company details.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture31.png" alt="" width="1338" height="432" /></p>\n<p>&nbsp;</p>\n<p>You can then scroll down to the &ldquo;Export&rdquo; section and select what category you wish to export data on.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture32.png" alt="" width="852" height="287" /></p>\n<p>&nbsp;</p>\n<p>Once you have clicked on any of these buttons Officio should open an excel spreadsheet with all the data on that selected category enclosed.</p>', NULL, 'N', 'text', 50, 'Y'),
	(68, 35, 'Access Logs', '<p>To access the logs for your company in Officio you first have to access the Admin tab up the top right of Officio.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture0.png" alt="" width="1363" height="608" /></p>\n<p>&nbsp;</p>\n<p>From here you can simply click on the &ldquo;Access Logs&rdquo; tab on the left to access the company&rsquo;s logs. From here you can see all the actions that users in your company have taken as well as who has taken them. If you wish to refine your search there is a section on the right to search within certain parameters.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture34.png" alt="" width="1294" height="482" /></p>', NULL, 'N', 'text', 51, 'Y'),
	(69, 35, 'Agent\'s Office', '<p>To access the agent&rsquo;s offices for your company in Officio you first have to access the Admin tab up the top right of Officio.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture0.png" alt="" width="1363" height="608" /></p>\n<p>&nbsp;</p>\n<p>From here you can select the &ldquo;Agent&rsquo;s Office&rdquo; tab on the left to view all the current offices for agents. From this screen you can decide to add and delete existing offices. Once you are done editing you can click the &ldquo;Save Changes&rdquo; button to save the changes you have made. There is no limit to how many agent offices you can have.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture35.png" alt="" width="1295" height="482" /></p>\n<p>&nbsp;</p>\n<p>Once you have created a new office you can decide which non-Admin users get to see cases belonging to that office. This is done in the &ldquo;Users&rdquo; tab of Admin and can be changed under the &ldquo;Agents Office&rdquo; section.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture36.png" alt="" width="1092" height="589" /></p>', NULL, 'N', 'text', 52, 'Y'),
	(70, 35, 'Automatic Tasks', '<p>To access the automatic tasks for your company in Officio you first have to access the Admin tab up the top right of Officio.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture0.png" alt="" width="1363" height="608" /></p>\n<p>&nbsp;</p>\n<p>From here you can select the &ldquo;Agent&rsquo;s Office&rdquo; tab on the left to view a list of all the current automatic tasks that run for your company. From this screen you can add, edit and delete tasks.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture37.png" alt="" width="1295" height="486" /></p>\n<p>&nbsp;</p>\n<p>When adding an automatic task you are able to name the task and allocate it to an agent as well as have a message attached to it. You can also set when the task will trigger, such as when an action is complete or after a certain amount of days.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture38.png" alt="" width="447" height="383" /></p>', NULL, 'N', 'text', 53, 'Y'),
	(71, 35, 'Customising Forms', '<p>To customise forms for your company in Officio you first have to access the Admin tab up the top right of Officio.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture0.png" alt="" width="1363" height="608" /></p>\n<p>&nbsp;</p>\n<p>From here you can select the &ldquo;Customise Forms&rdquo; tab on the left. From this screen you can add, edit and delete custom forms.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture39.png" alt="" width="1295" height="397" /></p>\n<p>&nbsp;</p>', NULL, 'N', 'text', 54, 'Y'),
	(72, 35, 'Case Reference Number', '<p>A case reference number is a set of values that is given to a case when it is created to allow each case to have a unique identifier and allow them to be easily searched. To see a case reference number of a certain case you have to go into the Clients module, select the case that you wish to view the reference number of and click on the Case Details tab.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture40.png" alt="" width="971" height="374" /></p>\n<p>&nbsp;</p>\n<p>You can also set up your case reference number to be created the way you want it to. To do this we have to access the admin module up the top right of your screen.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture41.png" alt="" width="1354" height="589" /></p>\n<p>&nbsp;</p>\n<p>Once we are on the admin page we then need to click on a button on the left hand side of the screen that should say &ldquo;Case Reference Number Settings&rdquo;.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture42.png" alt="" width="692" height="366" /></p>\n<p>&nbsp;</p>\n<p>On this page you should see an array of option to change around your case reference number to be any way you like. The first two options allow you to decide between manually entering a case reference number or having one automatically generated for you.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture43.png" alt="" width="775" height="337" /></p>\n<p>&nbsp;</p>\n<p>If you select the option to automatically generate a Case Reference Number you should see a large number of options to customise your Case Reference Number. Each of these can be turned off and on using the check boxes and can also have their orders changed to change where each option appears in the number. For example the order can be changed to show the subclass abbreviation first. &nbsp; &nbsp;</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture45.png" alt="" width="617" height="389" /></p>\n<p>&nbsp;</p>\n<p>Now onto each feature, the first feature shown allows you to add a fixed set of characters to the case reference number. For example if I wanted to add AUS to the start of the number I would select the feature and enter &ldquo;AUS&rdquo; into the box and move it to the top of the order.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture46.png" alt="" width="593" height="449" /></p>\n<p>&nbsp;</p>\n<p>The next feature allows you to put the first certain amount of letters from their family name and their first name into the case reference number. For example if I wanted the case reference number to contain the first 3 letters of their family name and the first 3 letters of their first name then I would select the option and insert &ldquo;3&rdquo; into each of the boxes.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture47.png" alt="" /></p>\n<p>&nbsp;</p>\n<p>The third feature allows you to add a reference number to each case starting from a value set by you. This value will increase by 1 for each new case that is created to allow you to keep track each new case.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture48.png" alt="" width="600" height="396" /></p>\n<p>&nbsp;</p>\n<p>The fourth feature allows you to insert an abbreviation of the visa subclass of the case to the case reference number. For example if the visa subclass abbreviation of the case is &ldquo;123&rdquo; then it will add 123 to the number.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture49.png" alt="" width="583" height="399" /></p>\n<p>&nbsp;</p>\n<p>The final feature allows you to add a count of the total number of all the cases for the client to the case reference number. For example if the client had 456 cases then it could add 456 to the number.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture49.png" alt="" width="583" height="399" /></p>\n<p>&nbsp;</p>\n<p>You can also edit what symbol is used to separate each field such as dots or dashes. There is also a check box to allow you to decide if you want the user to be able to edit their case reference number.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Picture51.png" alt="" width="568" height="388" /></p>', NULL, 'N', 'text', 55, 'Y'),
	(73, 36, 'Using POP email vs IMAP email - what are the differences?', '<p>&nbsp;</p>\n<p><strong><span style="text-decoration: underline;">The Basics:</span></strong></p>\n<p>&nbsp;</p>\n<p>There are two methods mail servers use to send and receive emails, POP and IMAP.<br /><br /><strong>POP</strong>&nbsp;is a much simpler protocol, making implementation easier.&nbsp;<strong>POP mail</strong>&nbsp;moves the message from the&nbsp;<strong>email</strong>&nbsp;server onto your local computer, although there is usually an option to leave the messages on the&nbsp;<strong>email</strong>&nbsp;server as well.</p>\n<p>&nbsp;</p>\n<p>IMAP defaults to leaving the message on the&nbsp;<strong>email</strong>&nbsp;server, simply downloading a local copy. For this reason we <em>strongly recommend</em> that Officio users choose IMAP where their mail host provides the option.</p>\n<p>&nbsp;</p>\n<p><span style="text-decoration: underline;"><strong>Good to Know:</strong></span></p>\n<p>&nbsp;</p>\n<p>POP Email is \'first-come, first-served\', meaning that unless told otherwise the device or program which gets the mail message is the only one which gets it. So if you download the message on your phone or PC before checking your mail from Officio, it may only exist in one place. POP email is great if you only ever plan to check your email from Officio, and perhaps one other device; or if you already make a habit of copying yourself or someone else on emails so you always have a second copy.</p>\n<p>&nbsp;</p>\n<p>IMAP email is great if you access your email across multiple devices, and from Officio. IMAP syncs with every other place those mail messages are kept, like Dropbox but for your emails. Likewise, if you delete a message in one place (like your Outlook program), then that same message is going to move to the deleted folder of your other programs and devices (i.e in Officio or your Apple/Android phone).&nbsp;</p>', NULL, 'N', 'text', 56, 'Y'),
	(74, 36, 'Email Strategies', '<p>&nbsp;</p>\n<p>There are some general email strategies which are good to observe while working with email within Officio - and in general.</p>\n<p>&nbsp;</p>\n<p><span style="text-decoration: underline;">Follow the KISS principle:</span>&nbsp;</p>\n<p>\'KISS\' is an acronym for "<strong>Keep it simple, stupid</strong>" as a design principle noted by the U.S. Navy in 1960. The KISS principle states that most systems work best if they are kept&nbsp;<strong>simple</strong>&nbsp;rather than made complicated; therefore simplicity should be a key goal in design and unnecessary complexity should be avoided.</p>\n<p>&nbsp;</p>\n<p>With that in mind:</p>\n<p>i. Don\'t go crazy with mail folders in your general mailbox. Keep your mail organization to a single-level deep. Meaning, it\'s okay to have a folder for clients, and individual named client folders within that, but it\'s best not to go deeper than that. A lot of mail hosts&nbsp;have difficulty&nbsp;translating mail when it\'s attached to a deep folder structure. This can cause problems with mail flow, or cause messages to get lost.</p>\n<p>&nbsp;</p>\n<p>ii. Keep your email subject lines short. Shorter is better, both for comprehension and for organization. Your customers will thank you, as&nbsp;will your coworkers and your computer. -&nbsp;If your mail subject lines get too long, and/or the folder structure too deep, some emails simply won\'t sync.</p>\n<p>&nbsp;</p>\n<p>iii. Be consistent with your email subject line format. This can help you to stay organized and to recognize at a glance what an email is addressing. Using the client ID and/or the date in the email can help you to stay on top of deliverables. Whichever way you decide to go, stick with one method.</p>\n<p>&nbsp;</p>\n<p>E.g. "D Bateson - Immigration Documents Checklist - 060116" -or- "Immigration Documents Checklist&nbsp;&nbsp;- DBat.147.001"</p>', NULL, 'N', 'text', 57, 'N'),
	(75, 36, 'IMAP - Folder Mapping', '<p>&nbsp;</p>\n<p>Once you\'ve setup your IMAP mail account in Officio, it\'s good practice to map the folders you have in your webmail with Officio, so that the program knows what to sync with your mail server.</p>\n<p>&nbsp;</p>\n<p>This process is easy, and accessed from the "IMAP Folders" button in your mail settings. Note: This button is only active once the IMAP account type is selected, the account configured, and the changes saved.</p>\n<p>&nbsp;</p>\n<p>Once you\'ve setup your IMAP account, re-open settings and click "IMAP Folders".</p>\n<p><img src="/help_files/IMAP Folders.PNG" alt="" width="434" height="350" /></p>\n<p>&nbsp;</p>\n<p>This pop-up is separated into the mapping folders in Officio (the ones which appear by default) and the Subscribe Folders (the ones which already live on your mail server).&nbsp;</p>\n<p><img src="/help_files/IMAP Folders 2.png" alt="" width="434" height="350" /></p>\n<p>&nbsp;</p>\n<p>When you\'ve chosen which folders you would like to map and sync, click \'Save\'.</p>', NULL, 'N', 'text', 58, 'N'),
	(76, 36, 'Common Email Settings', '<p>&nbsp;</p>\n\n<p>For your convenience, we have put together a list of the most common mail host settings used today. If your particular mail host doesn&#39;t appear on this list, please contact your web host for settings or feel free to reach out to us for assistance.</p>\n\n<p>&nbsp;</p>\n\n<p>Please note that all of the following require authentication. Use your full email address as your username, and your password should be entered as normal.</p>\n\n<p>&nbsp;</p>\n\n<p><u><strong>Mail Host Settings by Provider</strong></u></p>\n\n<table class="tg">\n	<tbody>\n		<tr>\n			<td><strong>Outlook.com</strong></td>\n			<td>Incoming: imap-mail.outlook.com | Outgoing: smtp-mail.outlook.com</td>\n			<td>Incoming: 993 (Use SSL) | Outgoing: 465 (Use SSL)</td>\n		</tr>\n		<tr>\n			<td><strong>Office 365</strong></td>\n			<td>Incoming: outlook.office365.com | Outgoing: smtp.office365.com</td>\n			<td>Incoming: 993 (Use SSL) | Outgoing: 587 (Use TLS)</td>\n		</tr>\n		<tr>\n			<td><strong>Gmail</strong></td>\n			<td>Incoming: imap.gmail.com | Outgoing: smtp.gmail.com</td>\n			<td>Incoming: 993 (Use SSL) | Outgoing: 465 (Use SSL)</td>\n		</tr>\n		<tr>\n			<td><strong>Yahoo! Mail</strong></td>\n			<td>Incoming: imap.mail.yahoo.com | Outgoing: smtp.mail.yahoo.com</td>\n			<td>Incoming: 993 (Use SSL) | Outgoing: 465 (Use SSL)</td>\n		</tr>\n		<tr>\n			<td><strong>Apple Mail</strong></td>\n			<td>Incoming: imap.mail.me.com | Outgoing: smtp.mail.me.com</td>\n			<td>Incoming: 993 (Use SSL) | Outgoing: 587 (Use TLS)</td>\n		</tr>\n	</tbody>\n</table>', NULL, 'N', 'text', 59, 'N'),
	(77, 36, 'Advanced Troubleshooting: Gmail', '<p>If you have been attempting to setup your email in Officio and it is not accepting your password, there are a few things you can try.</p>\n<p>&nbsp;</p>\n<p>Ask yourself these questions to get to the right answer:</p>\n<p>&nbsp;</p>\n<p><span style="text-decoration: underline;"><strong>Do you have 2-factor Authentication turned on?</strong></span><br />In other words does Gmail require you to enter a code from an automated text message, or from an app, to access your email? If yes, you\'ll need to <a href="https://support.google.com/accounts/answer/185833?hl=en" target="_blank" class="blulinkun">create an App SpecificPassword for Officio</a>.</p>\n<p>&nbsp;</p>\n<p><span style="text-decoration: underline;"><strong>Have you entered your password and the password is&nbsp;definitely right, but it doesn\'t authenticate?</strong></span></p>\n<p>It could be that you need to <a href="https://support.google.com/a/answer/105694?hl=en" target="_blank" class="blulinkun">enable IMAP sync from your Gmail</a>.&nbsp;</p>\n<p>&nbsp;</p>\n<p><span style="text-decoration: underline;"><strong>Is it still not working?</strong></span></p>\n<p>You may have to allow Officio access to your Gmail by enabling a feature Google calls "Access for Less Secure Apps" - which is a catch-all term used to describe any program written&nbsp;by an independent developer not affiliated with Google. You can <a href="https://support.google.com/accounts/answer/6010255?hl=en" target="_blank" class="blulinkun">read about that</a> here, and <a href="http://www.google.com/settings/security/lesssecureapps" target="_blank" class="blulinkun">make the change</a> here.</p>\n<p>&nbsp;</p>\n<p><span style="text-decoration: underline;"><strong>Still giving you troubles?</strong></span></p>\n<p>Sometimes, if multiple attempts have been made to access an account from outside of Gmail, your email account can temporarily lock down and you need to unlock it. There is a feature within Google to manually release that lock, called a \'CAPTCHA\'. You can <a href="https://support.google.com/accounts/answer/2461835?hl=en&amp;ref_topic=2461780" target="_blank" class="blulinkun">read about that</a> here, and <a href="https://accounts.google.com/displayunlockcaptcha" target="_blank" class="blulinkun">unlock your account</a> here.</p>\n<p>&nbsp;</p>\n<p>If the above haven\'t resolved the issue, you can always contact us for assistance.</p>\n<p>&nbsp;</p>\n<p>Yes, it is a little complicated, but it\'s probably fair to say that Google deserves some recognition for going to such lengths to keep your emails safe.</p>', NULL, 'N', 'text', 60, 'N'),
	(80, 17, 'Secure Login - What is SSL?', '<p>SSL stands for Secure Sockets Layer, and it&#39;s the standard technology for securing communications on the web.</p>\n\n<p>On login, we give you the option of using SSL for all of your connections; SSL should be used whenever you are accessing a public or insecure Wi-Fi, such as when you are in a coffee shop, hotel, or conference centre. This added step will help to keep your data secure. It&#39;s presented as an option because SSL connections <em><strong>may</strong></em> run a little slower than non-encrypted connections, particularly if you are on a slower connection. (i.e. Dial-up)</p>', NULL, 'N', 'text', 63, 'Y'),
	(81, 17, 'Troubleshooting Login issues', '<p><strong>The following are a few basic troubleshooting steps you can try if you&#39;re having difficulty logging in to Officio:</strong></p>\n\n<p>1. The page doesn&#39;t load properly - clear the browser cache (here&#39;s a <a href="https://www.refreshyourcache.com/en/home/" target="_blank" class="blulinkun">how-to link</a> - scroll down to see the options for different browsers)</p>\n\n<p>2. The page loads, but only partially - make sure you&#39;re using the preferred browsers for your operating system type, then clear your browser cache (as above)</p>\n\n<p>3. The page doesn&#39;t load, or continues to provide an error - examples are <em>Error 404</em> or <em>Error 502</em>; check to make sure you&#39;re using the correct URL for Officio (if the problem persists, call or email Officio support)</p>\n\n<p>4. Your login continues to return &#39;incorrect password&#39; - double-check you&#39;re spelling your password correctly by opening a note-taking program (like Notepad on Windows or Textedit on Mac) and type your password there, then copy-and-paste it into the password field. This will alos help you to verify if your Caps Lock key is engaged.</p>\n\n<p>5. You persistently receive &#39;incorrect password&#39; for your login - confirm your username and password with your company administrator, they can reset your password for you; if this does not work, call or email Officio Support.</p>\n\n<p><strong>Please Note:</strong> One of the most common login issues is that Australian users and clients may have visited the Canadian URL for Officio. The difference may be easy to miss: ensure you are connecting to <a href="https://secure.officio.com.au" target="_blank" class="blulinkun">secure.officio.com.au</a>, and not secure.officio.ca.</p>\n\n<p>If you have tried the above and are still having issues, please call us at <a href="phoneto:1300063052" target="_blank" class="blulinkun">1300 063 052</a> or email our support team at <a href="mailto:support@officio.com.au" target="_blank" class="blulinkun">support@officio.com.au</a>.</p>', NULL, 'N', 'text', 64, 'Y'),
	(82, 25, 'Task Management for Prospects', '<p>&nbsp;</p>\n<p><strong>Setting up a Task: </strong></p>\n<p>&nbsp;</p>\n<p>Go to your prospect</p>\n<p>Click on the &ldquo;Tasks&rdquo; sub-tab</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Prospects tasks 1.png" alt="" width="668" height="150" /></p>\n<p>&nbsp;</p>\n<p>Click on the &ldquo;New&rdquo; button</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Prospects tasks 2.png" alt="" width="500" height="174" /></p>\n<p>&nbsp;</p>\n<p>Assign Task to yourself or someone else within your company. Assign tasks to multiple users</p>\n<p>Use CC option to follow or share your tasks with other users</p>\n<p>Assign a subject to your task. Subject is a title of your task. Example: follow up for documents</p>\n<p>Describe task in detail in the &ldquo;Message&rdquo; box. Example: List all the documents that are required</p>\n<p>Set up a task due date - this is the date on which the task will be activated on</p>\n<p>Set up a deadline date - this is the &lsquo;complete before&rsquo; date</p>\n<p>Task can also be set up in either number of business or calendar days</p>\n<p>Click on save after setting up the task</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/Prospects Task 3.png" alt="" width="500" height="267" /></p>\n<p>&nbsp;</p>\n<p><strong>File Notes for the task: </strong></p>\n<p>&nbsp;</p>\n<p>Click on the reply button</p>\n<p>Type your File Notes in the box</p>\n<p>Click on the &ldquo;Save&rdquo; button</p>\n<p>&nbsp;</p>\n<p><strong>Editing Task Properties</strong>:</p>\n<p>&nbsp;</p>\n<p>Click on the &ldquo;Edit Tasks Properties&rdquo; button</p>\n<p>Change Task properties</p>\n<p>Click on the &ldquo;Save&rdquo; button</p>\n<p>&nbsp;</p>\n<p><strong>Customising Task</strong>:</p>\n<p>&nbsp;</p>\n<p>Colour code tasks based on the priority. Click on the &ldquo;Set Personal Priority&rdquo; button. Choose a level of priority for the task.</p>\n<p>Flag the task by clicking on the &ldquo;Flag&rdquo; button</p>\n<p>Add/hide columns to the task view. Move mouse on any column, click on the dropdown box, select desired columns</p>\n<p>&nbsp;</p>\n<p><strong>Mark the task as complete</strong>:</p>\n<p>&nbsp;</p>\n<p>Select a task</p>\n<p>Click on the &ldquo;Mark as Complete&rdquo; button</p>\n<p>&nbsp;</p>\n<p><strong>Tip</strong>: As soon as a task is created, it also gets added to the Notes section. A completed Task can be found in the Notes section with a &ldquo;green tick&rdquo; along with all the file notes related to that task.</p>', NULL, 'N', 'text', 66, 'N'),
	(83, 32, 'Where do I find my invoices?', '<p>To find an invoice you have to create one and by creating you have to go to:</p>\n<p>&nbsp;</p>\n<p>My Documents section and click on Templates:</p>\n<p>&nbsp;</p>\n<p><img style="max-width: 100%;" src="https://webmailox.com.au/appsuite/api/file?action=get&amp;id=a1c88b75-0952-41fb-bb65-8860017ff687&amp;session=24224a1717374d798ed541fd28640509" alt="" /></p>\n<p>click the plus (+) on shared template and click Invoice Indivcual to create invoice template for Individual Clients, and click on Employer Invoice to create invoice for the emplaoyer.</p>\n<p>&nbsp;</p>\n<p><img style="max-width: 100%;" src="https://webmailox.com.au/appsuite/api/file?action=get&amp;id=a918ffca-189d-48e8-9412-483f878dbbb2&amp;session=24224a1717374d798ed541fd28640509" alt="" /></p>\n<p>Individual Invoice: Type in the details needed click on save</p>\n<p><img style="max-width: 100%;" src="https://webmailox.com.au/appsuite/api/file?action=get&amp;id=58ce8996-0fcc-417f-a978-319917d7dec9&amp;session=24224a1717374d798ed541fd28640509" alt="" width="787" height="485" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Employer Invoice: Type in the details needed then click on save.&nbsp;</p>\n<p>Note: The Date, Description,GST, Amount Due and Balance will be automatically capture the amount that has save on the account</p>\n<p><img style="max-width: 100%;" src="https://webmailox.com.au/appsuite/api/file?action=get&amp;id=e4e0bdff-96e9-4850-aca4-91145a296dd6&amp;session=24224a1717374d798ed541fd28640509" alt="" />After saving go Clients Section, on the Search space, type in the name of the client you wish to send an invoice, then go to Accounting. On the Financial Transactions, click the box where in the amount was indicated then click on Generate Invioce. its either Employer or Individual, then click on Generate</p>\n<p>&nbsp;</p>\n<p><span style="font-size: small;">For More:</span></p>\n<p>&nbsp;</p>\n<p>Contact Support on:</p>\n<p>&nbsp;</p>\n<p>Telephone: +<span style="color: #000000; font-family: Helvetica;">61 7 3040 8008</span></p>\n<p>Email: support@officio.com.au</p>\n<p>&nbsp;</p>\n<p>Phone Support times: 9:00am to 3:30pm. Monday to Friday.</p>\n<p>&nbsp;</p>\n<p>Email Turnaround: 24 hours</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', NULL, 'N', 'text', 65, 'N'),
	(84, 38, 'Browser Independent Forms', '<p>We are about to release a new version of forms that will be able to be viewed and completed in any browser. Our first release of this new technology is limited to your clients. You will not be able to see the new version unless you log in as one of your clients.</p>\n<p>&nbsp;</p>\n<p>The new version forms look like this. We hope you find this innovation useful, and as always, we appreciate any feedback.</p>\n<p>&nbsp;</p>\n<p><img src="/help_files/2017-08-23_0931.png" alt="PDFtron form example" width="2034" height="817" /></p>', NULL, 'N', 'text', 67, 'Y'),
	(86, 31, 'Enabling Client Access to Forms and Questionnaires', '<div>\n<div>Do you have Forms or Questionnaires which you&#39;d like to make available to your clients? Well, you can, and it&#39;s very easy. All your client needs is an internet connection, and internet browser (almost any will do - Chrome, Firefox, Internet Explorer, Edge, Safari), and login credentials supplied by you.&nbsp;</div>\n\n<div>&nbsp;</div>\n\n<div><strong>Here&#39;s how you do it:&nbsp;</strong></div>\n\n<div>&nbsp;</div>\n\n<div>To give a client access to their Profile, Forms, and Questionnaires you must first have a client created. The key pieces of information to include to enable client access are:</div>\n\n<ul>\n	<li>First Name (<strong>Given Names</strong>)</li>\n	<li>Last Name (<strong>Family Name</strong>)</li>\n	<li><strong>Email (Primary)</strong></li>\n</ul>\n\n<div><img alt="Basic Profile Info" src="https://puu.sh/BB2Ej/606aad5682.png" style="height:484px; margin:10px; width:550px" /></div>\n\n<div>&nbsp;</div>\n\n<div>Then scroll down to the bottom of the Profile screen and make sure you change the&nbsp;<strong>Client Login Access</strong>&nbsp;to&nbsp;<strong>Enabled</strong>.</div>\n\n<div>&nbsp;</div>\n\n<div><img alt="Enable Client Login" src="https://puu.sh/BB2JH/094fde7813.png" style="height:168px; margin:10px; width:550px" /></div>\n\n<div>&nbsp;</div>\n\n<div>If this is a new profile, you will need to add a bit more information before you can save the profile.</div>\n\n<div>&nbsp;</div>\n\n<div><img alt="Saving a new profile" src="https://puu.sh/BB2Re/85abaf90e2.png" style="height:532px; margin:10px; width:550px" /></div>\n\n<div>&nbsp;</div>\n\n<div>That&#39;s it! This will enable client access to their Profile, Forms, and Questionnaires. Now&nbsp;you have to let them know how to access their profile.</div>\n\n<div>&nbsp;</div>\n\n<div>We have an email template already created for that, and it&#39;s included with your Officio subscription.</div>\n\n<div>&nbsp;</div>\n\n<div><img alt="Emailing Login Credentials" src="https://puu.sh/BB2Na/30e26b2c4b.png" style="height:476px; margin:10px; width:550px" /></div>\n\n<div>&nbsp;</div>\n\n<div>From here, it&#39;s just a matter of giving your client access to the Forms and Questionnaires you&#39;d like them to complete.</div>\n\n<div>&nbsp;</div>\n\n<div><img alt="Adding Forms and Questionnaires" src="https://puu.sh/BB2Wd/a52a8c9941.png" style="height:467px; margin:10px; width:550px" /></div>\n</div>', NULL, 'N', 'text', 69, 'N'),
	(87, 31, 'The Client Profile Experience', '<div>When a Client logs into Officio they have access to an experience is much more limited than that of you and your staff or partners.</div>\n\n<div>&nbsp;</div>\n\n<div>Individual Applicants and Employer Clients, by default, do not have access to change or modify any of the Profile or Case Details field values, and see these reflected as Read Only. In other words, they can see the pertinent details of their case and the important dates, but they cannot modify them unless you give them access to. (Changing access rights is covered in the Roles module of the Admin section.)</div>\n\n<div>&nbsp;</div>\n\n<div><img alt="Client Profile" src="https://puu.sh/BB6if/0c2a1b45e0.png" style="height:363px; margin:10px; width:550px" /></div>\n\n<div>&nbsp;</div>\n\n<div>Clients who log into Officio can explore any cases they have open, or cases which have been associated with their account, by selecting them from the filter located on the right-hand sidebar in their main profile tab.<span style="font-size:13px"></span></div>', NULL, 'N', 'text', 70, 'N'),
	(88, 31, 'Clients can Fill and Complete Forms and Questionnaires', '<div>\n<div>To access Forms and Questionnaires which have been associated with their account, Clients click the Forms tab, just as you would. That said, Clients have a much more restricted view of the Forms module and can only <strong>fill</strong>, <strong>print</strong>, or <strong>mark as complete </strong>Forms and Questionnaires which have been assigned to them. Marking a Form or Questionnaire as complete notifies staff associated with the case that it is ready for review.</div>\n\n<div>&nbsp;</div>\n\n<div><img alt="Forms and Questionnaires" src="https://puu.sh/BB6qO/04f4d053f3.png" style="height:183px; margin:10px; width:550px" /></div>\n\n<div>&nbsp;</div>\n\n<div><strong>To provide responses to the proferred Forms and/or Questionnaires, clients simply double-click on the document</strong> <strong>and it will open in a new tab.</strong> From there, they can begin the process of volunteering information which will be used to populate their visa applications. Any profile data which matches fields in the Questionnaire or Form will be automatically populated.</div>\n\n<div>&nbsp;</div>\n\n<div><img alt="Student Questionnaire" src="https://puu.sh/BB6uh/7f4831153f.png" style="border-style:solid; border-width:1px; height:526px; margin:10px; width:550px" /></div>\n\n<div>&nbsp;</div>\n\n<div>Questionnaires are used to present clients with a user-friendly way to collect data used to populate government forms. These take the client through each of the respective areas of pertinent interest, and provide fields and questions designed to satisfy the requirements of the visa type.&nbsp;</div>\n\n<div>&nbsp;</div>\n\n<div>Forms are digital representations of the paper forms used for lodging visa applications of various types. As with Questionnaires, any information in the profile which matches fields in the form will be automatically populated to the form. This includes information such as family and given names, date of birth, passport numbers and particulars, etc.&nbsp;</div>\n\n<div>&nbsp;</div>\n\n<div><img alt="Example Form 80" src="https://puu.sh/BB6CE/49720a0ff1.png" style="height:372px; margin:10px; width:550px" /></div>\n\n<div>Once again: a client has finished filling in the details of&nbsp;any Forms or Questionnaires provided to them, they should mark it as complete. This will flag you and your staff that the forms require review.</div>\n</div>', NULL, 'N', 'text', 71, 'N'),
	(89, 18, 'Overview of Prospect Module', '<div>&lt;iframe src=&quot;https://player.vimeo.com/video/359204097&quot; width=&quot;640&quot; height=&quot;360&quot; frameborder=&quot;0&quot; allow=&quot;autoplay; fullscreen&quot; allowfullscreen&gt;&lt;/iframe&gt;</div>', NULL, 'N', 'text', 72, 'N'),
	(90, 39, 'Overview of Client Module', '<div><a href="https://vimeo.com/359204040/de53087824" target="_blank" class="blulinkun">Video Overview of the Client Module.</a></div>', NULL, 'N', 'text', 73, 'N'),
	(91, 17, 'Over View of the Home Tab', '<div><a href="https://vimeo.com/359204086/89b922817e" target="_blank" class="blulinkun">A video overview of the Home tab</a></div>', NULL, 'N', 'text', 74, 'N');
