	(10, 'Switch to Mozzila FireFox', '<p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;"><br></span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;">Hi Everyone,</span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;"><br></span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;">Google updated their browser - Google Chrome overnight&nbsp;</span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;"><br></span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;">As a result, Adobe PDF has stopped filling out forms in Google Chrome. However, Firefox on Windows computers and Safari on Mac computers is working fine.</span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;"><br></span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;">Those who are using Chrome on Windows are urged to switch to Firefox. Please click on this link - <a href="https://www.mozilla.org/en-US/firefox/new/" target="_blank" class="blulinkun" >https://www.mozilla.org/en-US/firefox/new/</a> to download Firefox if you do not have one.</span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;"><br></span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;">Please follow below steps to configure your Firefox browser for PDF forms:</span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;"><br></span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;">Go to Options</span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;">Click on Applications</span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;">Select - Portable Document Format and</span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;">Select - Use Adobe Reader (in Firefox) option</span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;">Restart Firefox&nbsp;</span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;"><br></span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;">If you have trouble switching, please feel free to contact us on 07 3040 8008 or support@officio.com.au.&nbsp;</span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;"><br></span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;">Also, please click on this link to download your Officio instant Support tool - <a href="http://898.tv/officiosupport" target="_blank" class="blulinkun" >http://898.tv/officiosupport</a></span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;"><br></span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;"><br></span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;">Best Regards,</span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;"><br></span></font></p><p style="margin: 0px; min-height: 13px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 11px;">Your Friendly neighbourhood Officio support team.&nbsp;</span></font></p>', '2015-09-02 00:00:00'),
	(11, 'Form Changes', '<div>Following forms have changed.&nbsp;</div><div><br></div><div>40CH - Sponsorship for a child to migrate to Australia</div><div>47CH - Application for a migration to Australia by a child&nbsp;</div><div></div><div><br></div><div>We endeavour to update these in Officio very soon. Data in the old version of these forms will be automatically pushed to the new version.</div><div><br></div><div>Best Regards,</div><div><br></div><div>Officio Support</div>', '2015-09-18 00:00:00'),
