	(16, 'EOI Password Field', 'Hi Everyone,<div><br></div><div>We have recently made a change to the EOI password field.<br><div><br></div><div>Now, the users will be able to type and see the EOI password in this field - they will no longer be hidden.</div></div><div><br></div><div>Please feel free to contact us if you have any questions.</div><div><br></div><div>Best Regards,</div><div>Officio Support Team</div><div>support@officio.com.au</div><div>07 3040 8008</div><div><br></div>', '2016-01-28 00:00:00'),
	(17, 'Form Changes', '<font face="tahoma, arial, helvetica, sans-serif" style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><span style="font-size: 12px;">Following forms have changed:</span></font><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><br></div><div><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">40sp Sponsorship for a partner to migrate to Australia</span></font></div><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">47sp Application for migration to Australia by a partner</span></font></div><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">790 - Application for a Safe Haven Enterprise visa</span></font></div><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">866 Application for a protection visa</span></font></div><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">929 Change of address and or passport details</span></font></div><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">956a Appointment or withdrawal of an authorised recipient</span></font></div><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">1005 Application for a bridging visa To replace a ceased bridging visa</span></font></div><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">1006 Application for a Bridging visa B To seek permission to travel</span></font></div><div><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">1208 Application for a Work and Holiday visa</span></font></div><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">1276 Application for Skilled - Recognised Graduate (Temporary) visa (subclass 476)</span></font></div><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">1300t - Application for Australian citizenship General eligibility</span></font></div><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">1383 Application for a temporary visa for retirees</span></font></div><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">1392 Pregnancy Health Undertaking</span></font></div><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">1401s Application for approval as a long stay activity sponsor</span></font></div><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">1402s Application for approval as a training and research sponsor or a professional development sponsor</span></font></div></div><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;"><br></span></font></div><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;"><br></span></font></div>', '2016-05-04 00:00:00'),
	(20, 'Update - Task Management', '<div><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;"><b><br></b></span></font></div><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;"><b>Delete Tasks</b></span></font><span style="font-family: Tahoma; font-size: 12px;">&nbsp;- Users\nare now able to delete tasks. There is a Delete Task button added to the Task\nsub-tab of each client or a prospect.</span>\n\n<p class="MsoNormal" style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><span style="font-family: Tahoma;"><b><br></b></span></p><p class="MsoNormal" style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><span style="font-family: Tahoma;"><b>Automatic Tasks</b> - Users\ncan now add action to automatic tasks. Example - Change Case Status when you\nenter a date in the case details sub-tab.</span></p><p class="MsoNormal" style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><span style="font-family: Tahoma;"><br></span></p><p class="MsoNormal" style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><span style="font-family: Tahoma;">We will cover these updates in\nthe next&nbsp;training&nbsp;webinar.&nbsp;</span></p>\n\n<!--EndFragment-->', '2016-05-31 00:00:00'),
	(23, ' Free Officio Training Webinar - July 1, Registration now open', '<br><table class="news" style="display: block; padding-bottom: 5px; border-bottom-color: rgb(153, 153, 153); border-bottom-style: dotted; border-bottom-width: 1px; width: 100%; color: rgb(103, 119, 136); font-family: Arial, Tahoma, Helvetica, sans-serif; font-size: 12px;" cellpadding="0" cellspacing="0" width="100%"><tbody><tr><td colspan="2" class="news-content" style="margin: 0px; padding: 0px; text-align: justify;" align="left" valign="top"><br><table class="news" style="display: block; padding-bottom: 5px; border-bottom-color: rgb(153, 153, 153); border-bottom-style: dotted; border-bottom-width: 1px; width: 100%; color: rgb(103, 119, 136); font-size: 12px;" cellpadding="0" cellspacing="0" width="100%"><tbody><tr><td colspan="2" class="news-content" style="margin: 0px; padding: 0px; text-align: justify;" align="left" valign="top"><div style="margin: 0px; padding: 0px;">Officio organises weekly training webinars as a part of our complementary training for all Officio users.</div><div style="margin: 0px; padding: 0px;"><div style="margin: 0px; padding: 0px;"><br></div><div style="margin: 0px; padding: 0px;">Space is limited and&nbsp;places fill quickly. Registrations are now open for 01 July 2016 Webinar. Please register your interest by clicking on this link today.&nbsp;</div><div style="margin: 0px; padding: 0px;"><br></div><div style="margin: 0px; padding: 0px;">-<a href="https://www.cognitoforms.com/OfficioAustralia/OfficioWebinarRegistration" target="_blank" class="blulinkun" >https://www.cognitoforms.com/OfficioAustralia/OfficioWebinarRegistration</a></div><div style="margin: 0px; padding: 0px;"><br></div><div style="margin: 0px; padding: 0px;">Remember, these webinars are conducted every week, so if you are not able to attend the coming webinar, you can always attend the next one.</div><div style="margin: 0px; padding: 0px;"><br></div><div style="margin: 0px; padding: 0px;">Webinar goes on for two hours between 3:00PM and 5:00PM every Friday. The next Webinar is scheduled on 01 July 2016 at 3:00PM.</div><div style="margin: 0px; padding: 0px;"><p style="margin: 0px; padding: 0px; line-height: normal; font-family: Helvetica;"><br></p></div></div></td></tr></tbody></table></td></tr></tbody></table>', '2016-06-27 00:00:00'),
