me:"Table Normal";\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-priority:99;\n	mso-style-parent:"";\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\n	mso-para-margin:0cm;\n	mso-para-margin-bottom:.0001pt;\n	mso-pagination:widow-orphan;\n	font-size:12.0pt;\n	font-family:Calibri;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-language:AR-SA;}\n</style>\n<![endif]-->\n\n\n\n<!--StartFragment-->\n\n<p class="MsoNormal"><span style="font-family:Tahoma;mso-bidi-font-family:Tahoma;\nmso-bidi-language:HI">Officio has introduced a brand new Standard Business\nSponsorship questionnaire.<o:p></o:p></span></p>\n\n<p class="MsoNormal"><span style="font-family:Tahoma;mso-bidi-font-family:Tahoma;\nmso-bidi-language:HI">&nbsp;</span></p>\n\n<p class="MsoNormal"><span style="font-family:Tahoma;mso-bidi-font-family:Tahoma;\nmso-bidi-language:HI">This questionnaire focuses mainly on 457 SBS E-Visa\napplication. You will find that this questionnaire is responsive, which means\nthat it can be used on PCs as well as on supported mobile devices.<o:p></o:p></span></p>\n\n<p class="MsoNormal"><span style="font-family:Tahoma;mso-bidi-font-family:Tahoma;\nmso-bidi-language:HI">&nbsp;</span></p>\n\n<p class="MsoNormal"><span style="font-family:Tahoma;mso-bidi-font-family:Tahoma;\nmso-bidi-language:HI">The questionnaire can be accessed through the forms\nsub-tab, under the questionnaire category for a "Employer Case -\nTemp" case type.<o:p></o:p></span></p>\n\n<p class="MsoNormal"><span style="font-family:Tahoma;mso-bidi-font-family:Tahoma;\nmso-bidi-language:HI">&nbsp;</span></p>\n\n<p class="MsoNormal"><span style="font-family:Tahoma;mso-bidi-font-family:Tahoma;\nmso-bidi-language:HI">Watch a short video on how this questionnaire works:</span><o:p></o:p></p><p class="MsoNormal"><span style="font-family:Tahoma;mso-bidi-font-family:Tahoma;\nmso-bidi-language:HI"><br></span></p>\n\n<iframe src="https://player.vimeo.com/video/173428915?color=ff9933&amp;title=0&amp;byline=0&amp;portrait=0" width="640" height="355" frameborder="0" webkitallowfullscreen="" mozallowfullscreen="" allowfullscreen=""></iframe>\n\n\n<!--EndFragment-->', '2016-07-05 00:00:00'),
	(26, 'UPDATE - Accounting Field name changes', '<font face="tahoma, arial, helvetica, sans-serif" style="font-size: 12px;">We have changed accounting fields and placeholders to be used in templates to further streamline your invoices and receipts.</font><div style="font-size: 12px; font-family: tahoma, arial, helvetica, sans-serif;"><br></div><div><font face="tahoma, arial, helvetica, sans-serif" style="font-size: 12px;">Instead of using a general template field -</font><font face="arial" style="font-size: 12px;">&nbsp;<span style="font-size: 11px; white-space: nowrap; background-color: rgb(223, 232, 246);">&lt;%aud_curr_fin_transaction_table_selected_records%&gt;&nbsp;</span></font><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">You can now use a specialised field for&nbsp;invoices -</span></font><span style="font-size: 11px; font-family: arial; white-space: nowrap; background-color: rgb(223, 232, 246);">&lt;%aud_curr_fin_transaction_table_selected_records_invoice%&gt; &nbsp;</span><span style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;">and&nbsp;</span><span style="font-family: arial; font-size: 11px; white-space: nowrap; background-color: rgb(223, 232, 246);">&lt;%aud_curr_fin_transaction_table_selected_records_receipt%&gt;</span><span style="font-family: arial; font-size: 11px; white-space: nowrap; background-color: rgb(223, 232, 246);">&nbsp;&nbsp;</span><span style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;">for&nbsp;receipts.</span></div><div><span style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><br></span></div><div><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">These template placeholders can be found in the "Other Field" category of your template&nbsp;complies window.&nbsp;</span></font></div><div><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;"><br></span></font></div><div><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">Please replace the correct placeholder for your invoice and receipt templates to work properly.</span></font></div><div><span style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><br></span></div><div><span style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;">As always, please contact us if you have questions.</span></div><div style="font-size: 12px; font-family: tahoma, arial, helvetica, sans-serif;"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 11px; white-space: nowrap; background-color: rgb(223, 232, 246);"><br></span></div><div style="font-size: 12px; font-family: tahoma, arial, helvetica, sans-serif;"><br></div>', '2016-07-06 00:00:00'),
