	(29, 'New Temporary Visa Employer Nomination Questionnaire', '<div style="text-align: justify;"><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;"></span></font><span style="font-family: Tahoma; font-size: 12px; color: rgb(103, 119, 136); text-align: justify;">Officio has introduced a brand new Temporary Visa Employer&nbsp;</span><span style="text-align: justify; font-size: 12px;"><font color="#677788" face="Tahoma">Nomination</font></span><span style="font-family: Tahoma; font-size: 12px; color: rgb(103, 119, 136); text-align: justify;">&nbsp;Questionnaire.</span></div><p class="MsoNormal" style="font-family: Arial, Tahoma, Helvetica, sans-serif; font-size: 12px; margin: 0px; padding: 0px; color: rgb(103, 119, 136); text-align: justify;"><span style="font-family: Tahoma;">&nbsp;</span></p><p class="MsoNormal" style="font-family: Arial, Tahoma, Helvetica, sans-serif; font-size: 12px; margin: 0px; padding: 0px; color: rgb(103, 119, 136); text-align: justify;"><span style="font-family: Tahoma;">This questionnaire focuses mainly on 457 Nomination E-Visa application. You will find that this questionnaire is responsive, which means that it can be used on PCs as well as on supported mobile devices.<o:p></o:p></span></p><p class="MsoNormal" style="font-family: Arial, Tahoma, Helvetica, sans-serif; font-size: 12px; margin: 0px; padding: 0px; color: rgb(103, 119, 136); text-align: justify;"><span style="font-family: Tahoma;">&nbsp;</span></p><p class="MsoNormal" style="font-family: Arial, Tahoma, Helvetica, sans-serif; font-size: 12px; margin: 0px; padding: 0px; color: rgb(103, 119, 136); text-align: justify;"><span style="font-family: Tahoma;">The questionnaire can be accessed through the forms sub-tab, under the questionnaire category for a "Employer Sponsored Migration" case type.<o:p></o:p></span></p><p class="MsoNormal" style="font-family: Arial, Tahoma, Helvetica, sans-serif; font-size: 12px; margin: 0px; padding: 0px; color: rgb(103, 119, 136); text-align: justify;"><span style="font-family: Tahoma;">&nbsp;</span></p><p class="MsoNormal" style="font-family: Arial, Tahoma, Helvetica, sans-serif; font-size: 12px; margin: 0px; padding: 0px; color: rgb(103, 119, 136); text-align: justify;"><span style="font-family: Tahoma;">Watch a short video on how this questionnaire works:</span></p>\n\n<iframe src="https://player.vimeo.com/video/174304505?color=ff9933&title=0&byline=0&portrait=0" width="640" height="285" frameborder="0" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe> <p>', '2016-07-12 00:00:00'),
	(30, 'New Permanent Visa Employer Nomination Questionnaire', '<span style="font-family: Tahoma; font-size: 12px; color: rgb(103, 119, 136); text-align: justify;">Officio has introduced a brand new Permanent Visa Employer&nbsp;</span><span style="text-align: justify; font-size: 12px;"><font color="#677788" face="Tahoma">Nomination</font></span><span style="font-family: Tahoma; font-size: 12px; color: rgb(103, 119, 136); text-align: justify;">&nbsp;Questionnaire.</span><p class="MsoNormal" style="font-family: Arial, Tahoma, Helvetica, sans-serif; font-size: 12px; margin: 0px; padding: 0px; color: rgb(103, 119, 136); text-align: justify;"><span style="font-family: Tahoma;">&nbsp;</span></p><p class="MsoNormal" style="font-family: Arial, Tahoma, Helvetica, sans-serif; font-size: 12px; margin: 0px; padding: 0px; color: rgb(103, 119, 136); text-align: justify;"><span style="font-family: Tahoma;">This\n questionnaire focuses mainly on ENS Nomination E-Visa application. You \nwill find that this questionnaire is responsive, which means that it can\n be used on PCs as well as on supported mobile devices.</span></p><p class="MsoNormal" style="font-family: Arial, Tahoma, Helvetica, sans-serif; font-size: 12px; margin: 0px; padding: 0px; color: rgb(103, 119, 136); text-align: justify;"><span style="font-family: Tahoma;">&nbsp;</span></p><p class="MsoNormal" style="font-family: Arial, Tahoma, Helvetica, sans-serif; font-size: 12px; margin: 0px; padding: 0px; color: rgb(103, 119, 136); text-align: justify;"><span style="font-family: Tahoma;">The\n questionnaire can be accessed through the forms sub-tab, under the \nquestionnaire category for a "Employer Sponsored Migration" case type.</span></p><p class="MsoNormal" style="font-family: Arial, Tahoma, Helvetica, sans-serif; font-size: 12px; margin: 0px; padding: 0px; color: rgb(103, 119, 136); text-align: justify;"><span style="font-family: Tahoma;">&nbsp;</span></p><p class="MsoNormal" style="font-family: Arial, Tahoma, Helvetica, sans-serif; font-size: 12px; margin: 0px; padding: 0px; color: rgb(103, 119, 136); text-align: justify;"><span style="font-family: Tahoma;">Watch a short video on how this questionnaire works:</span></p>\n\n<iframe src="https://player.vimeo.com/video/174308306?color=ff9933&amp;title=0&amp;byline=0&amp;portrait=0" webkitallowfullscreen="" mozallowfullscreen="" allowfullscreen="" frameborder="0" height="285" width="640"></iframe> <p></p>', '2016-07-12 00:00:00'),
	(31, 'New VEVO functionality', 'Ultimate users will now be able to check VEVO for their clients. Go to admin to enable your ImmiAccount. Watch the below video to configure your account and start using VEVO check.<div><br></div><div><br></div>\n\n<iframe src="https://player.vimeo.com/video/174446348?color=ff9933&amp;title=0&amp;byline=0&amp;portrait=0" width="640" height="354" frameborder="0" webkitallowfullscreen="" mozallowfullscreen="" allowfullscreen=""></iframe>', '2016-07-13 00:00:00'),
	(35, 'New Forms Added', '<font face="arial" size="1">Following forms have been added to Officio &nbsp;-</font><div><div><font face="arial" size="1"><br></font></div><div><ul><li><font face="arial" size="1">Form&nbsp;681&nbsp;Refugee and special humanitarian proposal&nbsp;</font></li><li><font face="arial" size="1">1413d&nbsp;Declaration in relation to complying&nbsp;significant and premium investments</font></li><li><font face="arial" size="1">1417 Proposal for refugee and special humanitarian entrants by Approved Proposing Organisation</font></li><li><font face="arial" size="1">1420S Application for approval as an entertainment sponsor</font></li><li><font face="arial" size="1">1447&nbsp;No Further Stay waiver request</font></li><li><font face="arial" size="1">1465&nbsp;Safe Haven Enterprise visa (SHEV):&nbsp;Employment and study record</font></li></ul><p style="font-family: Helvetica; margin: 0px; line-height: normal;"><br></p></div></div>', '2016-08-08 00:00:00'),
	(36, 'New Form Added', '<span style="font-size: 12px;">Following form has been added to Officio:</span><div style="font-size: 12px;"><br></div><div><span style="font-size: 12px;">Form 1446 -&nbsp;</span><span style="font-family: Helvetica;">Withdrawal of a visa application</span></div>', '2016-08-10 00:00:00'),
	(45, '1139A Form Updated', 'Form 1139A Statement of Assets and Liabilities Position has now been updated and is ready to use.&nbsp;', '2016-10-17 00:00:00'),
	(51, 'Updated Prospect Assessment Questionnaire and Prospect Module', '<div><br></div>The Prospect Assessment Questionnaire has been updated to include new \nfields, for example all English tests, not just IELTS. This form for \nautomated prospect assessment can be imbedded into your website (for Pro\n and Ultimate users).&nbsp;<div><br></div><div>Please note that if you have created a new \nprospect questionnaire in another language, all new fields will appear \nwith English language labels until you update the labels in your \nselected language.&nbsp;<div><div><br></div><div>New fields have also been added to the Prospects Module.&nbsp;</div><div><br></div><div>If you experience any difficulty using it, please do not hesitate \nto contact support at 1300 063 052 or <a href="mailto:support@officio.com.au" target="_blank" class="blulinkun" >support@officio.com.au</a>.&nbsp;</div></div></div>', '2016-11-11 00:00:00'),
	(53, 'Update - Standard Permanent Visa Questionnaire', '<div><font face="Helvetica Neue, Helvetica, Arial, sans-serif" size="2"><br></font></div><font face="Helvetica Neue, Helvetica, Arial, sans-serif" size="2">A new Permanent Visa Questionnaire has been released. The \'Standard Permanent Visa Questionnaire\' is one of our new style questionnaires in HTML format, which means it should be easily accessible on all browsers.&nbsp;</font><span style="font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: small;">It is intended to collect the common information required for permanent visa applications and Form 80s.&nbsp;</span><div><span style="font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: small;"><br></span></div><div><span style="font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: small;">Because it\'s designed to be easily accessible by the web, a fillable version cannot be emailed to your clients - our recommended process for sharing it with your clients in a secure, accessible manner is through the client portal.&nbsp;</span><div><font face="Helvetica Neue, Helvetica, Arial, sans-serif" size="2"><br></font></div><div><font face="Helvetica Neue, Helvetica, Arial, sans-serif" size="2">If you experience any difficulty using it, please don\'t hesitate to contact support at 1300 063 052 or <a href="support@officio.com.au" target="_blank" class="blulinkun" >support@officio.com.au</a>.</font></div></div>', '2016-11-15 00:00:00'),
	(56, 'New Forms Added', '<br>The following forms have been updated in Officio:<br><br><ul><li>Form 40: Sponsorship for migration to Australia (parent, aged dependent relative, remaining relative, carer)</li><li>Form 40CH: Sponsorship for a child to migrate to Australia</li><li>Form 40SP: Sponsorship for a partner to migrate to Australia</li><li>Form 47A: Details of child or other dependent family member aged 18 years or over</li><li>Form 47BT: Application for a Business Skills (provisional) visa</li><li>Form 47BU: Application for a Business Skills (permanent) visa</li><li>Form 47CH: Application for migration to Australia by a child</li><li>Form 47OF: Application for migration to Australia by other family members</li><li>Form 47PA: Application for a parent to migrate to Australia</li><li>Form 47PT: Application for migration to Australia by a Contributory Parent (Temporary) or Contributory Aged Parent (Temporary) visa holder</li><li>Form 47SP: Application for migration to Australia by a partner</li><li>Form 47SV: Application for special migration to Australia</li><li>Form 118: Application for Australian citizenship by descent</li><li>Form 147: Application for a New Zealand Citizen Family Relationship (subclass 461) visa</li><li>Form 160: Radiological report on chest x-ray of an applicant for an Australian visa</li><li>Form 424: Request for access to documents or information</li><li>Form 424C: Request for amendment or annotation to personal records</li><li>Form 790: Application for a Safe Haven Enterprise visa</li><li>Form 852: Application for a Confirmatory (Residence) visa</li><li>Form 866: Application for a protection visa</li><li>Form 919: Nomination of student dependants</li><li>Form 929: Change of address and/or passport details</li><li>Form 1005: Application for a bridging visa</li><li>Form 1006: Application for a Bridging visa B - To seek permission to travel</li><li>Form 1040: Statutory declaration relating to family violence</li><li>Form 1150: Application for a Working Holiday visa</li><li>Form 1195: Identity declaration</li><li>Form 1208: Application for a Work and Holiday visa</li><li>Form 1258: Unaccompanied Minor or Unaccompanied Humanitarian Minor information and care undertaking</li><li>Form 1263: Working Holiday visa: Employment verification</li><li>Form 1276: Application for Skilled  Recognised Graduate (Temporary) visa (subclass 476)</li><li>Form 1283: Acknowledgement of unpaid placement  visa applicant</li><li>Form 1284: Acknowledgement of unpaid placement  sponsor</li><li>Form 1364: Application for a Resolution of Status (subclass 851) visa</li><li>Form 1390: Application for an APEC Business Travel Card</li><li>Form 1409: Application for a Temporary Graduate visa</li><li>Form 1418: Application for a Visitor visa  Sponsored Family stream</li><li>Form 1446: Withdrawal of a visa application</li></ul><br><p>If you experience any issues with these forms please let us know by emailing support@officio.com.au or calling us on 1300 063 052.<br></p><p><br></p>', '2016-11-22 00:00:00'),
	(57, 'Updated Subclasses', '<br>You will all be aware that new subclasses have been added in the 400 series. <br><br>Subclasses can be updated in your Admin function. Instructions for adding subclasses can be found in \'How do I create a new subclass\' under the \'Client and Case Management\' section in Help. <br><br>You do not need to delete old subclasses, as these are still in use, even though you cannot lodge a new application.<br>', '2016-11-24 00:00:00'),
	(59, 'Update to Officio VEVO Check', '<div><br></div>Officio VEVO Check has been updated to accommodate the DIBP changes and is functional again.&nbsp;', '2016-11-30 00:00:00'),
	(71, 'Updated Form 1221 Additional personal particulars information', '<div><br></div><div>Form <b>1221 Additional personal particulars information</b>&nbsp;has now been updated in Officio and is ready to use.&nbsp;</div><div><br></div>If you experience any issues with this or any other form in Officio please let us know by emailing <a href="support@officio.com.au" target="_blank" class="blulinkun" >support@officio.com.au</a> or calling us on 1300 063 052.<div><br></div>', '2017-02-23 00:00:00'),
	(75, 'Updates have been released to allow changing of case type in Officio.', 'Updates have been released to allow changing of case type in Officio. Select the relevant case and click on Change Case Type <br>&nbsp;<br>Data in the fields that do not exist in your new case type will be lost. If the a case has been linked to an employer, the case cannot be changed.<br>Thank you to those users who suggested and helped scope the new functionality.', '2017-06-09 00:00:00'),
	(89, 'New forms', '<font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">We are about to release new forms that are browser independent. Initially this feature will only be available for your clients, so internal users will not see the new form version (unless you log in as your client). We hope you find this useful and appreciate any feedback.</span></font><div><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;"><br></span></font></div><div><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">See more in \'Help\' under the \'Forms\' topic.</span></font><div style=""><br></div></div>', '2017-08-23 00:00:00'),
	(91, 'New Forms', '<table width="100%" cellpadding="0" cellspacing="0" class="news" style="display: block; padding-bottom: 5px; border-bottom: 1px dotted rgb(153, 153, 153); color: rgb(103, 119, 136); font-family: Arial, Tahoma, Helvetica, sans-serif; font-size: 12px; background-color: rgb(238, 238, 238);"><tbody><tr><td colspan="2" align="left" valign="top" class="news-content" style="margin: 0px; padding: 0px; text-align: justify;"><div style="margin: 0px; padding: 0px;"></div></td></tr><tr><td class="news-title" style="margin: 0px; padding: 5px 5px 5px 0px; font-weight: bold;"></td><td class="news-date" style="margin: 0px; padding: 5px 0px; text-align: right; width: 69px; white-space: nowrap;"></td></tr><tr><td colspan="2" align="left" valign="top" class="news-content" style="margin: 0px; padding: 0px; text-align: justify;"><font face="tahoma, arial, helvetica, sans-serif">We have released the new forms which are browser independent. Thank you to all the users who provided useful feedback.<br><br>This feature is at the moment only available for your clients, so internal users will not see the new form version (unless you log in as your client).&nbsp;</font><div style="margin: 0px; padding: 0px;"><font face="tahoma, arial, helvetica, sans-serif"><br></font></div><div style="margin: 0px; padding: 0px;"><font face="tahoma, arial, helvetica, sans-serif">See more in \'Help\' under the \'Forms\' topic.</font></div><div><font face="tahoma, arial, helvetica, sans-serif"><br></font></div></td></tr></tbody></table>', '2017-08-25 00:00:00'),
	(94, 'Drag and Drop', 'We are pleased to announce that new functionality has been implemented allowing you to upload files using drag and drop. In the documents tab, select a folder and hit \'upload\'. A dialogue box will open allowing you to drag and drop files from your desktop to Officio. We hope you like the new functionality and we appreciate any feedback.&nbsp;', '2017-09-12 00:00:00'),
	(120, 'Officio Training Webinar  Jan. 24th  4-6pm (Sydney Time)', 'Officio organizes weekly training webinars as a part of our complementary training for all Officio users.<br><br>The training webinar runs for two hours between 4:00PM and 6:00PM (Australian Eastern Standard Time - Sydney time)<br><br>The first hour will cover the basics of using Officio and the second hour will provide more in depth training on a particular feature of Officio. The content of the second hour changes each week.<br><br>Spaces are limited and places fill quickly. Registration is now open.<br><!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves/>\n  <w:TrackFormatting/>\n  <w:PunctuationKerning/>\n  <w:ValidateAgainstSchemas/>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF/>\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\n  <w:Compatibility>\n   <w:BreakWrappedTables/>\n   <w:SnapToGridInCell/>\n   <w:WrapTextWithPunct/>\n   <w:UseAsianBreakRules/>\n   <w:DontGrowAutofit/>\n   <w:SplitPgBreakAndParaMark/>\n   <w:DontVertAlignCellWithSp/>\n   <w:DontBreakConstrainedForcedTables/>\n   <w:DontVertAlignInTxbx/>\n   <w:Word11KerningPairs/>\n   <w:CachedColBalance/>\n  </w:Compatibility>\n  <w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>\n  <m:mathPr>\n   <m:mathFont m:val="Cambria Math"/>\n   <m:brkBin m:val="before"/>\n   <m:brkBinSub m:val="&#45;-"/>\n   <m:smallFrac m:val="off"/>\n   <m:dispDef/>\n   <m:lMargin m:val="0"/>\n   <m:rMargin m:val="0"/>\n   <m:defJc m:val="centerGroup"/>\n   <m:wrapIndent m:val="1440"/>\n   <m:intLim m:val="subSup"/>\n   <m:naryLim m:val="undOvr"/>\n  </m:mathPr></w:WordDocument>\n</xml><![endif]-->\n\n<p class="MsoNormal"><span style="font-size:1