/>\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\n </w:LatentStyles>\n</xml><![endif]--><!--[if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n	{mso-style-name:"Table Normal";\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-priority:99;\n	mso-style-qformat:yes;\n	mso-style-parent:"";\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\n	mso-para-margin-top:0in;\n	mso-para-margin-right:0in;\n	mso-para-margin-bottom:10.0pt;\n	mso-para-margin-left:0in;\n	line-height:115%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:"Calibri","sans-serif";\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:"Times New Roman";\n	mso-fareast-theme-font:minor-fareast;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;}\n</style>\n<![endif]-->Remember, these webinars are conducted every week. If you are not able to attend the coming webinar, you can always attend the next one.<br><br>', '2018-01-19 00:00:00'),
	(126, 'General Advisory about ImmiAccount Credentials', '<font face="tahoma">Hello Officio Subscribers;&nbsp;</font><span style="font-family: tahoma;">Please be aware that ImmiAccount has recently forced a password change for all users, as part of their regular security checkups.&nbsp;</span><div style=""><font face="tahoma"><br></font></div><div style=""><font face="tahoma">If you are a regular user of the VEVO check functionality within Officio Ultimate, please sign in to ImmiAccount and update your password.</font></div><div style=""><font face="tahoma"><br></font></div><div style=""><font face="tahoma"><b>Please note:</b> Your credentials will need to be updated in Officio before regular VEVO check functionality will resume.</font></div><div style=""><font face="tahoma"><br></font></div><div style=""><font face="tahoma">Please do not hesitate to contact us if you require technical assistance. You may call 1300 063 052 for support, or email support@officio.com.au.</font></div>', '2018-02-20 00:00:00'),
	(129, 'Temporary Skills Shortage (TSS) Announcement from Home Affairs', '<div style=""><font style="" face="tahoma"><span style="font-size: 13px; background-color: rgb(255, 255, 255);">Dear Registered Migration Agent,</span></font></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma"><br></font></span></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma">The Department of Home Affairs will be performing scheduled maintenance to ImmiAccount on 2 March 2018, which will include changes to its functionality and the display of information. The attached document provides an overview of the upcoming changes. Please share this information with staff and colleagues within your organisation who access ImmiAccount.</font></span></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma"><br></font></span></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma">There will be a systems outage from 8pm Friday 2 March to 9am Saturday 3 March 2018 to deploy the changes, during which time the following online services will be unavailable:</font></span></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma"><br></font></span></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ImmiAccount</font></span></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma"><br></font></span></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;eLodgement (Online visa, citizenship, detention visit and APEC Business Travel Card applications)</font></span></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma"><br></font></span></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;My Health Declarations (MHD) service</font></span></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma"><br></font></span></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;eMedical</font></span></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma"><br></font></span></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Visa Entitlement Verification Online (VEVO)</font></span></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma"><br></font></span></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;LEGENDcom</font></span></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma"><br></font></span></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Australian Trusted Trader.</font></span></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma"><br></font></span></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma">For more information about the new functionality, or if you need to report a technical issue in ImmiAccount, please contact the ImmiAccount team through the ImmiAccount Technical Support Form at https://www.homeaffairs.gov.au/Trav/Visa/Immi/immiaccount-technical-support-form.</font></span></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma"><br></font></span></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma">Regards</font></span></div><div style=""><span style="font-size: 13px; background-color: rgb(255, 255, 255);"><font face="tahoma"><br></font></span></div><div style=""><font style="" face="tahoma"><span style="font-size: 13px; background-color: rgb(255, 255, 255);">Office of the MARA</span></font></div>', '2018-03-01 00:00:00'),
	(133, 'Holiday Weekend Office Closure', 'Everyone here at Officio wish you a happy Easter weekend! Officio support and office lines will be closed Friday and Monday, for the holiday. If you encounter any critical issues on either of these days, please email craig@officio.com.au and copy support@officio.com.au.', '2018-03-28 00:00:00'),
	(138, 'ANZAC Day - April 25th - Holiday 20 Apr 2018', '<div style=""><span style="background-color: rgb(255, 255, 255); font-size: 13px; font-family: tahoma;">Officio will be closed on the 25th of April (Wednesday) for ANZAC day. Like many of you, we\'ll be attending dawn services, however if you encounter any critical issues on the day please email craig@officio.com.au and copy support@officio.com.au</span></div>', '2018-04-20 00:00:00'),
	(146, 'New Forms Added', '<span style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"></span><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">The following forms have been updated in Officio and are ready to use:</span></font><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;"><br></span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">47OF Application for migration to Australia by other family members</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">47PA Application for a parent to migrate to Australia</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">47PT Application for migration to Australia by a Contributory Parent (Temporary) or Contributory Aged Parent (Temporary) visa holder</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">47SV Application for special migration to Australia</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">147 Application for a New Zealand Citizen Family Relationship (subclass 461) visa</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">681 Refugee and special humanitarian proposal</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">842 Application for an Offshore Humanitarian visa Refugee and Humanitarian (Class XB) visa</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">852 Application for a Confirmatory (Residence) visa</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">866 Application for a protection visa</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">1085 Application for a Resident Return Visa (RRV)</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;"><br></span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">If you experience any issues with these forms please let us know by emailing support@officio.com.au or calling us on 1300 063 052.</span></font></div>', '2018-06-11 00:00:00'),
	(148, 'New Forms Added', '<font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">The following form updates - minor and major version changes - have been uploaded to Officio and are ready for use.&nbsp;</span></font><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><br></div><div style=""><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">47BT Application for a Business Skills (provisional) visa</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">47BU Application for a Business Skills (permanent) visa</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">118 Application for Australian citizenship by descent</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">119 Application for evidence of Australian citizenship</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">128 Application for renunciation of Australian citizenship</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">132 Application to resume Australian citizenship</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">1000 Nomination for Distinguished Talent</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">1139A Statement of Assets and Liabilities Position</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">1217 Business Skills profile- Business Owner (Residence)</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">1272 Application for Australian citizenship for children adopted under full Hague Convention arrangements</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">1290 Application for Australian citizenship Other situations</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">1300t - Application for Australian citizenship General eligibility</span></font></div><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><br></div></div><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;">To use the updated form, just open the existing form in a client case and you will be prompted to use the new version - this is not an obligatory change, so as not to affect closed cases.</div><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><br></div><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;">If you experience any difficulties using the new form versions, please do not hesitate to contact support at 1300 063 052 or support@officio.com.au.</div>', '2018-06-18 00:00:00'),
	(159, 'New Forms Added', '<div style=""><span style="font-size: 12px; font-family: tahoma, arial, helvetica, sans-serif;">The following form updates - minor and major version changes - have been uploaded to Officio and are ready for use.&nbsp;</span></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;"><br></span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">26 Medical examination for an Australian visa</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">48me Application to visit Australia for medical treatment</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">157n Nomination of a student guardian</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">160 Radiological report on chest x-ray of an applicant for an Australian visa</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">424C Request for amendment or annotation to personal records</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">815 Health Undertaking</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">876 Application for transit visa for Australia (subclass 771)</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">918 Application for a subclass 445 (temporary) visa by a dependent child</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">919 Nomination of student dependants</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">929 Change of address and/o