le=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;"><br></span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">To use the updated form, just open the existing form in a client case and you will be prompted to use the new version - this is not an obligatory change, so as not to affect closed cases.</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;"><br></span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">If you experience any difficulties using the new form versions, please do not hesitate to contact support at 1300 063 052 or support@officio.com.au.</span></font></div>', '2018-09-04 00:00:00'),
	(164, 'Officio closed for Labor Day', '<font face="tahoma">Officio will be closed on the 1st of October for Labor Day / Queen\'s Birthday. However, if you encounter any critical issues on the day please email craig@officio.com.au and copy support@officio.com.au</font>', '2018-09-27 00:00:00'),
	(166, 'New Forms Added', '<div><span style="font-size: 12px;"><font face="tahoma">The following form updates - minor and major version changes - have been uploaded to Officio and are ready for use.&nbsp;</font></span></div><div><span style="font-size: 12px;"><font face="tahoma"><br></font></span></div><div><span style="font-size: 12px;"><font face="tahoma">40 Sponsorship for migration to Australia (parent, aged dependent relative, remaining relative, carer)</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">47OF Application for migration to Australia by other family members</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">47PA Application for a parent to migrate to Australia</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">48me Application to visit Australia for medical treatment</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">118 Application for Australian citizenship by descent</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">119 Application for evidence of Australian citizenship</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">128 Application for renunciation of Australian citizenship</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">132 Application to resume Australian Citizenship</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">147 Application for a New Zealand Citizen Family Relationship (subclass 461) visa</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">852 Application for a Confirmatory (Residence) visa</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">922 Notification of address or change of address for Business Skills visa holders</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">929 Change of address and/or passport details</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">1005 Application for a bridging visa To replace a ceased bridging visa, to change bridging visa conditions or to provide lawful status during judicial review</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">1007 Application for a Bridging visa D</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">1008 Application for Bridging visa E - subclass 050</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">1031 Declaration Business Skills visa class Investor, State-Territory Sponsored</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">1139A Statement of Assets and Liabilities Position</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">1149 Application for sponsorship for sponsored family visitors</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">1195 Identity declaration</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">1208 Application for a Work and Holiday visa</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">1272 Application for Australian citizenship for children adopted under full Hague Convention arrangements</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">1273 Application for a Maritime Crew (Temporary) visa</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">1276 Application for Skilled  Recognised Graduate (Temporary) visa (subclass 476)</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">1290 Application for Australian citizenship Other situations</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">1300t - Application for Australian citizenship General eligibility</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">1383 Application for a temporary visa for retirees</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">1391 Request for Confirmation of Australian Citizenship Status - deceased person third party</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">1404 Regional Sponsored Migration Scheme - Regional Certifying Body advice</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">1409 Application for a Temporary Graduate visa</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">1418 Application for a Visitor visa  Sponsored Family stream</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">1419 Application for a Vistor Visa - Tourist stream</font></span></div><div><span style="font-size: 12px;"><font face="tahoma">1436 Adding an additional applicant after lodgement</font></span></div><div><span style="font-size: 12px;"><font face="tahoma"><br></font></span></div><div><span style="font-size: 12px;"><font face="tahoma">To use the updated form, just open the existing form in a client case and you will be prompted to use the new version - this is not an obligatory change, so as not to affect closed cases.</font></span></div><div><span style="font-size: 12px;"><font face="tahoma"><br></font></span></div><div><span style="font-size: 12px;"><font face="tahoma">If you experience any difficulties using the new form versions, please do not hesitate to contact support at 1300 063 052 or support@officio.com.au.</font></span></div>', '2018-10-09 00:00:00'),
	(172, 'New Forms Added', '<div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">The following form updates - minor and major version changes - have been uploaded to Officio and are ready for use.&nbsp;</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;"><br></span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;"><div>Form 40 Sponsorship for migration to Australia (parent, aged dependent relative, remaining relative, carer)</div><div><br></div><div>This is a minor change, correcting the recording of the first question responses.</div></span></font></div>', '2018-11-13 00:00:00'),
	(180, 'Happy Holidays from Officio', '<span style="font-size: 12px;">Officio\'s office will be closed December 24</span><font size="1">th</font><span style="font-size: 12px;"> through 26</span><font size="1">th</font><span style="font-size: 12px;">, and 29</span><font size="1">th</font><span style="font-size: 12px;"> through the 1</span><font size="1">st</font><span style="font-size: 12px;"> of January.&nbsp;</span><div><span style="font-size: 12px;"><br></span></div><div><span style="font-size: 12px;">During this time issue reports can still be forwarded to our support email (support@officio.com.au), and we will respond as promptly as possible. Please copy emergency issues to our Manager, Craig Stone | craig@officio.com.au.</span></div><div><span style="font-size: 12px;"><br></span></div><div><span style="font-size: 12px;">We wish you all a very Happy Holidays, and a Happy New Year!</span></div>', '2018-12-24 00:00:00'),
	(181, 'Officio Training Webinar - Thursday January 17, 3:00 pm Brisbane', '<font face="tahoma, arial, helvetica, sans-serif">The training webinar runs for two hours between 3:00PM and 5:00PM (Brisbane time)</font><div><font face="tahoma, arial, helvetica, sans-serif"><br></font></div><div><font face="tahoma, arial, helvetica, sans-serif">The first hour will cover the basics of using Officio and the second hour will provide more in depth training on a particular feature of Officio. The content of the second hour changes each week.</font></div><div><font face="tahoma, arial, helvetica, sans-serif">&nbsp;</font></div><div><font face="tahoma, arial, helvetica, sans-serif">If you would like to reserve a space in this webinar, please complete the following form:</font></div><div><font face="tahoma, arial, helvetica, sans-serif"><br></font></div><div><font face="tahoma, arial, helvetica, sans-serif"><a href="https://www.cognitoforms.com/OfficioAustralia/OfficioWebinarRegistration" target="_blank" class="blulinkun" >https://www.cognitoforms.com/OfficioAustralia/OfficioWebinarRegistration</a></font></div>', '2019-01-02 00:00:00'),
	(182, 'Server Move and Upgrade', '-- COMPLETED --<br><br>We will be upgrading the Officio production servers on Saturday, February 2, at 21:00 AEDT.<div><br></div><div>The server update and move will take up to two hours to complete and <b><i>users will not be able to be active during this time</i></b>.</div><div><br></div><div>Once the server move has been completed, and the new server fully operational, Officio users should see a significant increase in platform speed, responsiveness, and a reduction in save times.&nbsp;</div><div><br></div><div>Thank you for your attention.</div><div><br></div><div>If you have any questions, or you encounter any issues, please contact support @officio.com.au.&nbsp;</div>', '2019-01-31 00:00:00'),
	(183, 'Browser Caching Issues', 'Since the server upgrade on Feb 2 several users have reported issues where some panels in Officio load slowly or not at all.<div><br></div><div><b>This issue is caused by a full browser memory, and emptying the browser cache will clear this issue.&nbsp;</b>To clear your browser cache, <a href="https://www.refreshyourcache.com/en/home/" target="_blank" class="blulinkun" >find browser and operating system-specific instructions here</a>.&nbsp;</div><div><br></div><div>Once you have cleared your browser cache please log out and back in to Officio, and the problem should be resolved. <br><br>If you have further questions, or this does not resolve the issue, please email support@officio.com.au.</div>', '2019-02-07 00:00:00'),
	(186, 'Officio Training Webinar - March 27, 2019 (3pm Brisbane time)', '<span style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"></span><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">Officio organizes weekly training webinars as a part of our complementary training for all Officio users.</span></font><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;"><br></span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">The training webinar runs for two hours between 3:00PM to 5PM&nbsp;</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;"><br></span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">The first hour will cover the basics of using Officio and the second hour will provide more in depth training on a particular feature of Officio. The content of the second hour changes each week.</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;"><br></span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">Spaces are limited and places fill quickly. Registration is now open.</span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;"><br></span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;"><a href="https://www.cognitoforms.com/OfficioAustralia/OfficioWebinarRegistration" target="_blank" class="blulinkun" >https://www.cognitoforms.com/OfficioAustralia/OfficioWebinarRegistration</a></span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;"><br></span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;"><br></span></font></div><div style=""><font face="tahoma, arial, helvetica, sans-serif"><span style="font-size: 12px;">Remember, these webinars are conducted every week. If you are not able to attend the coming webinar, you can always attend the next one.</span></font></div><div style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><br></div>', '2019-03-21 00:00:00'),
	(187, 'April 25, 2019  ANZAC Day- Holiday', 'In observance of ANZAC day on the 25th of April,&nbsp; Officio will be closed. Should you have any urgent question/ss and/or issue/s please email us at support@officio.com.au', '2019-04-23 00:00:00'),
	(188, 'Need more training on Officio?', '<div>Please call or email us at Support@officio.com.au if you require training on using Officio.</div><div>&nbsp;<br></div><div>Here are a few idea to consider:<br>- Add a new Prospect Questionnaire</div><div>- Sent attempted email to all your prospects</div><div>- Add Automatic reminders to follow up with passport or visa expiries. <br></div><div>- Track payments using Client Account<br></div><div><br></div>', '2019-08-29 00:00:00'),
	(189, 'Update- Government Forms', '<div>Are there any government forms (PDF) that you require but not listed in Officio?&nbsp; Please inform us at support@officio.com.au to add the form for you.<br> </div>', '2019-11-04 00:00:00'),
	(194, 'System Outage Notice', '<div style="text-align: justify;"><font size="2" face="arial" color="#677788">We will be performing system maintenance on Saturday, July 25th from 12:00 to 16:00 AEST. In this period, a server backup and restart is required. We will have about <font color="red">1 hour <font color="#677788">of downtime during the maintenance window. We apologize for any inconvenience this may cause.</font></font></font></div>', '2020-07-21 00:00:00');
