	(1, 'system', 'First Invoice', 'Sign up Invoice for {prospects: package}', 'support@officio.com.au', '{prospects: email}', '', 'support@officio.com.au', '<br><table style="width: 81.28%; height: 197px;" border="1" cellpadding="5" cellspacing="0">\n<tbody>\n<tr>\n<td>Officio Pty Ltd<br>ABN:&nbsp;<a id="PartyListView_GridViewParties_HyperlinkAbnDetails_0" href="http://abr.business.gov.au/SearchByAbn.aspx?abn=13164438377" style="color: rgb(0, 102, 153); font-family: DroidSansRegular, helvetica, arial, sans-serif; font-size: 14px;">13 164 438 377</a><br>BILL TO</td></tr>\n<tr>\n<td>{prospects: salutation} {prospects: name} {prospects: last name}<br>{prospects: company}<br>{prospects: address}<br>{prospects: city} {prospects: province/state}{prospects: postal code/zip} <br>{prospects: country}</td></tr></tbody></table><br><br><br>\n<table style="width: 70%;" border="1" cellpadding="5" cellspacing="0">\n<tbody>\n<tr>\n<td align="center">INVOICE NO.</td>\n<td align="center">DATE</td>\n<td align="center">TERMS</td></tr>\n<tr>\n<td align="left">{invoice: number}</td>\n<td align="center">{invoice: date}</td>\n<td><br></td></tr></tbody></table><br><br>\n<table border="1" cellpadding="5" cellspacing="0">\n<tbody>\n<tr>\n<td align="center" width="50%">DESCRIPTION</td>\n<td align="center" width="20%">RATE</td>\n<td align="center" width="15%">QTY</td>\n<td align="center" width="15%">AMOUNT</td></tr>\n<tr>\n<td width="50%">{prospects: package}<br></td>\n<td align="center" width="20%"><br></td>\n<td align="center" width="15%"><br></td>\n<td align="right" width="15%">${invoice: subscription fee}</td></tr>\n<tr>\n<td width="50%">Training</td>\n<td align="center" width="20%"><br></td>\n<td align="center" width="15%"><br></td>\n<td align="right" width="15%">${invoice: support fee}</td></tr>\n<tr>\n<td width="50%">Additional Users</td>\n<td align="center" width="20%">${invoice: price per user}/user</td>\n<td align="center" width="15%">{invoice: additional users}</td>\n<td align="right" width="15%">${invoice: additional users fee}</td></tr>\n<tr>\n<td width="50%">Additional Storage</td>\n<td align="center" width="20%">${invoice: price per storage}/1Gb</td>\n<td align="center" width="15%">{invoice: additional storage}</td>\n<td align="right" width="15%">${invoice: additional storage charges}</td></tr>\n<tr>\n<td colspan="3" width="85%"><br></td>\n<td align="right" width="15%"><b>${invoice: subtotal}</b></td></tr>\n<tr>\n<td colspan="4" width="100%"><br></td></tr>\n<tr>\n<td colspan="3" align="left" width="85%">GST</td>\n<td align="right" width="15%">${invoice: gst/hst fee}</td></tr>\n<tr>\n<td colspan="4" width="100%"><br></td></tr>\n<tr>\n<td colspan="3" align="right" width="85%"><b>TOTAL</b></td>\n<td align="right" width="15%"><b>${invoice: total}</b></td></tr></tbody></table><br>\n<div>\n<center><b>Thank you for using our services. Please do not hesitate to contact us, if we can be of further assistance in the future.</b></center></div>', '2010-07-14'),
	(2, 'system', 'Recurring Invoice', '{billing frequency} recurring subscription invoice for {subscription description}', '', '', '', '', '<br>\n<table style="width: 89.07%; height: 123px;" border="1" cellpadding="5" cellspacing="0">\n<tbody>\n<tr>\n<td>Officio Pty Ltd<br>ABN:&nbsp;<a id="PartyListView_GridViewParties_HyperlinkAbnDetails_0" href="http://abr.business.gov.au/SearchByAbn.aspx?abn=13164438377" style="color: rgb(0, 102, 153); font-family: DroidSansRegular, helvetica, arial, sans-serif; font-size: 14px;">13 164 438 377</a><span style="color: rgb(102, 102, 102); font-family: DroidSansRegular, helvetica, arial, sans-serif; font-size: 14px;">&nbsp;</span><br>BILL TO</td></tr>\n<tr>\n<td>{admin first name} {admin last name}<br>{company name}<br>{company address}<br>{company city} {company province/state} {company postal code/zip}<br>{company country}</td></tr></tbody></table><br><br><br>\n<table style="width: 70%;" border="1" cellpadding="5" cellspacing="0">\n<tbody>\n<tr>\n<td align="middle">INVOICE NO.</td>\n<td align="middle">DATE</td>\n<td align="middle">TERMS</td></tr>\n<tr>\n<td align="left">{invoice: number}</td>\n<td align="middle">{invoice: date}</td>\n<td><br></td></tr></tbody></table>\n<br><br><br><div>&nbsp;<br><br><br></div>\n<table style="width: 100%;" border="1" cellpadding="5" cellspacing="0">\n<tbody>\n<tr>\n<td align="middle" width="50%">DESCRIPTION</td>\n<td align="middle" width="20%">RATE</td>\n<td align="middle" width="15%">QTY</td>\n<td align="middle" width="15%">AMOUNT</td></tr>\n<tr>\n<td width="50%">{subscription description}<br></td>\n<td align="middle" width="20%"><br></td>\n<td align="middle" width="15%"><br></td>\n<td align="right" width="15%">${invoice: subscription fee}</td></tr>\n<tr>\n<td width="50%">Additional Users</td>\n<td align="middle" width="20%">${invoice: price per user}/user</td>\n<td align="middle" width="15%">{invoice: additional users}</td>\n<td align="right" width="15%">${invoice: additional users fee}</td></tr>\n<tr>\n<td width="50%">Additional Storage</td>\n<td align="middle" width="20%">${invoice: price per storage} / 1Gb</td>\n<td align="middle" width="15%">{invoice: additional storage}</td>\n<td align="right" width="15%">${invoice: additional storage charges}</td></tr>\n<tr>\n<td colspan="3" width="85%"><br></td>\n<td align="right" width="15%"><b>${invoice: subtotal}</b></td></tr>\n<tr>\n<td colspan="4" width="100%"><br></td></tr>\n<tr>\n<td colspan="3" align="left" width="85%"><br></td>\n<td align="right" width="15%">${invoice: gst/hst fee}</td></tr>\n<tr>\n<td colspan="4" width="100%"><br></td></tr>\n<tr>\n<td colspan="3" align="right" width="85%"><b>TOTAL</b></td>\n<td align="right" width="15%"><b>${invoice: total}</b></td></tr></tbody></table><br>\n<div>\n<center><b>Thank you for using our services. Please do not hesitate to contact us, if we can be of further assistance in the future.</b></center></div>', '2010-07-14'),
	(3, 'system', 'Reply to Request a Demo', 'Officio request for demo', 'sales@officio.com.au', '{prospects: email}', '', 'sales@officio.com.au; support@officio.com.au; bateni@officio.com.au', '<p><font><font size="2" face="tahoma">Dear </font><font size="2" style="font-family: arial;">{prospects: salutation} {prospects: last name};</font><br><br><font size="2" face="tahoma">Thank you for your interest in Officio, the ultimate in Migration Practice Management software.<br><br></font></font><font><font size="2" face="tahoma">To learn more about Officio, please&nbsp;suggest&nbsp;a suitable time when we can arrange for an online demo.</font></font></p><p><font size="2" face="tahoma"><font>If we can be of any further assistance, please do not hesitate to contact us.</font><br><br>Best regards,<br>Officio Team</font></p>\n<p style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;"><font><font face="arial" style="font-size: 12px;">_______________________________________ </font><br><font size="2"><br><font face="arial">Officio Australia</font><br><font face="arial">T:+1300 063 052&nbsp;</font><br><font face="arial">Level 7, 199 George Street, Brisbane, QLD, 4000</font><br></font><font face="arial"><a href="http://www.officio.com.au"><font size="2">www.officio.com.au</font></a><span style="font-size: 12px;"><a href="http://www.uniques.ca" rel="nofollow" target="_blank"></a></span></font></font></p>', '2011-04-15'),
	(4, 'system', 'Support Email', 'Officio Support {support email counter}', '{support request: email}', 'support@officio.com.au', '', 'bateni@officio.com.au', '<font size="2"><font face="tahoma, arial, helvetica, sans-serif" style="font-family: arial;">Dear {support request: name},</font><br><br><font face="tahoma, arial, helvetica, sans-serif" style="font-family: arial;">Thank you, we have received&nbsp;</font><span style="font-family: arial;">your</span><font face="tahoma, arial, helvetica, sans-serif"><font face="arial">&nbsp;query and will&nbsp;</font>try<font face="arial">&nbsp;to respond to you within 24 business hours.</font></font></font><div><font face="arial" size="2"><br></font></div><div><font size="2"><font face="arial">If your enquiry is urgent, please email us on support@officio.com.au with URGENT in your subject line.<br></font><br><br><font face="tahoma, arial, helvetica, sans-serif" style="font-family: arial;">Best regards,</font><br><font face="tahoma, arial, helvetica, sans-serif" style="font-family: arial;">Officio Support Team</font></font></div><div><font face="arial" size="2">Level 7, 199 George Street, Brisbane, QLD - 4000</font></div><div><font face="arial" size="2">Phone - 1300 063 052<br></font><font face="tahoma, arial, helvetica, sans-serif" style="font-family: arial;"><span style="font-size: 12px;">----------------------------------------------------------------------------------</span></font><br><font size="2"><font face="tahoma, arial, helvetica, sans-serif" style="font-family: arial;">Name: {support request: name}</font><br><font face="tahoma, arial, helvetica, sans-serif" style="font-family: arial;">Company: {support request: company}</font><br><font face="tahoma, arial, helvetica, sans-serif" style="font-family: arial;">Tel: {support request: phone}</font><br><font face="tahoma, arial, helvetica, sans-serif" style="font-family: arial;">Email: {support request: email}</font><br><font face="tahoma, arial, helvetica, sans-serif" style="font-family: arial;">Your Request:</font><br><br><font face="tahoma, arial, helvetica, sans-serif" style="font-family: arial;">{support request: request}</font></font><br></div>', '2010-05-26'),
	(5, 'system', 'Signup Completed', 'Welcome to Officio. Your online office.', 'support@officio.com.au', '{prospects: email}', 'support@officio.com.au', 'bateni@officio.com.au', '<p><font face="arial"><span style="font-size: 12px;">Dear {prospects: salutation} {prospects: last name};</span><br><br><span style="font-size: 12px;">Thank you for signing up with Officio, the ultimate in migration practice management software.</span><br><br><span style="font-size: 12px;">Before using Officio, you need to setup your account. If you have not already set up your account, please click on the following link:</span><a style="font-family: arial;"><br><br><font size="2">http://secure.officio.com.au/companywizard</font></a><font size="2"><a href="http://secure.officio.com.au/companywizard?key=%7Bprospects:%20reg.%20key%7D" style="font-family: arial;">?key={prospects: reg. key}</a><br><br>This link takes you thru a simple step-by-step wizard to customize the software to your requirements. Once the setup is complete, you can start using Officio immediately.<br></font><br><font size="2">If we can be of any further assistance, please do not hesitate to contact us by replying to this email.</font><br><br><span style="font-size: 12px;">Regards,</span><br><span style="font-size: 12px;">Officio Support Team</span><br><span style="font-size: 12px;">---------------------------------------------------</span><br><span style="font-size: 12px;">Officio Pty Ltd.</span><br><span style="font-size: 12px;">T:&nbsp;1 300 063 052&nbsp;</span><br><span style="font-size: 12px;">Level 7, 199 George Street, Brisbane, QLD, 4000</span><br><span style="font-size: 12px;">www.officio.com.au</span></font><br></p>', '2011-04-15'),
	(7, 'other', 'follow up 1', 'follow up to your last demo request', 'support@officio.com.au', '{prospects: email}', '', '', 'Dear {prospects: name} {prospects: last name};<br><br>I hope you have had a chance to review our demo video.&nbsp;&nbsp; If you have any questions or require more information about a specific requirement you have, please reply to this email with your questions.<br><br>Regards<br>Officio Sales Team<br>', '2009-12-27'),
	(8, 'system', 'New user notification on Company Creation', 'Your Officio account information', 'support@officio.com.au', '{user: email}', '', 'support@officio.com.au', '<font face="arial" size="2">Dear {user: first name},</font>\n<div><font face="arial" size="2"><br>Welcome to Officio, the ultimate in Migration Practice Management software.<br><br>1. You have been added to Officio by your company Admin.&nbsp;You can login to Officio by clicking on the following link:</font></div>\n<div><font face="arial" size="2"><br><a href="http://secure.officio.com.au">http://secure.officio.com.au</a> <br><br></font></div>\n\n<div><div><font face="arial" size="2">The followings are your login details:</font></div>\n<div><font face="arial" size="2"><br></font></div>\n<div><font face="arial" size="2">Username:&nbsp; <b>{user: username}</b></font><font face="arial" size="2"><br>Password: &nbsp; &nbsp;<b>{user: password}</b></font><font face="arial" size="2"><br><br></font>\n<div><font face="arial" size="2">For the security of your data, please ensure to always log out from Officio when you finish work.<br><br>2. To learn more about Officio, please ensure to visit the help, where you can access tutorials for various sections of the program. This helps you get familiar with the program more quickly. Please ensure to configure your email and calendar to start using these components as well.<br><br></font><font face="arial" size="2">We hope you enjoy your experience with Officio.</font><font face="arial" size="2"> If we can do anything to enhance your experience with Officio, please do not hesitate to let us know.<br><br>Regards,</font><font face="arial" size="2"><br>Officio Support Team</font></div></div>\n<div><font face="arial"><br></font></div>\n<div><font face="arial"><br></font></div></div>', '2011-04-15'),
	(9, 'system', 'Forgotten Email', 'Your login details to Officio', 'support@officio.com.au', '{user: email}', '', '', '<div><font face="arial"><span style="FONT-SIZE: small">Dear {user: first name} {user: last name};</span></font></div>\n<div><font face="arial"><span style="FONT-SIZE: small"><br></span></font></div>\n<div><font face="arial"><span style="FONT-SIZE: small">As per your request, please find below your login details:</span></font></div>\n<div><font face="arial"><span style="FONT-SIZE: small"><br></span></font></div>\n<div><font face="arial"><span style="FONT-SIZE: small">User ID: <b>{user: username}</b></span></font></div>\n<div><font face="arial"><span style="FONT-SIZE: small">Link to reset password: <b><a href="https://secure.officio.com.au/auth/recovery/hash/{user: password hash}">click here</a></b></span></font></div>\n<div><font face="arial"><span style="FONT-SIZE: small"><br></span></font></div>\n<div><font face="arial"><span style="FONT-SIZE: small">For the security of your data, please ensure to always logout from Officio when you finish work.</span></font></div>\n<div><font face="arial"><span style="FONT-SIZE: small"><br></span></font></div>\n<div><font face="arial"><span style="FONT-SIZE: small">Regards,</span></font></div>\n<div><font face="arial"><span style="FONT-SIZE: small">Officio Support Team</span></font></div>\n<div><font face="arial"><span style="FONT-SIZE: small"><br></span></font></div><br>', '2011-04-15'),
	(10, 'system', 'Special CC Charge', '{special cc charge: notes}', '', '', '', '', '&nbsp; \n<table style="width: 451px; height: 137px;" border="1" cellpadding="5" cellspacing="0">\n<tbody>\n<tr>\n<td>Officio Pty Ltd<br>ABN:&nbsp;<a id="PartyListView_GridViewParties_HyperlinkAbnDetails_0" href="http://abr.business.gov.au/SearchByAbn.aspx?abn=13164438377" style="color: rgb(0, 102, 153); font-family: DroidSansRegular, helvetica, arial, sans-serif; font-size: 14px;">13 164 438 377</a><span style="color: rgb(102, 102, 102); font-family: DroidSansRegular, helvetica, arial, sans-serif; font-size: 14px;">&nbsp;</span><br>BILL TO</td></tr>\n<tr>\n<td>{admin first name} {admin last name}<br>{company name}<br>{company address}<br>{company city} {company province/state} {company postal code/zip}<br>{company country}</td></tr></tbody></table><br><br><br>\n<table border="1" cellpadding="5" cellspacing="0">\n<tbody>\n<tr>\n<td align="center">INVOICE NO.</td>\n<td align="center">DATE</td>\n<td align="center">TERMS</td></tr>\n<tr>\n<td align="left">{invoice: number}</td>\n<td align="center">{invoice: date}</td>\n<td><br></td></tr></tbody></table><br><br><br><br><br><br><br>\n<table border="1" cellpadding="5" cellspacing="0">\n<tbody>\n<tr>\n<td align="center" width="50%">DESCRIPTION</td>\n<td align="center" width="20%">RATE</td>\n<td align="center" width="15%">QTY</td>\n<td align="center" width="15%">AMOUNT</td></tr>\n<tr>\n<td width="50%">{subscription description}<br></td>\n<td align="center" width="20%"><br></td>\n<td align="center" width="15%"><br></td>\n<td align="right" width="15%">${invoice: subscription fee}</td></tr>\n<tr>\n<td width="50%">Support and Training</td>\n<td align="center" width="20%"><br></td>\n<td align="center" width="15%"><br></td>\n<td align="right" width="15%">${invoice: support fee}</td></tr>\n<tr>\n<td width="50%">Additional Users</td>\n<td align="center" width="20%">${invoice: price per user}/user</td>\n<td align="center" width="15%">{invoice: additional users}</td>\n<td align="right" width="15%">${invoice: additional users fee}</td></tr>\n<tr>\n<td width="50%">Additional Storage</td>\n<td align="center" width="20%">${invoice: price per storage}/1Gb</td>\n<td align="center" width="15%">{invoice: additional storage}</td>\n<td align="right" width="15%">${invoice: additional storage charges}</td></tr>\n<tr>\n<td colspan="3" width="85%"><br></td>\n<td align="right" width="15%"><b>${invoice: subtotal}</b></td></tr>\n<tr>\n<td colspan="4" width="100%"><br></td></tr>\n<tr>\n<td colspan="3" align="left" width="85%">GST<br></td>\n<td align="right" width="15%">${invoice: gst/hst fee}</td></tr>\n<tr>\n<td colspan="4" width="100%"><br></td></tr>\n<tr>\n<td colspan="3" align="right" width="85%"><b>TOTAL</b></td>\n<td align="right" width="15%">${special cc charge: amount}</td></tr></tbody></table><br>\n<p></p>\n<center><b>Thank you for using our services. Please do not hesitate to contact us, if we can be of further assistance in the future.</b></center>\n<p></p>', '2010-07-14'),
	(11, 'system', 'Credit Card Processing Error', 'Officio Billing - Please update your credit card information', 'support@officio.com.au', 'support@officio.com.au', '', 'shahram@officio.com.au', '<font face="arial" size="2">Dear </font><font face="arial" size="2">{admin first name} {admin last name};<br><br>Our automated billing system has encountered the following error in processing your credit card:<br></font><font size="2"><font face="arial"><br><b>{error message}</b></font><br></font><font face="arial" size="2"><br>To update your credit card details, please take the following steps:<br><br>- Login to Officio, <br>- On the top-right corner of the screen, click on <b>Admin</b><br>- On the left, click on <b>Company Details</b><br>- Click on <b>Account Details</b><br>- Click on <b>Update Credit Card on File</b><br>- Update your credit card information and click on Save<br><br>We will be automatically notified of this change, and your account will be reinstated automatically.<br><br>If we can be of any further assistance, please do not hesitate to contact us by replying to this email.<br><br>Best regards,<br>Officio Billing Team<br></font><font size="2"><span style="FONT-FAMILY: arial"><br>_______________________________________ </span><br style="FONT-FAMILY: arial"><br style="FONT-FAMILY: arial">Officio Pty Ltd.<br>T: +61 7 3212-2266 F: +61 7 3212-2211<br>Level 7, 199 George Street, Brisbane, QLD, 4000<br>www.officio.com.au</font><br><br>', '2010-05-28'),
	(12, 'system', 'Credit card on file was updated by admin', 'Admin of {company name} updated their credit card on file', 'support@officio.com.au', 'Support@officio.com.au', '', 'shahram@officio.com.au', '<br>The following company has updated their credit card information on file.&nbsp;&nbsp; Please check their account and process any invoice that is outstanding.<br><br>Their detail:<br>Company Name: {company name}<br>Company City: {company city}<br>Company Phone 1: {company phone 1}<br>Company Phone 2: {company phone 2}<br>Admin:{admin first name} {admin last name}<br>Admin email: {admin email}', '2010-05-28'),
	(13, 'system', 'Notes or Special Invoice', '{special cc charge: notes}', '', '', '', '', '<br>\n<table border="1" cellpadding="5" cellspacing="0" height="157" width="260">\n<tbody>\n<tr>\n<td>BILL TO</td></tr>\n<tr>\n<td>{admin first name} {admin last name}<br>{company name}<br>{company address}<br>{company city} {company province/state} {company postal code/zip}<br>{company country}</td></tr></tbody></table><br><br><br>\n<table style="width: 70%;" align="right" border="1" cellpadding="5" cellspacing="0">\n<tbody>\n<tr>\n<td align="center">INVOICE NO.</td>\n<td align="center">DATE</td>\n<td align="center">TERMS</td></tr>\n<tr>\n<td align="left">{invoice: number}</td>\n<td align="center">{invoice: date}</td>\n<td><br></td></tr></tbody></table><br><br><br>\n<table style="width: 100%;" border="1" cellpadding="5" cellspacing="0">\n<tbody>\n<tr>\n<td align="center" width="50%">DESCRIPTION</td>\n<td align="center" width="20%">RATE</td>\n<td align="center" width="15%">QTY</td>\n<td align="center" width="15%">AMOUNT</td></tr>\n<tr>\n<td width="50%">{subscription description}<br></td>\n<td align="center" width="20%"><br></td>\n<td align="center" width="15%"><br></td>\n<td align="right" width="15%">$ {invoice: subscription fee}</td></tr>\n<tr>\n<td width="50%">Additional Users</td>\n<td align="center" width="20%">${invoice: price per user}/user</td>\n<td align="center" width="15%">{invoice: additional users}</td>\n<td align="right" width="15%">${invoice: additional users fee}</td></tr>\n<tr>\n<td width="50%">Additional Storage</td>\n<td align="center" width="20%">${invoice: price per storage}/ 1Gb</td>\n<td align="center" width="15%">{invoice: additional storage}</td>\n<td align="right" width="15%">${invoice: additional storage charges}</td></tr>\n<tr>\n<td colspan="3" width="85%"><br></td>\n<td align="right" width="15%"><b>${invoice: subtotal}</b></td></tr>\n<tr>\n<td colspan="4" width="100%"><br></td></tr>\n<tr>\n<td colspan="3" align="left" width="85%">GST ()</td>\n<td align="right" width="15%">${invoice: gst/hst fee}</td></tr>\n<tr>\n<td colspan="4" width="100%"><br></td></tr>\n<tr>\n<td colspan="3" align="right" width="85%"><b>TOTAL</b></td>\n<td align="right" width="15%"><strong>${special cc charge: amount}</strong></td></tr></tbody></table><br>\n<div>\n<center><b>Thank you for using our services. Please do not hesitate to contact us, if we can be of further assistance in the future.</b></center></div>\n<p></p>', '2010-07-14'),
	(14, 'system', 'Subscription Invoice', 'Invoice for {company package} - {billing frequency} Subscription', 'support@officio.com.au', '{company email}', '', 'support@officio.com.au', '<table>\n    <tbody><tr>\n        <td>\n            <img src="{settings: images path}/default/officio_logo_with_bg.png" alt="logo" height="94" width="600">\n        </td>\n    </tr>\n\n    <tr>\n\n    <td>\n      <table align="center" bgcolor="#b3bcbf" border="0" cellpadding="6" cellspacing="1">\n        <tbody>\n          <tr>\n            <td bgcolor="#ffffff">\n              <table border="0" cellpadding="5" cellspacing="0" width="100%">\n                <tbody>\n                  <tr>\n                    <td style="font: 11px Arial,Helvetica,sans-serif; text-align: left;" bgcolor="#f0f0f0">\n\n                        <table border="0" cellpadding="5" width="100%">\n                          <tbody>\n                            <tr>\n                              <td>\n                                  <div style="font: 11px Arial,Helvetica,sans-serif;">Dear {admin first name} {admin last name},<br><br>Thank you for your order. Here are your order details:</div>\n                              </td>\n                            </tr>\n                          </tbody>\n                        </table>\n\n                      <table border="1" cellpadding="6" width="100%">\n                        <tbody>\n                          <tr>\n                            <td bgcolor="#ffffff">\n                              <table border="0" cellpadding="0" cellspacing="0" width="100%">\n                                <tbody>\n                                  <tr>\n                                    <td style="font: 11px Arial,Helvetica,sans-serif;" nowrap="nowrap"><span style="color: #4F8CBC; font-weight: bold;">{company package} - {billing frequency} Subscription</span><br>\n                                        <strong>Licensee Name:</strong>&nbsp;&nbsp;{company name}\n          