              </tr>\n                        </tbody>\n                      </table>\n                        \n                      <br>\n\n                        <table style="background: url(&quot;{settings: images path}/default/officio_watermark.png&quot;) no-repeat center;" bgcolor="#f0f0f0" border="0" cellpadding="3" cellspacing="0" width="100%">\n                            <tbody><tr>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;" width="40%"><strong>Description</strong></td>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;" align="center" width="20%"><strong>Qty</strong></td>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;" align="center" width="20%"><strong>Unit Price</strong></td>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;" align="right" width="20%"><strong>Amount</strong></td>\n                            </tr>\n                            <tr>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;"><span style="font-weight: bold;">{company package} - {billing frequency} Subscription</span>\n                                      <br>Includes:<br>\n                                        - {invoice: free storage} Gb of space<br>\n                                        - {invoice: free users} user license(s)\n                                  </td>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;" align="center">{invoice: quantity}</td>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;" align="center">{invoice: currency} {invoice: subscription fee}</td>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;" align="right">{invoice: currency} {invoice: subscription fee}</td>\n                            </tr>\n                            <tr {invoice:="" hide="" if="" empty="" discount}="">\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;">Discount</td>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;" align="center">&nbsp;</td>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;" align="center">&nbsp;</td>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;" align="right">{invoice: currency} -{invoice: discount}</td>\n                            </tr>\n                            <tr>\n                                <td style="font: 11px Arial,Helvetica,sans-serif; font-weight: bold;">Additional user license(s)</td>\n                                <td style="font: 11px Arial,Helvetica,sans-serif;" align="center">{invoice: additional users}</td>\n                                <td style="font: 11px Arial,Helvetica,sans-serif;" align="center">{invoice: currency} {invoice: price per user}</td>\n                                <td style="font: 11px Arial,Helvetica,sans-serif;" align="right">{invoice: currency} {invoice: additional users fee}</td>\n                            </tr>\n                            <tr><td colspan="4"><hr></td></tr>\n                            <tr>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;">&nbsp;</td>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;" align="center">&nbsp;</td>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;" align="right">Sub Total</td>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;" align="right">{invoice: currency} {invoice: subtotal}</td>\n                            </tr>\n                            <tr>\n                                  <td colspan="3" style="font: 11px Arial,Helvetica,sans-serif;" align="right">GST ()</td>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;" align="right">{invoice: currency} {invoice: gst/hst fee}</td>\n                            </tr>\n                            <tr>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;">&nbsp;</td>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;" align="center">&nbsp;</td>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif; font-weight: bold;" align="right">Total</td>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;" align="right">{invoice: currency} {invoice: total}</td>\n                            </tr>\n                            <tr>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;">&nbsp;</td>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;" align="center">&nbsp;</td>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif; font-weight: bold;" align="right">Paid</td>\n                                  <td style="font: 11px Arial,Helvetica,sans-serif;" align="right">{invoice: currency} -{invoice: amount paid}</td>\n                            </tr>\n                            <tr>\n                              <td colspan="4" height="38" nowrap="nowrap">\n                                <table border="0" width="100%">\n                                    <tbody><tr>\n                                      <td style="font: 11px Arial,Helvetica,sans-serif;" nowrap="nowrap" width="18%"><strong>Payment method:</strong></td>\n                                      <td style="font: 11px Arial,Helvetica,sans-serif;" width="82%">{invoice: payment method}</td>\n                                    </tr>\n                                </tbody></table>\n                              </td>\n                            </tr>\n                        </tbody></table>\n\n                        <table border="0" cellpadding="5" width="100%">\n                          <tbody>\n                            <tr>\n                              <td style="font: 11px Arial,Helvetica,sans-serif;">\n                                  <p><strong>ABN: 13 164 438 377</strong></p><p><strong><br>A couple of quick notes and reminders:</strong></p>\n                                  <ul>\n                                    <li><strong>Payment:</strong> Your credit card&nbsp; has been debited with {invoice: currency} {invoice: amount paid}, your card statement will list "Officio PTY Ltd.".</li>\n                                    <li><strong>My account:</strong> You can always access your invoices by logging into Officio, and going to Admin | Company Details | Company Invoices. </li>\n                                  </ul>\n                                  <p>Thank you for your order. If we can do anything to enhance your experience with Officio, please do not hesitate to let us know.</p>\n                                  <br><br>\n                                  <p>Best regards,</p>\n                                  <p><strong>The Officio Team</strong></p>\n                                  <p><br></p>\n                              </td>\n                            </tr>\n                          </tbody>\n                        </table>\n\n                        <p>\n                    </p></td>\n                  </tr>\n                </tbody>\n              </table>\n            </td>\n          </tr>\n        </tbody>\n      </table>\n    </td>\n  </tr>\n</tbody></table>', '2011-03-17'),
	(18, 'mass_email', 'Scheduled Maintenance', 'Scheduled Maintenance', 'Officio Support "support@uniques.ca"', '', '', '', '<font face="arial"><br>Dear {user: first name},<br><br>We will be conducting a scheduled maintenance on one of Officio\'s servers on Saturday, Feb. 2nd, 2013, starting at 00:05AM AST. D</font><font face="arial"><font face="arial">uring this time service will not be available to you.<br></font><br>While our intent is to minimize the downtime, the server should be back online by 9:00AM AST on Saturday.&nbsp; <br><br>Officio is growing very quickly, thanks to users like you.&nbsp; This scheduled maintenance is part one of a 2-step process to expand our servers capacities.<br><br>Apart from working on infrastructure, we will be releasing a new upgrade that includes:<br>- Improved and faster performing Document-Management<br>- Time-Management Module<br>- Task-Management Module<br><br>We will be sending you additional emails with instructions on how to use these new features.<br><br>We apologize for any inconvenience this may cause. I trust you will like the new improvements.<br><br>If we can be of any further assistance, please do not hesitate to contact us.<br><br>do not hesitate to contact us.<br><br></font><font size="2">Best regards,<br>Officio Team<br></font>\n<p style="font-family: arial;"><font size="2">_______________________________________ <br><br>Officio Pty Ltd.<br>T: +61 7 3212-2266 F: +61 7 3212-2211<br>Level 7, 199 George Street, Brisbane, QLD, 4000<br>www.officio.com.au</font></p><p><font face="arial"><br></font></p><font face="arial"><br><br></font>', '2011-11-17'),
	(19, 'mass_email', 'Officio Update 2013', 'Officio Update 2013', 'support@officio.com.au', '', '', 'shahram@officio.com.au', '<p></p><p><font color="#000000"><font face="arial"><br>Dear {user: first name},<br><br>I\'m excited to announce the release of Officio-2013. This version includes the following key features:<br><br>- Immigration News section<br>- Time Management<br></font></font><span style="font-family: arial;">- Task Management<br></span><span style="font-family: arial;">- Improved Document Management<br></span><span style="font-family: arial;"><br>To learn more, please watch the following 10-minute video:<br></span><span style="font-family: arial;"></span></p><p><span style="font-family: arial;">&lt;link&gt;</span></p><p><span style="font-family: arial;"></span><span style="font-family: arial;"><br>These features are available to you at no extra cost. I hope you\'ll find them useful in your day-to-day operation.</span><span style="font-family: arial;"><br><br>If we can be of any further assistance, please do not hesitate to contact us.<br></span><span style="font-family: arial;"><br>Best regards,<br></span><span style="font-family: arial;">Officio Team<br></span></p><p><font color="#000000"><font face="arial">_______________________________________<br><br>Officio Pty Ltd.<br>T: +61 7 3212-2266&nbsp;&nbsp;&nbsp; F: +61 7 3212-2211<br>Level 7, 199 George Street, Brisbane, QLD, 4000<br>www.officio.com.au</font></font></p><p></p>', '2013-02-04'),
	(21, 'mass_email', 'Scheduled Maintenance 2', 'Scheduled Maintenance', 'Officio Support "support@officio.com.au"', '', '', '', '<font face="arial"><br>Dear {user: first name},<br><br>We will be performing a software upgrade on one of Officio\'s servers on Saturday, April 6th, 2013, starting at 01:00AM AST. D</font><font face="arial"><font face="arial">uring this time service will not be available to you.<br></font><br>While our intent is to minimize the downtime, the server should be back online by 9:00AM AST on Saturday. <br><br>We apologize for any inconvenience this may cause. I trust you will like the new improvements.<br><br></font><font face="arial"><font face="arial">Officio is growing very quickly, thanks to users like you. </font>If you have any suggestions or improving ideas, please do not hesitate to contact us.<br><br>Best regards, <br>Officio Team<br>_______________________________________  <br><br>Officio Pty Ltd.<br>T: +61 7 3212-2266&nbsp;&nbsp;&nbsp; F: +61 7 3212-2211<br>Level 7, 199 George Street, Brisbane, QLD, 4000<br>www.officio.com.au<a href="http://www.officio.ca"></a></font><p><font face="arial"><br></font></p><font face="arial"><br><br></font>', '2013-04-04'),
	(22, 'system', 'Password Changed', 'Officio - Password Changed', 'support@officio.com.au', '{user: email}', '', '', '<font face="arial" size="2">Dear {user: first name},</font>\n<div>Your password was changed.</div>', '2014-04-25'),
	(23, 'system', 'User account locked', 'Officio - User account locked', 'support@officio.com.au', 'support@officio.com.au', '', 'bateni@officio.com.au', '<div>User account locked: {user: username}.</div>', '2014-04-26'),
	(24, 'mass_email', 'Officio Webinar', 'FREE Officio Webinar June 17, 2016', 'support@officio.com.au', '', '', '', '<table cellpadding="0" cellspacing="0" class="news cke_show_border" style="text-align: right; border-color: rgb(211, 211, 211) rgb(211, 211, 211) rgb(153, 153, 153); border-width: 1px; border-style: dotted; font-size: 12px; color: rgb(103, 119, 136); display: block; font-family: arial, tahoma, helvetica, sans-serif; padding-bottom: 5px; width: 600px;"><tbody><tr><td colspan="2" style="border: 1px dotted rgb(211, 211, 211); text-align: justify;"></td></tr><tr><td style="border: 1px dotted rgb(211, 211, 211); width: 525px;"><div style="text-align: left;"><img alt="" data-cke-saved-src="http://static3.officio.com.au/images/default/logo_new.png" src="http://static3.officio.com.au/images/default/logo_new.png" style="cursor: default; height: 60px; width: 139px;"></div><div><br></div><div><br></div></td><td style="border: 1px dotted rgb(211, 211, 211); text-align: right; white-space: nowrap; width: 70px;">15 June 2016</td></tr><tr><td colspan="2" style="border: 1px dotted rgb(211, 211, 211); text-align: justify;"><div><br></div><div>Dear&nbsp;{admin first name},</div><div><br></div><div>Officio organises weekly training webinars as a part of our free training for all Officio users.</div><div><div><br></div><div>Space is limited and&nbsp;places fill quickly. Please register your interest by clicking on this link today&nbsp;</div><div>-&nbsp;<a data-cke-saved-href="https://www.cognitoforms.com/OfficioAustralia/OfficioWebinarRegistration" href="https://www.cognitoforms.com/OfficioAustralia/OfficioWebinarRegistration" target="_blank" class="blulinkun" style="color: rgb(76, 131, 197); font-family: Arial, Helvetica, sans-serif; font-size: 11px; text-decoration: none;">https://www.cognitoforms.com/OfficioAustralia/OfficioWebinarRegistration</a></div><div><br></div><div>Remember, these webinars are conducted every week, so if you are not able to attend the coming webinar, you can always attend the next one.</div><div><br></div><div>Webinar goes on for two hours between 3:00PM and 5:00PM every Friday. The next Webinar is scheduled on 17 June 2016 at 3:00PM.&nbsp;</div><div><br></div><div>Please join the training, by clicking on this link:</div><div><p>http://go.teamviewer.com/v10/m09588584</p><p>ID: m09-588-584</p><p>Password: training123</p></div><div><div><span style="font-family: helvetica, sans-serif;">Thanks and regards,</span></div><div><br></div><div><strong><em><span style="color: rgb(0, 150, 255);"><span style="font-family: helvetica, sans-serif;">Abhishek Vora</span></span></em></strong></div><div><em><span style="color: rgb(0, 150, 255);"><span style="font-family: helvetica, sans-serif;">Client Experience Manager,&nbsp;Officio Australia</span></span></em></div><div><br></div><div><span style="font-family: helvetica, sans-serif;">T:&nbsp;&nbsp; 1 300 063 052&nbsp;&nbsp;&nbsp;&nbsp;<br><a data-cke-saved-href="mailto:abhishek@officio.com.au" href="mailto:abhishek@officio.com.au" style="color: purple;"><span style="color: rgb(4, 46, 238);">vora@officio.com.au</span></a>;&nbsp;<a data-cke-saved-href="mailto:support@officio.com.au" href="mailto:support@officio.com.au" style="color: purple;"><span style="color: rgb(4, 46, 238);">support@officio.com.au</span></a></span></div><div><span style="color: rgb(4, 46, 238);"><span style="font-family: helvetica, sans-serif;"><span style="font-size: 9pt;"><a data-cke-saved-href="http://www.officio.com.au/" href="http://www.officio.com.au/" style="color: purple;">www.officio.com.au</a></span></span></span></div><div><span style="font-family: helvetica, sans-serif;">Level 7, 199 George Street, &nbsp;</span><span style="font-size: 9pt;">Brisbane, QLD, 4000</span></div><div><br><br></div><div><span style="color: rgb(30, 73, 125);"><span style="font-size: 7pt;">Disclaimer:&nbsp;</span></span><span style="font-size: 7pt;">This e-mail and any attachments may contain confidential information that is intended solely for the use of the intended recipient and may be subject to copyright. If you receive this e-mail in error, please notify the sender immediately and delete the e-mail and its attachments from your system. You must not disclose copy or use any part of this e-mail if you are not the intended recipient.</span></div></div></div><div><span style="font-size: 7pt;"><br></span></div></td></tr></tbody></table>', '2016-05-27'),
	(25, 'system', 'Certificate of Naturalisation (for PDF generation)', 'Certificate of Naturalisation (for PDF generation)', '', '', '', '', '<table border="0" cellpadding="3" align="left" width="100%">\n                 <tr>\n                  <td width="75%" style="font-weight: bold;">COMMONWEALTH OF DOMINICA CITIZENSHIP ACT (Ch.1:10)</td>\n                  <td width="25%" align="right" style="font-weight: bold;">SECTION 8</td>\n                 </tr>\n                </table>\n                <h1 align="center">CERTIFICATE OF NATURALISATION</h1>\n                <p style="text-indent: 30px;">WHEREAS <i><b>{main_applicant_name}</b></i> has applied to the Minister responsible for citizenship in the Government of Dominica for a certificate of naturalisation, alleging with respect to {self_name} the particulars set out below, and has satisfied the Minister that the conditions laid down in the Constitution and in the Citizenship Act Chapter 1:10 for the grant of a certificate of naturalisation are fulfilled:</p>\n                <p style="text-indent: 30px;">Now, THEREFORE, the Minister, in exercise of the powers conferred upon him by the said Constitution and Act, grants to the said <i><b>{main_applicant_name_2}</b></i> this Certificate of Naturalisation, and declares that upon taking the oath or affirmation of allegiance in the manner required by the Act shall be a citizen of Dominica as from the date of this certificate.</p>\n                <p style="text-indent: 30px;">In witness whereof I have hereto subscribed my name this ____ day of _________, ______.</p>\n                <p></p>\n                <p></p>\n                <p></p>\n                <table border="0" cellpadding="3" align="left" width="100%">\n                 <tr>\n                  <td width="65%"></td>\n                  <td width="35%" style="font-size: 8px; font-style: italic;"><br />MINISTER FOR JUSTICE, IMMIGRATION <br />AND NATIONAL SECURITY</td>\n                 </tr>\n                </table>\n                <p></p>\n                <p align="center" style="font-weight: bold; font-size: 10px;">Particulars relating to applicant</p>\n                <table border="0" cellpadding="0" align="left" width="100%" style="font-size: 10px;">\n                 <tr>\n                  <td width="32%"></td>\n                  <td width="25%">FULL NAME:</td>\n                  <td width="43%">{main_applicant_name_3}</td>\n                 </tr>\n                 <tr><td colspan="3"></td></tr>\n                 <tr>\n                  <td width="32%"></td>\n                  <td width="25%">ADDRESS:</td>\n                  <td width="43%">{address}</td>\n                 </tr>\n                 <tr><td colspan="3"></td></tr>\n                 <tr>\n                  <td width="32%"></td>\n                  <td width="25%">PROFESSION/<br />OCCUPATION:</td>\n                  <td width="43%">{occupation}</td>\n                 </tr>\n                 <tr><td colspan="3"></td></tr>\n                 <tr>\n                  <td width="32%"></td>\n                  <td width="25%">PLACE OF BIRTH:</td>\n                  <td width="43%">{place_of_birth}</td>\n                 </tr>\n                 <tr><td colspan="3"></td></tr>\n                 <tr>\n                  <td width="32%"></td>\n                  <td width="25%">DATE OF BIRTH:</td>\n                  <td width="43%">{date_of_birth}</td>\n                 </tr>\n                 <tr><td colspan="3"></td></tr>\n                 <tr>\n                  <td width="32%"></td>\n                  <td width="25%">SINGLE/MARRIED, etc.:</td>\n                  <td width="43%">{marital_status}</td>\n                 </tr>\n                 <tr><td colspan="3"></td></tr>\n                 <tr>\n                  <td width="32%"></td>\n                  <td width="25%">NAME OF SPOUSE:</td>\n                  <td width="43%">{name_of_spouse}</td>\n                 </tr>\n                </table>', '2018-02-23'),
	(26, 'system', 'Upgrade to OfficioSolo', 'Upgrade to Solo', 'support@officio.com.au', '{company email}', '', 'support@officio.com.au', '<table>     <tr>         <td>             <img src="{settings: images path}/default/officio_logo_with_bg.png" alt="logo" width="600" height="94" />         </td>     </tr>      <tr>      <td>       <table width="600" align="center" bgcolor="#b3bcbf" border="0" cellpadding="6" cellspacing="1">         <tbody>           <tr>             <td bgcolor="#ffffff">               <table width="100%" border="0" cellpadding="5" cellspacing="0">                 <tbody>                   <tr>                     <td style="font: 11px Arial,Helvetica,sans-serif; text-align: left;" bgcolor="#f0f0f0">                          <table width="100%" border="0" cellpadding="5">                           <tbody>                             <tr>                               <td>                                   <div style="font: 11px Arial,Helvetica,sans-serif;">Dear {admin first name} {admin last name},<br><br>Thank you for your order. Here are your order details:</div>                               </td>                             </tr>                           </tbody>                         </table>                        <table width="100%" border="1" cellpadding="6">                         <tbody>                           <tr>                             <td bgcolor="#ffffff">                               <table width="100%" border="0" cellpadding="0" cellspacing="0">                                 <tbody>                                   <tr>                                     <td style="font: 11px Arial,Helvetica,sans-serif;" nowrap="nowrap"><span style="color: #4F8CBC; font-weight: bold;">Upgrade to Solo - Prorated</span><br>                                         <strong>Licensee Name:</strong>&nbsp;&nbsp;{company name}                                     </td>                                   </tr>                                 