       <br>                          <table width="100%" bgcolor="#f0f0f0" border="0" cellpadding="3" cellspacing="0" style=\'background: url("{settings: images path}/default/officio_watermark.png") no-repeat center;\'>                             <tr>                                   <td style="font: 11px Arial,Helvetica,sans-serif;" width="40%"><strong>Description</strong></td>                                   <td style="font: 11px Arial,Helvetica,sans-serif;" align="center" width="20%"><strong>Qty</strong></td>                                   <td style="font: 11px Arial,Helvetica,sans-serif;" align="center" width="20%"><strong>Unit Price</strong></td>                                   <td style="font: 11px Arial,Helvetica,sans-serif;" align="right" width="20%"><strong>Amount</strong></td>                             </tr>                             <tr>                                   <td style="font: 11px Arial,Helvetica,sans-serif;"><span style="font-weight: bold;">Upgrade to Solo - Prorated</span>                                       <br/>Includes:<br>                                         - {invoice: free storage} Gb of space<br>                                         - {invoice: free users} user license(s)                                   </td>                                   <td style="font: 11px Arial,Helvetica,sans-serif;" align="center">{invoice: quantity}</td>                                   <td style="font: 11px Arial,Helvetica,sans-serif;" align="center">{invoice: currency} {invoice: subscription fee}</td>                                   <td style="font: 11px Arial,Helvetica,sans-serif;" align="right">{invoice: currency} {invoice: subscription fee}</td>                             </tr>                             <tr {invoice: hide if empty discount}>                                   <td style="font: 11px Arial,Helvetica,sans-serif;">Discount</td>                                   <td style="font: 11px Arial,Helvetica,sans-serif;" align="center">&nbsp;</td>                                   <td style="font: 11px Arial,Helvetica,sans-serif;" align="center">&nbsp;</td>                                   <td style="font: 11px Arial,Helvetica,sans-serif;" align="right">{invoice: currency} -{invoice: discount}</td>                             </tr>                             <tr>                                 <td style="font: 11px Arial,Helvetica,sans-serif; font-weight: bold;">Additional user license(s)</td>                                 <td style="font: 11px Arial,Helvetica,sans-serif;" align="center">{invoice: additional users}</td>                                 <td style="font: 11px Arial,Helvetica,sans-serif;" align="center">{invoice: currency} {invoice: price per user}</td>                                 <td style="font: 11px Arial,Helvetica,sans-serif;" align="right">{invoice: currency} {invoice: additional users fee}</td>                             </tr>                             <tr><td colspan="4"><hr></td></tr>                             <tr>                                   <td style="font: 11px Arial,Helvetica,sans-serif;">&nbsp;</td>                                   <td style="font: 11px Arial,Helvetica,sans-serif;" align="center">&nbsp;</td>                                   <td style="font: 11px Arial,Helvetica,sans-serif;" align="right">Sub Total</td>                                   <td style="font: 11px Arial,Helvetica,sans-serif;" align="right">{invoice: currency} {invoice: subtotal}</td>                             </tr>                             <tr>                                   <td colspan="3" style="font: 11px Arial,Helvetica,sans-serif;" align="right">GST</td>                                   <td style="font: 11px Arial,Helvetica,sans-serif;" align="right">{invoice: currency} {invoice: gst/hst fee}</td>                             </tr>                             <tr>                                   <td style="font: 11px Arial,Helvetica,sans-serif;">&nbsp;</td>                                   <td style="font: 11px Arial,Helvetica,sans-serif;" align="center">&nbsp;</td>                                   <td style="font: 11px Arial,Helvetica,sans-serif; font-weight: bold;" align="right">Total</td>                                   <td style="font: 11px Arial,Helvetica,sans-serif;" align="right">{invoice: currency} {invoice: total}</td>                             </tr>                             <tr>                                   <td style="font: 11px Arial,Helvetica,sans-serif;">&nbsp;</td>                                   <td style="font: 11px Arial,Helvetica,sans-serif;" align="center">&nbsp;</td>                                   <td style="font: 11px Arial,Helvetica,sans-serif; font-weight: bold;" align="right">Paid</td>                                   <td style="font: 11px Arial,Helvetica,sans-serif;" align="right">{invoice: currency} -{invoice: amount paid}</td>                             </tr>                             <tr>                               <td colspan="4" nowrap="nowrap" height="38">                                 <table width="100%" border="0">                                     <tr>                                       <td style="font: 11px Arial,Helvetica,sans-serif;" width="18%" nowrap="nowrap"><strong>Payment method:</strong></td>                                       <td style="font: 11px Arial,Helvetica,sans-serif;" width="82%">{invoice: payment method}</td>                                     </tr>                                 </table>                               </td>                             </tr>                         </table>                          <table width="100%" border="0" cellpadding="5">                           <tbody>                             <tr>                               <td style="font: 11px Arial,Helvetica,sans-serif;">                                   <p><strong>A couple of quick notes and reminders:</strong></p>                                   <ul>                                     <li><strong>Payment:</strong> Your credit card&nbsp; has been debited with {invoice: currency} {invoice: amount paid}, your card statement will list &quot;UNIQUES SOFTWARE&quot;.</li>                                     <li><strong>My account:</strong> You can always access your invoices by logging into Officio, and going to Admin | Company Details | Company Invoices. </li>                                   </ul>                                   <p>Thank you for your order. If we can do anything to enhance your experience with Officio, please do not hesitate to let us know.</p></td>                             </tr>                           </tbody>                         </table>                          <p>                     </td>                   </tr>                 </tbody>               </table>             </td>           </tr>         </tbody>       </table>     </td>   </tr> </table>', '2018-12-19'),
	(27, 'system', 'Certificate of Naturalisation (for HTML preview)', 'Certificate of Naturalisation (for HTML preview)', NULL, NULL, NULL, NULL, '<div style="font-size: 17px; border: 1px solid #ccc; padding: 10px 10px 40px 10px; margin: 5px 5px 30px 5px; background-color: white;">\n                <div style="float: right; margin: 10px 0;"><input type="text" name="con_number_{page_number}" size="30" value="{con_number}" /></div>\n                <table border="0" cellpadding="3" width="100%">\n                    <tr>\n                        <td width="75%" style="font-weight: bold;">COMMONWEALTH OF DOMINICA CITIZENSHIP ACT (Ch.1:10)</td>\n                        <td width="25%" align="right" style="font-weight: bold;">SECTION 8</td>\n                    </tr>\n                </table>\n                <h1 align="center" style="font-size: 22px; margin: 20px">CERTIFICATE OF NATURALISATION</h1>\n                <p style="text-indent: 30px; padding-bottom: 15px;">\n                    WHEREAS <i><b><input type="text" name="main_applicant_name_{page_number}" size="30" value="{main_applicant_name}"/></b></i> has applied to the Minister responsible for citizenship in the Government of Dominica for a certificate of naturalisation, alleging with respect to <input type="text" name="self_name_{page_number}" size="30" value="{self_name}"/> the particulars set out below, and has satisfied the Minister that\n                    the conditions laid down in the Constitution and in the Citizenship Act Chapter 1:10 for the grant of a certificate of naturalisation are fulfilled:\n                </p>\n                <p style="text-indent: 30px; padding-bottom: 15px;">\n                    Now, THEREFORE, the Minister, in exercise of the powers conferred upon him by the said Constitution and Act, grants to the said <i><b><input type="text" name="main_applicant_name_2_{page_number}" size="30" value="{main_applicant_name_2}"/></b></i> this Certificate of Naturalisation, and declares that upon taking the oath or affirmation of allegiance in the manner required by the Act shall be a citizen of Dominica as from the\n                    date of this certificate.\n                </p>\n                <p style="text-indent: 30px; padding-bottom: 75px;">In witness whereof I have hereto subscribed my name this ____ day of _________, ______.</p>\n            \n                <table border="0" cellpadding="3" width="100%">\n                    <tr>\n                        <td width="65%"></td>\n                        <td width="35%" style="font-style: italic; font-size: smaller;">.....................................................................<br/>MINISTER FOR JUSTICE, IMMIGRATION <br/>AND NATIONAL SECURITY</td>\n                    </tr>\n                </table>\n            \n                <p align="center" style="font-weight: bold; padding: 40px 0 10px;">Particulars relating to applicant</p>\n            \n                <table border="0" cellpadding="2" width="100%">\n                    <tr>\n                        <td width="37%" rowspan="7" style="text-align: center">{photo}<input type="hidden" name="photo_path_{page_number}" value="{photo_path}"/></td>\n                        <td width="30%" height="30px"><label for="main_applicant_name_3_{page_number}">FULL NAME:</label></td>\n                        <td width="33%" height="30px"><textarea id="main_applicant_name_3_{page_number}" name="main_applicant_name_3_{page_number}" cols="37" rows="2">{main_applicant_name_3}</textarea></td>\n                    </tr>\n                    <tr>\n                        <td width="30%" height="70px"><label for="address_{page_number}">ADDRESS:</label></td>\n                        <td width="33%" height="70px"><textarea id="address_{page_number}" name="address_{page_number}" cols="37" rows="5">{address}</textarea></td>\n                    </tr>\n                    <tr>\n                        <td width="30%" height="30px"><label for="occupation_{page_number}">PROFESSION/<br/>OCCUPATION:</label></td>\n                        <td width="33%" height="30px"><textarea id="occupation_{page_number}" name="occupation_{page_number}" cols="37" rows="2">{occupation}</textarea></td>\n                    </tr>\n                    <tr>\n                        <td width="30%"><label for="place_of_birth_{page_number}">PLACE OF BIRTH:</label></td>\n                        <td width="33%"><input type="text" id="place_of_birth_{page_number}" name="place_of_birth_{page_number}" value="{place_of_birth}" size="37"/></td>\n                    </tr>\n                    <tr>\n                        <td width="30%"><label for="date_of_birth_{page_number}">DATE OF BIRTH:</label></td>\n                        <td width="33%"><input type="text" id="date_of_birth_{page_number}" name="date_of_birth_{page_number}" value="{date_of_birth}" size="37"/></td>\n                    </tr>\n                    <tr>\n                        <td width="30%"><label for="marital_status_{page_number}">SINGLE/MARRIED, etc.:</label></td>\n                        <td width="33%"><input type="text" id="marital_status_{page_number}" name="marital_status_{page_number}" value="{marital_status}" size="37"/></td>\n                    </tr>\n                    <tr>\n                        <td width="30%" height="30px"><label for="name_of_spouse_{page_number}">NAME OF SPOUSE:</label></td>\n                        <td width="33%" height="30px"><textarea id="name_of_spouse_{page_number}" name="name_of_spouse_{page_number}" cols="37" rows="2">{name_of_spouse}</textarea></td>\n                    </tr>\n                </table>\n            </div>', '2019-01-15'),
	(28, 'system', 'Marketplace Prospect to Client Fee', 'Marketplace prospect to client conversion', 'support@officio.com.au', '', '', 'support@officio.com.au', '<table border="1" cellpadding="5" cellspacing="0">\r\n    <tbody>\r\n    <tr>\r\n        <td>BILL TO</td>\r\n    </tr>\r\n    <tr>\r\n        <td>{admin first name} {admin last name}<br>{company name}<br>{company address}<br>{company city} {company province/state} {company postal code/zip}<br>{company country}\r\n        </td>\r\n    </tr>\r\n    </tbody>\r\n</table><br><br><br>\r\n<table border="1" cellpadding="5" cellspacing="0">\r\n    <tbody>\r\n    <tr>\r\n        <td align="middle">INVOICE NO.</td>\r\n        <td align="middle">DATE</td>\r\n        <td align="middle">TERMS</td>\r\n    </tr>\r\n    <tr>\r\n        <td align="left">{invoice: number}</td>\r\n        <td align="middle">{invoice: date}</td>\r\n        <td><br></td>\r\n    </tr>\r\n    </tbody>\r\n</table><br><br>\r\n<table border="1" cellpadding="5" cellspacing="0">\r\n    <tbody>\r\n    <tr>\r\n        <td align="middle" width="50%">DESCRIPTION</td>\r\n        <td align="middle" width="20%">RATE</td>\r\n        <td align="middle" width="15%">QTY</td>\r\n        <td align="middle" width="15%">AMOUNT</td>\r\n    </tr>\r\n    <tr>\r\n        <td width="50%">Fee for the Marketplace prospect lead<br></td>\r\n        <td align="middle" width="20%">${company prospect: conversion rate}</td>\r\n        <td align="middle" width="15%">{company prospect: conversion quantity}</td>\r\n        <td align="right" width="15%">${invoice: subtotal}</td>\r\n    </tr>\r\n    <tr>\r\n        <td colspan="3" width="85%"><br></td>\r\n        <td align="right" width="15%"><b>${invoice: subtotal}</b></td>\r\n    </tr>\r\n    <tr>\r\n        <td colspan="4" width="100%"><br></td>\r\n    </tr>\r\n    <tr>\r\n        <td colspan="3" align="left" width="85%">GST/HST (Registration No. 896191244)</td>\r\n        <td align="right" width="15%">${invoice: gst/hst fee}</td>\r\n    </tr>\r\n    <tr>\r\n        <td colspan="4" width="100%"><br></td>\r\n    </tr>\r\n    <tr>\r\n        <td colspan="3" align="right" width="85%"><b>TOTAL</b></td>\r\n        <td align="right" width="15%"><b>${invoice: total}</b></td>\r\n    </tr>\r\n    </tbody>\r\n</table><br>\r\n<p></p>\r\n<center>\r\n    <b>Thank you for using our services. Please do not hesitate to contact us, if we can be of further assistance in the future.</b>\r\n</center>\r\n<p></p>', '2019-02-02'),
	(29, 'system', 'New Company Signup - Started', 'New Company Signup - Started', 'support@officio.ca', 'support@officio.ca', '', '', '<h1>New Company Signup - Started</h1>\n<div>Company name: {prospects: company}</div>\n<div>Company phone (W): {prospects: company}</div>\n<br>\n<h2>Admin User Details</h2>\n<div>First Name: {prospects: admin_first_name}</div>\n<div>Last Name: {prospects: admin_last_name}</div>\n<div>Email: {prospects: admin_email}</div>\n<div>Username: {prospects: admin_username}</div>\n<br>\n<h3>You should receive a second email confirmation after they have successfully paid for the subscription.</h3>', '2021-02-23'),
	(30, 'system', 'New Company Signup - Failed (Payment Successful)', 'New Company Signup - Failed (Payment Successful)', 'support@officio.ca', 'support@officio.ca', '', '', '<h1>New Company Signup - Failed (Payment Successful)</h1>\n<div>Company name: {prospects: company}</div>\n<div>Company phone (W): {prospects: company}</div>\n<br>\n<h2>Admin User Details</h2>\n<div>First Name: {prospects: admin_first_name}</div>\n<div>Last Name: {prospects: admin_last_name}</div>\n<div>Email: {prospects: admin_email}</div>\n<div>Username: {prospects: admin_username}</div>\n<br>\n', '2021-02-23');
INSERT INTO `templates` (`template_id`, `member_id`, `updated_by_id`, `folder_id`, `order`, `templates_for`, `templates_type`, `name`, `subject`, `from`, `cc`, `bcc`, `message`, `create_date`, `update_date`, `default`, `attachments_pdf`) VALUES
	(9287, 1, 1, 7174, 0, 'General', 'Email', 'Default Template', 'RE: Email Received', '', '', '', '<font face="tahoma, arial, helvetica, sans-serif" size="2">Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;</font><br><br><font face="tahoma, arial, helvetica, sans-serif" size="2">\nThank you for your email, we endeavour&nbsp;</font><font face="tahoma, arial, helvetica, sans-serif" size="2">to reply as soon as possible.</font><br><br><br><br><font face="tahoma, arial, helvetica, sans-serif" size="2">\nRegards,</font><br><font face="tahoma, arial, helvetica, sans-serif" size="2">\n&lt;%current_user_email_signature%&gt;</font>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'Y', 0),
	(9288, 1, 1, 7174, 0, 'Prospect', 'Email', 'Prospect Acknowledgement', 'RE: Query', '', '', '', 'Dear &lt;%prospect_first_name%&gt; &lt;%prospect_last_name%&gt;<p>Thank you for your query. We aim to respond to your query within &lt;&lt;Number of Business Days.&gt;&gt;</p><p>Meanwhile,please feel free to contact us on &lt;%company_phone_1%&gt; or Email us on &lt;%company_email%&gt;</p><p>Regards,</p><p></p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9289, 1, 1, 7174, 0, 'General', 'Email', 'Client Service Agreement', 'RE: Client Service Agreement', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>Thank you for considering &lt;%company_name%&gt;\'s services for your query. Please find attached a Client Service Agreement for your consideration. Also attached is a Consumer Guide on working with your migration agent.</p><p>You may contact us on &lt;%company_phone_1%&gt; or email us on &lt;%company_email%&gt; if you have any questions with regards to the attached client service agreement. Otherwise, please sign the agreement and return to us.</p><p>We look forward to working with you.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9290, 1, 1, 7174, 0, 'Welcome', 'Email', 'Welcome', 'Re: Welcome', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<div><br><p>I would like to welcome you to &lt;%company_name%&gt;.</p><p>Please note that your client ID is: &lt;%file_number%&gt;. Please use this reference number in all communications with us.</p><p>We are thrilled to have you as our client and are looking forwards to working with you. Your &lt;%visa_subclass%&gt; matter will be handled by &lt;%registered_migrant_agent%&gt; and &lt;%processing%&gt;.</p><p>You will receive further communications from us very soon. Meanwhile, please feel free to contact us on &lt;%company_phone_1%&gt; or Email us on &lt;%company_email%&gt; if you have any questions.</p><p>Once again, thank you for choosing our services.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p><p></p></div>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9291, 1, 1, 7174, 0, 'General', 'Email', 'User ID and Password Notification', 'RE: Your Client Portal Information', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p></p><p>Welcome to &lt;%company_name%&gt;\'s Client Portal.</p><p><br>We have created an account on our Client Portal for you. This portal allows you to view your profile, upload your documents, fill out your forms and get the latest updates on your file.</p><p></p><p>You can access this portal by clicking on the following link:</p><p></p><p><a href="http://secure.officio.com.au">http://secure.officio.com.au</a><br><br>Your log in details are as follows:<br><br>User name:- <b>&lt;%username%&gt;</b><br>Password:- <b>&lt;%password%&gt;</b></p><p>Please keep this information secured, and ensure that you log out from this portal after each visit.</p><p></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9292, 1, 1, 7174, 0, 'General', 'Email', 'Document Checklist', 'RE: Documents Request', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;<p>Please find attached Documents Checklist for your &lt;%visa_subclass%&gt; matter.</p><p>You may upload your documents using your Client Portal User ID and Password. You can access client portal through this link: <a href="http://secure.officio.com.au">http://secure.officio.com.au</a>&nbsp;</p><p>Alternatively, you may email your documents to &lt;%company_email%&gt; or post them to &lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_zip%&gt; &lt;%company_state%&gt; &lt;%company_country%&gt;</p><p>If you choose to upload or email your documents, please ensure they are fill colour scans, or certified copies of your originals. If you post your documents, please ensure that these are certified copies of your originals. Please do not send any original documents by post unless you have been specifically asked to do so. Please quote your Case Reference Number &lt;%file_number%&gt; if you email or post your documents.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or Email us on &lt;%company_email%&gt; if you have any questions.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9293, 1, 1, 7174, 0, 'Payment', 'Email', 'Receipt of Payment AUD', 'RE: Receipt of Payment', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>We acknowledge receipt of $&lt;%assign_deposit_amount%&gt;.</p><p>This amount will be kept in our Client Account and towards services completed. The following is a summary of your Client Account.</p><p>&lt;%aud_curr_trustac_summary_table%&gt;</p><p>Balance in Client Account: &lt;%trust_ac_balance_aud%&gt;</p><p>Thank you for your payment.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9294, 1, 1, 7174, 0, 'General', 'Email', 'Form 929 Change of Address', 'RE: Change of Address Form 929', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>Thank you for notifying us of your new address. Please find attached Form 929 to be signed by you.</p><p>Please upload your signed form on your Client Portal. To access client portal, click: <a href="http://secure.officio.com.au">http://secure.officio.com.au</a></p><p>Alternatively, you may return the signed form by &lt;%company_email%&gt; or by post on &lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_state%&gt; &lt;%company_zip%&gt; &lt;%company_country%&gt;.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by Email &lt;%company_email%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9295, 1, 1, 7174, 0, 'General', 'Email', 'Form 929 Change of Passport', 'RE: Form 929 Change of Passport', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>Thank you for notifying us of your new Passport Details. Please find attached Form 929 to be signed by you.</p><p>Please upload a colour scan of your new passport biopage (picture page) to your client portal along with the signed form 929. To access your client portal, click: <a href="http://secure.officio.com.au">http://secure.officio.com.au</a></p><p>You can also email us a colour scan of your passport and the form on &lt;%current_user_email%&gt;. Alternatively, you can post a certified copy of your new passport and signed form to your office address mentioned below.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9296, 1, 1, 7174, 0, 'General', 'Email', 'Form 956 Agent Appointment', 'RE: Form 956', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;<p>Your appointed Registered Migration Agent for your &lt;%visa_subclass%&gt;&gt; matter is &lt;%registered_migrant_agent%&gt;.</p><p>Please find attached Form 956 to be signed by you. Please check the contents to ensure they are correct, and sign the form.</p><p>Please upload the signed form on your client portal. You can access the client portal by clicking on: <a href="http://secure.officio.com.au">http://secure.officio.com.au</a></p><p>Alternatively, you may return signed form either by email it to &lt;%company_email%&gt; or by Post &lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_state%&gt; &lt;%company_zip%&gt; &lt;%company_country%&gt;.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by Email &lt;%company_email%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9297, 1, 1, 7174, 0, 'General', 'Email', 'Form 1022', 'RE: Form 1022', 'support@officio.com.au', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>Thank you for notifying changes in your circumstances.Please find attached Form 1022 to be signed by you and your dependents (if included in this application).</p><p>Please upload the signed form to your online client portal. To access your client portal click:&nbsp;<a href="http://secure.officio.com.au">http://secure.officio.com.au</a></p><p>Alternatively, you may return the signed form by emailing it to &lt;%registered_migrant_agent%&gt; or by post &lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_state%&gt; &lt;%company_zip%&gt; &lt;%company_country%&gt;</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by Email &lt;%company_email%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9298, 1, 1, 7174, 0, 'General', 'Email', 'Form 1005', 'RE: Bridging Visa A - Form 1005', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>Thank you for notifying us of your intentions to reinstate your Bridging Visa A. Please find attached Form 1005 to be signed by you and your dependents (if included in this application).</p><p>Please upload the signed form to your online client portal. To access the client portal, click:&nbsp;<a href="http://secure.officio.com.au">http://secure.officio.com.au</a></p><p>Alternatively, you may return signed form either by emailing it to &lt;%registered_migrant_agent%&gt; or by Post &lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_state%&gt; &lt;%company_zip%&gt; &lt;%company_country%&gt;.</p><p>You may also choose to take completed and signed form to your nearest Department of Immigration office.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by Email &lt;%company_email%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9299, 1, 1, 7174, 0, 'General', 'Email', 'Form 1006', 'RE: Bridging Visa B - Form 1006', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>Thank you for notifying us of your intention to obtain a Bridging Visa B. Please find attached Form 1006 to be signed by you and your dependents (if included in this application).</p><p>Please upload the signed form to your online client portal. To access client portal, click:&nbsp;<a href="http://secure.officio.com.au">http://secure.officio.com.au</a></p><p>Alternatively, you may return the signed form either by emailing it to &lt;%registered_migrant_agent%&gt; or by Post &lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_state%&gt; &lt;%company_zip%&gt; &lt;%company_country%&gt;.</p><p>You may also choose to take completed and signed form to your nearest Department of Immigration office along with visa application fee.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by Email &lt;%company_email%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9300, 1, 1, 7174, 0, 'General', 'Email', 'Medical Date (Booking)', 'RE: Your Health Assessment Details', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>We have booked your Medicals. Following are the details:</p><p>Medical Date: &lt;%medical_date%&gt;</p><p>X-Ray Date: &lt;%medical_xray_date%&gt;</p><p>Medical Reference Number: &lt;%medical_reference_number%&gt;</p><p>TRN: &lt;%medical_TRN%&gt;</p><p>HAP ID: &lt;%HAP_ID%&gt;</p><p>Location: &lt;%medical_exam_location%&gt;</p><p>Please contact us on &lt;%company_phone_1%&gt; or &lt;%company_email%&gt; if you have any questions.</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9301, 1, 1, 7174, 0, 'General', 'Email', 'Police Clearance (Character)', 'RE: Your Police Clearance 1', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;,<p>We have applied for your police clearance for &lt;%1_country_of_PCC%&gt; on &lt;%1_PCC_application_date%&gt;.</p><p>Your Reference Number for this application is &lt;%1_PCC_reference_number%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9302, 1, 1, 7174, 0, 'General', 'Email', 'General Follow Up', 'RE: Follow Up', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<div><br><p>This email is to follow up from our recent conversation.</p><p>Please respond to us as soon as possible either by calling on &lt;%company_phone_1%&gt; or by emailing us on &lt;%company_email%&gt;.</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p></div>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9303, 1, 1, 7174, 0, 'General', 'Email', 'Draft Application', 'RE: Your Draft Application', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p><br></p><p>We have completed drafting the application for your &lt;%visa_subclass%&gt; matter.</p><p>Please log in to your client portal Click:&nbsp;<a href="http://secure.officio.com.au">http://secure.officio.com.au</a>&nbsp;to access the draft of your application.</p><p>It is important that you review the information on your application. Please correct any information on this form if you believe it is not correct or complete, and inform us of any changes. Please confirm by email if the draft of application is correct.</p><p>Remember to save the form after you have updated any fields. If you are not able to make changes to the form online, you can also print and hand-write your changes on the form. Once completed, you may upload the scanned copy of your draft application to your client portal.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by email on &lt;%company_email%&gt; if you have any difficulties.</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9304, 1, 1, 7174, 0, 'General', 'Email', 'Letter to Department of Immigration - Application Letter', 'RE: Applicaction', '', '', '', 'To,<p>&lt;%immigration_office%&gt;</p><p>Date: &lt;%today_date%&gt;</p><p>Subject: &lt;%visa_subclass%&gt; Application for Client: &lt;%given_names%&gt; &lt;%family_name%&gt;; Date of Birth: &lt;%DOB%&gt;.</p><p><br></p><p>Dear Sir/Madam,</p><p><br></p><p>Please find herewith &lt;%visa_subclass%&gt; application of our client: &lt;%given_names%&gt; &lt;%family_name%&gt;; Date of Birth: &lt;%DOB%&gt;.</p><p>Following documents are attached:</p><p><font color="#ff0000"><b>&lt;&lt;Insert list of Documents Here&gt;&gt;</b></font></p><p>Please feel free to contact us if you require any further information for this application.</p><p>our contact details:</p><p>&lt;%company_name%&gt;</p><p>&lt;%company_address%&gt; &lt;%company_city%&gt;</p><p>&lt;%company_state%&gt; - &lt;%company_zip%&gt;, &lt;%company_country%&gt;</p><p>Telephone: &lt;%company_phone_1%&gt;</p><p>Fax: &lt;%company_fax%&gt;</p><p>Email: &lt;%company_email%&gt;</p><p><br></p><p>Thanks and Regards,</p><p>&lt;%registered_migrant_agent%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9305, 1, 1, 7174, 0, 'General', 'Email', 'Declaration of Other Names', 'RE: Declaration of Other Names - Statutory Declaration', '', '', '', 'Commonwealth of Australia<p align="center">STATUTORY DECLARATION</p><p align="center"><i>StatutoryDeclarations Act 1959</i></p><table border="0" cellspacing="0" cellpadding="0" width="100%"><tbody><tr><td width="14%" valign="top"><p></p><p><i>1 Insert the name, address and occupation of person making the declaration</i></p></td><td width="85%" valign="top"><p></p><p>I,<sup>1</sup></p><p><sup>&lt;%given_names%&gt; &lt;%family_name%&gt; Date of Birth: &nbsp;&lt;%DOB%&gt; residing at &lt;%address_1%&gt; &lt;%address_2%&gt; &lt;%city%&gt; &lt;%state%&gt; &lt;%zip_code%&gt; &lt;%country%&gt;;</sup></p><p></p><p></p><p></p><p>make the following declaration under the<i>Statutory Declarations Act1959:</i><b></b></p></td></tr><tr><td width="14%" valign="top"><p></p><p><i>2 Set out matter declared to in numbered paragraphs</i></p></td><td width="85%" valign="top"><p></p><p><sup>2</sup></p><p><font size="2">I am also known by the following names:</font></p><p><font size="2"><br></font></p><p><font size="2">1. &lt;%other_names%&gt;</font></p><p><sup><br></sup></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p>I understand that a person who intentionally makes a false statement in a statutory declaration is guilty of an offence under section 11 of the<i>Statutory Declarations Act 1959</i>,<i></i>and I believe that the statements in this declaration are true in every particular.</p><p></p></td></tr><tr><td width="14%" valign="top"><p><i>3 Signature of person making the declaration</i></p></td><td width="85%" valign="top"><p><sup>3</sup></p><p></p><p><sup></sup></p></td></tr><tr><td width="14%" valign="top"><p><i>4 Place</i></p><p><i>5 Day</i></p><p><i>6 Month</i><i>and year</i></p></td><td width="85%" valign="top"><p>Declared at<sup>4</sup>on<sup>5</sup>of<sup>6</sup></p><p></p><p>Before me,</p><p><sup></sup></p></td></tr><tr><td width="14%" valign="top"><p><i>7 Signature of person before whom the declaration is made (see over)</i></p><p><i></i></p></td><td width="85%" valign="top"><p><sup>7</sup></p><p></p><p><sup></sup></p></td></tr><tr><td width="14%" valign="top"><p><i>8 Full name, qualification and address of person before whom the declaration is made (in printed letters)</i></p></td><td width="85%" valign="top"><p><sup>8</sup></p><p></p><p></p><p></p><p><sup></sup></p></td></tr></tbody></table><p><i>Note 1</i>Aperson who intentionally makes a false statement in a statutory declaration isguilty of an offence, the punishment for which is imprisonment for a term of 4years see section 11 of the<i>StatutoryDeclarations Act 1959</i>.</p><p><i>Note 2</i>Chapter2 of the<i>Criminal Code</i>applies to alloffences against the<i>StatutoryDeclarations Act 1959</i> see section 5A of the<i>Statutory Declarations Act 1959</i>.</p><p><b>A statutory declaration under the<i>Statutory Declarations Act 1959</i>may be made before</b></p><p>(1) a person who is currently licensed or registered under a law to practise in one of thefollowing occupations:</p><p>Chiropractor Dentist Legalpractitioner</p><p>Medical practitioner Nurse Optometrist</p><p>Patent attorney Pharmacist Physiotherapist</p><p>Psychologist Trademarks attorney Veterinarysurgeon</p><p>(2) a person who is enrolled on the roll of the Supreme Court of a State or Territory, orthe High Court of Australia, as a legal practitioner (however described); or</p><p>(3) a person who is in the following list:</p><p>Agent of the Australian Postal Corporation who isin charge of an office supplying postal services to the public</p><p>Australian Consular Officer or AustralianDiplomatic Officer (within the meaning of the<i>Consular Fees Act 1955</i>)</p><p>Bailiff</p><p>Bank officer with 5 or more continuous years ofservice</p><p>Building society officer with 5 or more years ofcontinuous service</p><p>Chief executive officer of a Commonwealth court</p><p>Clerk of a court</p><p>Commissioner for Affidavits</p><p>Commissioner for Declarations</p><p>Credit union officer with 5 or more years ofcontinuous service</p><p>Employee of the Australian Trade Commission who is:</p><p>(a) in a country or place outside Australia; and</p><p>(b) authorised under paragraph 3 (d) of the<i>ConsularFees Act 1955</i>; and</p><p>(c) exercising his or her function in that place</p><p>Employee of the Commonwealth who is:</p><p>(a) in a country or place outside Australia; and</p><p>(b) authorised under paragraph 3 (c) of the<i>ConsularFees Act 1955</i>; and</p><p>(c) exercising his or her function in that place</p><p>Fellow of the National Tax Accountants Association</p><p>Finance company officer with 5 or more years ofcontinuous service</p><p>Holder of a statutory office not specified inanother item in this list</p><p>Judge of a court</p><p>Justice of the Peace</p><p>Magistrate</p><p>Marriage celebrant registered under Subdivision Cof Division 1 of Part IV of the<i>Marriage Act 1961</i></p><p>Master of a court</p><p>Member of Chartered Secretaries Australia</p><p>Member of Engineers Australia, other than at thegrade of student</p><p>Member of the Association of Taxation andManagement Accountants</p><p>Member of the Australasian Institute of Miningand Metallurgy</p><p>Member of the Australian Defence Force who is:</p><p>(a) an officer; or</p><p>(b) a non-commissioned officer within the meaningof the<i>Defence Force Discipline Act 1982</i>with 5 or more years ofcontinuous service; or</p><p>(c) a warrant officer within the meaning of thatAct</p><p>Member of the Institute of Chartered Accountants inAustralia, the Australian Society of Certified Practising Accountants or theNational Institute of Accountants</p><p>Member of:</p><p>(a) the Parliament of the Commonwealth; or</p><p>(b) the Parliament of a State; or</p><p>(c) a Territory legislature; or</p><p>(d) a local government authority of a State orTerritory</p><p>Minister of religion registered under Subdivision Aof Division 1 of Part IV of the<i>Marriage Act 1961</i></p><p>Notary public</p><p>Permanent employee of the Australian PostalCorporation with 5 or more years of continuous service who is employed in anoffice supplying postal services to the public</p><p>Permanent employee of:</p><p>(a) the Commonwealth or a Commonwealth authority;or</p><p>(b) a State or Territory or a State or Territoryauthority; or</p><p>(c) a local government authority;</p><p>with 5 or more years of continuous service who isnot specified in another item in this list</p><p>Person before whom a statutory declaration may bemade under the law of the State or Territory in which the declaration is made</p><p>Police officer</p><p>Registrar, or Deputy Registrar, of a court</p><p>Senior Executive Service employee of:</p><p>(a) the Commonwealth or a Commonwealth authority;or</p><p>(b) a State or Territory or a State or Territoryauthority</p><p>Sheriff</p><p>Sheriffs officer</p><p>Teacher employed on a full-time basis at a schoolor tertiary education institution</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9306, 1, 1, 7174, 0, 'General', 'Email', 'File Closed', 'Re: File Closed', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>This is to notify you that your file for &lt;%visa_subclass%&gt; matter is now closed. You will receive a statement of services from us soon.</p><p>Any original documents submitted will be returned to you to your last known address. We request you to notify us if you have changed your current address from: &lt;%address_1%&gt; &lt;%address_2%&gt; &lt;%city%&gt; &lt;%state%&gt; &lt;%zip_code%&gt; &lt;%country%&gt;.</p><p>Your client portal access will be disabled.</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9307, 1, 1, 7174, 0, 'General', 'Email', 'Documents Request', 'RE: Documents Request', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>The Department of Immigration has started processing your application and your case officer has requested the following documents:</p><p>&lt;%miss_docs_description%&gt;</p><p>We request you to upload these documents to your client portal as soon as possible.</p><p>Alternatively, you may email these documents to your Registered Migration Agent on &lt;%company_email%&gt;. You may also post these documents to - &lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_state%&gt; &lt;%company_zip%&gt; &lt;%company_country%&gt;.</p><p>Please note that the last day to submit these documents to your case officer is &lt;&lt;Insert Date&gt;&gt;.</p><p>You may contact us on &lt;%company_phone_1%&gt; or email us on &lt;%company_email%&gt; if you have any questions.</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9308, 1, 1, 7174, 0, 'General', 'Email', 'Letter to the Department - Post Lodgement', 'RE: Letter to the Department of Immigration', '', '', '', 'To,<p>&lt;%immigration_office%&gt;</p><p>Date: &lt;%today_date%&gt;</p><p><br></p><p>Subject: &lt;%visa_subclass%&gt; Application: File Number: &lt;%file_number%&gt;; TRN: &lt;%visa_application_TRN%&gt;; File Number: &lt;%visa_application_file_number%&gt;; &lt;%given_names%&gt; &lt;%family_name%&gt; Date of Birth: &lt;%DOB%&gt;</p><p><br></p><p>Dear Sir/Madam,</p><p>Please find attached Documents as requested for this client:</p><p>&lt;%miss_docs_description%&gt;</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by sending an email to &lt;%company_email%&gt; if you require any further documents or information to finalise our client\'s application.</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9309, 1, 1, 7174, 0, 'General', 'Email', 'Statement of Service', 'RE: Statement of Services', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p><br></p><p>Please find below Statement of Services with regards to your &lt;%visa_subclass%&gt; matter.</p><p>&lt;%aud_curr_fin_transaction_table%&gt;</p><p>Please feel free to contact us if you have any questions,</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9310, 1, 1, 7174, 0, 'General', 'Email', 'Withdrawal Template Client Request', 'RE: Withdrawal of Application', '', '', '', 'From: &lt;%given_names%&gt; &lt;%family_name%&gt;<br>Date: &lt;%today_date%&gt;<p>Subject: Withdrawal of &lt;%visa_subclass%&gt; Application</p><p><br></p><p>I, &lt;%given_names%&gt; &lt;%family_name%&gt;; Date of Birth &lt;%DOB%&gt; residing at &lt;%address_1%&gt; &lt;%address_2%&gt; &lt;%city%&gt; &lt;%state%&gt; &lt;%zip_code%&gt; &lt;%country%&gt;; would like to withdraw my &lt;%visa_subclass%&gt; Application.</p><p><br></p><p>Below are the details of my application:</p><p><br></p><p>Date of Application: &lt;%visa_application_date%&gt;</p><p>File Number: &lt;%visa_application_file_number%&gt;</p><p>TRN: &lt;%visa_application_TRN%&gt;</p><p>Visa Subclass: &lt;%visa_subclass%&gt;</p><p><br></p><p>Dependents Included in the Application (If Any):</p><p><br></p><p>I understand that no further action will be taken once the application has been withdrawn. I also, understand that I may not be eligible for any refund.</p><p><br></p><p>Yours Sincerely,</p><p>&lt;%given_names%&gt; &lt;%family_name%&gt;</p><p><br></p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9311, 1, 1, 7174, 0, 'General', 'Email', 'Withdrawal of Application Agent Request', 'RE: Withdrawal of Application', '', '', '', 'To,<p>The Department of Immigration and Border Protection,</p><p>&lt;%immigration_office%&gt;</p><p>Date: &lt;%today_date%&gt;</p><p>Subject: Withdrawal of &lt;%visa_subclass%&gt; Application of our Client: &lt;%given_names%&gt; &lt;%family_name%&gt;; Date of Birth: &lt;%DOB%&gt;; File Number &lt;%visa_application_file_number%&gt;; TRN &lt;%visa_application_TRN%&gt;; Application ID &lt;%visa_application_ID%&gt;.</p><p><br></p><p>Dear Sir/Madam,</p><p><br></p><p>Our above mentioned client has instructed us to withdraw their &lt;%visa_subclass%&gt; Application.</p><p><br></p><p>Dependents included in the Application:</p><p><br></p><p><b>Details of Application:</b></p><p>Date of Application: &lt;%visa_application_date%&gt;</p><p>TRN: &lt;%visa_application_TRN%&gt;</p><p>File Number: &lt;%visa_application_file_number%&gt;</p><p>Application ID: &lt;%visa_application_ID%&gt;</p><p>Visa Subclass: &lt;%visa_subclass%&gt;</p><p><br></p><p>Please see attached authorisation from client to withdraw this application.</p><p><br></p><p>Please feel free to contact us if you have any questions:</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9312, 1, 1, 7174, 0, 'General', 'Email', 'Confirmation of Withdrawal', 'RE: Confirmation of Withdrawal of Application', '', '', '', '<font face="tahoma, arial, helvetica, sans-serif">Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;</font><p>We refer to our conversation with regards to withdrawal of your &lt;%visa_subclass%&gt; Application. You have advised us that you would like to withdraw the above application which is under assessment as of today.</p><p>Please note that no further action will be taken on this application following its withdrawal. Please confirm this in writing so that we can communicate accordingly with the Department of Immigration.</p><p style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;">Please feel free to contact us should you have any questions.</p><p>Regards,</p><p style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;">&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9313, 1, 1, 7174, 0, 'General', 'Email', 'Notification of Grant', 'RE: Notification of Grant', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>We are pleased to inform you that your &lt;%visa_subclass%&gt; Application has been approved.</p><p>Your Visa Approval Date is: &lt;%visa_outcome_date%&gt;</p><p>Your Visa Expiry Date is: &lt;%visa_expiry_date%&gt;</p><p>Your Visa Grant Number is: &lt;%visa_number%&gt;</p><p>Please log in to your client portal to find a copy of your approval letter. To access your client portal click: <a href="http://secure.officio.com.au">http://secure.officio.com.au</a></p><p>We have attached a copy of the approval letter with this email. It contains important information including the validity and conditions of your visa.</p><p>Congratulations, and please feel free to contact us if you have any questions.</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9314, 1, 1, 7174, 0, 'General', 'Email', 'Notification of Refusal of Application', 'RE: Notification of Refusal', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>We regretfully inform you that your &lt;%visa_subclass%&gt; application has been refused.</p><p>Please log in to your client portal to access a copy of your Refusal Notification. To access your client portal click: <a href="http://secure.officio.com.au">http://secure.officio.com.au</a></p><p>A copy of the Notification is attached to this email.</p><p>Please note that you may have review rights with respect to this decision. Please contact us as soon as possible if you would like to discuss your review rights.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9315, 1, 1, 7174, 0, 'General', 'Email', 'Receipt of Documents', 'RE: Receipt of Documents', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>Thank you for providing requested documents.</p><p>We acknowledge receipt of the following documents:</p><p><font color="#ff0000"><b>&lt;&lt;List Documents&gt;&gt;</b></font></p><p>Following Documents are still pending for your &lt;%visa_subclass%&gt; matter:</p><p>&lt;%miss_docs_description%&gt;</p><p>Please upload documents to your online Client Portal. To access your client portal, click: <a href="http://secure.officio.com.au">http://secure.officio.com.au</a> Alternatively, you may choose to email these documents to &lt;%registered_migrant_agent%&gt;.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by Email &lt;%company_email%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9316, 1, 1, 7174, 0, 'General', 'Email', 'Application Lodged', 'RE: Application Lodged', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p></p><p>We are pleased to inform you that your &lt;%visa_subclass%&gt; application has been lodged. Please find below details of your application:</p><p></p><p>Application Date: &lt;%visa_application_date%&gt;</p><p>TRN: &lt;%visa_application_TRN%&gt;</p><p>File Number: &lt;%visa_application_file_number%&gt;</p><p>Application ID: &lt;%visa_application_ID%&gt;</p><p></p><p>You may find a copy of your application on your client portal. To access your client portal click: <a href="http://secure.officio.com.au">http://secure.officio.com.au</a></p><p></p><p>We will post an update on your portal as soon as we receive any information from the Department of Immigration.</p><p></p><p>Meanwhile, please feel free to contact on&lt;%company_phone_1%&gt; or by emailing on &lt;%company_email%&gt;.</p><p></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9317, 1, 1, 7174, 0, 'General', 'Email', 'Fax Template', 'RE: Fax', '', '', '', '<font size="2">Fax</font><p></p><p></p><table border="1" cellspacing="0" cellpadding="0" width="100%"><tbody><tr><td width="8%"><p>To:</p></td><td width="40%"><p></p></td><td width="8%"><p>From:</p></td><td width="41%"><p>&lt;%company_name%&gt;</p></td></tr><tr><td width="8%"><p>Fax:</p></td><td width="40%"><p></p></td><td width="8%"><p>Pages:</p></td><td width="41%"><p></p></td></tr><tr><td width="8%"><p>Phone:</p></td><td width="40%"><p></p></td><td width="8%"><p>Date:</p></td><td width="41%"><p>&lt;%today_date%&gt;</p></td></tr><tr><td width="8%"><p>Re:</p></td><td width="40%"><p>&lt;%given_names%&gt; &lt;%family_name%&gt;&nbsp;</p></td><td width="8%"><p>Ref:</p></td><td width="41%"><p>&lt;%file_number%&gt;</p></td></tr></tbody></table><p></p><p><br></p><p><br></p><p><br></p><p></p><br><p><font size="2">&lt;%current_user_email_signature%&gt;</font></p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9318, 1, 1, 7174, 0, 'General', 'Email', 'Form 956 Agent End Appointment', 'RE: End Of Appointment Form 956', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>You have instructed us to end our appointment as your Registered Migration Agent for your &lt;%visa_subclass%&gt; matter.</p><p>Please find attached Form 956 to be signed by you.</p><p>Please upload this form on your client portal. To access your client portal, click: <a href="http://secure.officio.com.au">http://secure.officio.com.au</a></p><p>Alternatively, you may return signed form either by emailing it to &lt;%registered_migrant_agent%&gt; or by Post&lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_state%&gt; &lt;%company_zip%&gt; &lt;%company_country%&gt;</p><p>Please forward your new contact details to The Department of Immigration to receive further correspondence for your matter. &lt;%agent%&gt; will not be able to correspond with regards to the above mentioned matter you once this form is submitted.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by Email &lt;%company_email%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9319, 1, 1, 7174, 0, 'General', 'Email', 'Form 1023', 'RE: Form 1023', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>Please find attached Form 1023 to be signed by you and your dependents (if included in this application).</p><p>Please upload the signed form to your online client portal. To access your client portal, click: <a href="http://secure.officio.com.au">http://secure.officio.com.au</a></p><p>Alternatively, you may return signed form either by email it to &lt;%registered_migrant_agent%&gt; or by Post &lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_state%&gt; &lt;%company_zip%&gt; &lt;%company_country%&gt;.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by Email &lt;%company_email%&gt;.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9320, 1, 1, 7174, 0, 'General', 'Email', 'Default Email', 'RE: Email Received', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<br><br>Thank you for your email.<br><br><br><br>Regards,<br>&lt;%current_user_email_signature%&gt;', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9321, 1, 1, 7174, 0, 'General', 'Email', 'Police Clearance 2', 'RE: Your Police Clearance 2', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;,<p>We have applied for your police clearance for &lt;%2_country_of_PCC%&gt; on &lt;%2_PCC_application_date%&gt;.</p><p>Your Reference Number for this application is &lt;%2_PCC_reference_number%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p><p><br></p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9322, 1, 1, 7174, 0, 'General', 'Email', 'Police Clearance 3', 'RE: Your Police Clearance 3', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;,<p>We have applied for your police clearance for &lt;%3_country_of_PCC%&gt; on &lt;%3_PCC_application_date%&gt;.</p><p>Your Reference Number for this application is &lt;%3_PCC_reference_number%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p><p><br></p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9323, 1, 1, 7174, 0, 'Payment', 'Email', 'Receipt of Payment - Non AUD', 'RE: Receipt of Payment', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>We acknowledge receipt of $&lt;%assign_deposit_amount%&gt;.</p><p>This amount will be kept in our Client/Trust Account and will be allocated towards services provided. The following is a summary of your Client Account.</p><p>&lt;%non_aud_curr_fin_transaction_table%&gt;</p><p>Balance: &lt;%trust_ac_balance_non_aud%&gt;</p><p>Thank you for your payment.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9324, 1, 1, 7174, 0, 'General', 'Email', 'Cessation of Employment', 'RE: Cessation of Employment', '', '', '', 'Dear Sir/Madam<p></p><p><b>VisaTransaction Reference Number (TRN):</b> &lt;%visa_application_TRN%&gt;<br><b>Visa Application ID:</b> &lt;%visa_application_ID%&gt;<br><b>Name of Approved Visa Holder:</b> &lt;%given_names%&gt; &lt;%family_name%&gt;<br><b>Passport Number:</b> &lt;%passport_number%&gt;<br><b>Visa Expiry:</b> &lt;%visa_expiry_date%&gt;<br><b>Name of Sponsor:</b> &lt;%link_to_employer_case%&gt;<br><b>Sponsorship/Agreement Application ID: </b>&lt;%sponsorship_agreement_number%&gt;</p><p></p><p>We wish to advise that &lt;%given_names%&gt; has ceased work with the sponsoring employer as of &lt;%nomination_termination_date%&gt;. </p><p></p><p>&lt;%given_names%&gt; can be contacted at the following:</p><p></p><p>Residential/postal address: &lt;%address_1%&gt; &lt;%address_2%&gt; &lt;%city%&gt; &lt;%state%&gt; &lt;%zip_code%&gt; &lt;%country%&gt;</p><p>Email: &lt;%email%&gt;</p><p>Phone: &lt;%phone_main%&gt;</p><p></p><p>Please do not hesitate to contact me if you require any further information.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
	(9410, 109721, 109721, 7387, 0, 'General', 'Email', 'Default Template', 'RE: Email Received', '', '', '', '<font face="tahoma, arial, helvetica, sans-serif" size="2">Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;</font><br><br><font face="tahoma, arial, helvetica, sans-serif" size="2">\nThank you for your email, we endeavour&nbsp;</font><font face="tahoma, arial, helvetica, sans-serif" size="2">to reply as soon as possible.</font><br><br><br><br><font face="tahoma, arial, helvetica, sans-serif" size="2">\nRegards,</font><br><font face="tahoma, arial, helvetica, sans-serif" size="2">\n&lt;%current_user_email_signature%&gt;</font>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9411, 109721, 109721, 7224, 0, 'Prospect', 'Email', 'Prospect Acknowledgement', 'RE: Query', '', '', '', 'Dear &lt;%prospect_first_name%&gt; &lt;%prospect_last_name%&gt;<p>Thank you for your query. We aim to respond to your query within &lt;&lt;Number of Business Days.&gt;&gt;</p><p>Meanwhile,please feel free to contact us on &lt;%company_phone_1%&gt; or Email us on &lt;%company_email%&gt;</p><p>Regards,</p><p></p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9413, 109721, 109721, 7224, 0, 'Welcome', 'Email', 'Welcome', 'Re: Welcome', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<div><br><p>I would like to welcome you to &lt;%company_name%&gt;.</p><p>Please note that your client ID is: &lt;%file_number%&gt;. Please use this reference number in all communications with us.</p><p>We are thrilled to have you as our client and are looking forwards to working with you. Your &lt;%visa_subclass%&gt; matter will be handled by &lt;%registered_migrant_agent%&gt; and &lt;%processing%&gt;.</p><p>You will receive further communications from us very soon. Meanwhile, please feel free to contact us on &lt;%company_phone_1%&gt; or Email us on &lt;%company_email%&gt; if you have any questions.</p><p>Once again, thank you for choosing our services.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p><p></p></div>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9414, 109721, 109721, 7224, 0, 'General', 'Email', 'User ID and Password Notification', 'RE: Your Client Portal Information', '', '', '', '<div>Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;\n<p>Welcome to &lt;%company_name%&gt;&#39;s Client Portal.</p>\n\n<p>We have created an account on our Client Portal for you. This portal allows you to view your profile, upload your documents, fill out your forms and get the latest updates on your file.</p>\n\n<p>You can access this portal by clicking on the following link:</p>\n\n<p><a href="http://secure.officio.com.au">http://secure.officio.com.au</a><br />\n<br />\nYour log in details are as follows:<br />\n<br />\nUser name:- <strong>&lt;%username%&gt;</strong><br />\nPassword:- <strong>&lt;%password%&gt;</strong></p>\n\n<p>Once you have logged in, please click on the forms section where we have assigned a questionnaire for you which can help us completing your visa application. To open the questionnaire, simply double-click on it. You can start completing the questionnaire. To save typed information, click on the blue &quot;Save to Officio&quot; button. You can always revisit the questionnaire to fully complete it at any time. Once you have fully completed the questionnaire, click on&nbsp;the &quot;complete&quot; button.</p>\n\n<p>A notification will be sent to&nbsp;&lt;%registered_migrant_agent%&gt; as soon as you have completed the questionnaire.</p>\n\n<p>You can also choose to upload your application related documents using this client portal. To upload documents, simply click on the Documents tab, select the folder and then click on upload. You can upload as many files as you like. The maximum file size allowed is 15 MB per file.</p>\n\n<p>A notification will be sent to&nbsp;&lt;%registered_migrant_agent%&gt; as soon as you upload documents.</p>\n\n<p>Please keep this information secured, and ensure that you log out from this portal after each visit.</p>\n\n<p>If you have questions, please feel free to contact us on&nbsp;&lt;%current_user_email%&gt;, or call us on&nbsp;&lt;%company_phone_1%&gt;.</p>\n\n<p>Regards,</p>\n\n<p>&lt;%current_user_email_signature%&gt;</p>\n</div>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9416, 109721, 109721, 7224, 0, 'Payment', 'Email', 'Receipt of Payment AUD', 'RE: Receipt of Payment', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>We acknowledge receipt of $&lt;%assign_deposit_amount%&gt;.</p><p>This amount will be kept in our Client Account and towards services completed. The following is a summary of your Client Account.</p><p>&lt;%aud_curr_trustac_summary_table%&gt;</p><p>Balance in Client Account: &lt;%trust_ac_balance_aud%&gt;</p><p>Thank you for your payment.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9417, 109721, 109721, 7224, 0, 'General', 'Email', 'Form 929 Change of Address', 'RE: Change of Address Form 929', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>Thank you for notifying us of your new address. Please find attached Form 929 to be signed by you.</p><p>Please upload your signed form on your Client Portal. To access client portal, click: <a href="http://secure.officio.com.au">http://secure.officio.com.au</a></p><p>Alternatively, you may return the signed form by &lt;%company_email%&gt; or by post on &lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_state%&gt; &lt;%company_zip%&gt; &lt;%company_country%&gt;.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by Email &lt;%company_email%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9418, 109721, 109721, 7224, 0, 'General', 'Email', 'Form 929 Change of Passport', 'RE: Form 929 Change of Passport', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>Thank you for notifying us of your new Passport Details. Please find attached Form 929 to be signed by you.</p><p>Please upload a colour scan of your new passport biopage (picture page) to your client portal along with the signed form 929. To access your client portal, click: <a href="http://secure.officio.com.au">http://secure.officio.com.au</a></p><p>You can also email us a colour scan of your passport and the form on &lt;%current_user_email%&gt;. Alternatively, you can post a certified copy of your new passport and signed form to your office address mentioned below.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9419, 109721, 109721, 7224, 0, 'General', 'Email', 'Form 956 Agent Appointment', 'RE: Form 956', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;<p>Your appointed Registered Migration Agent for your &lt;%visa_subclass%&gt;&gt; matter is &lt;%registered_migrant_agent%&gt;.</p><p>Please find attached Form 956 to be signed by you. Please check the contents to ensure they are correct, and sign the form.</p><p>Please upload the signed form on your client portal. You can access the client portal by clicking on: <a href="http://secure.officio.com.au">http://secure.officio.com.au</a></p><p>Alternatively, you may return signed form either by email it to &lt;%company_email%&gt; or by Post &lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_state%&gt; &lt;%company_zip%&gt; &lt;%company_country%&gt;.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by Email &lt;%company_email%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9420, 109721, 109721, 7224, 0, 'General', 'Email', 'Form 1022', 'RE: Form 1022', 'support@officio.com.au', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>Thank you for notifying changes in your circumstances.Please find attached Form 1022 to be signed by you and your dependents (if included in this application).</p><p>Please upload the signed form to your online client portal. To access your client portal click:&nbsp;<a href="http://secure.officio.com.au">http://secure.officio.com.au</a></p><p>Alternatively, you may return the signed form by emailing it to &lt;%registered_migrant_agent%&gt; or by post &lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_state%&gt; &lt;%company_zip%&gt; &lt;%company_country%&gt;</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by Email &lt;%company_email%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9421, 109721, 109721, 7224, 0, 'General', 'Email', 'Form 1005', 'RE: Bridging Visa A - Form 1005', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>Thank you for notifying us of your intentions to reinstate your Bridging Visa A. Please find attached Form 1005 to be signed by you and your dependents (if included in this application).</p><p>Please upload the signed form to your online client portal. To access the client portal, click:&nbsp;<a href="http://secure.officio.com.au">http://secure.officio.com.au</a></p><p>Alternatively, you may return signed form either by emailing it to &lt;%registered_migrant_agent%&gt; or by Post &lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_state%&gt; &lt;%company_zip%&gt; &lt;%company_country%&gt;.</p><p>You may also choose to take completed and signed form to your nearest Department of Immigration office.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by Email &lt;%company_email%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9423, 109721, 109721, 7224, 0, 'General', 'Email', 'Medical Date (Booking)', 'RE: Your Health Assessment Details', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>We have booked your Medicals. Following are the details:</p><p>Medical Date: &lt;%medical_date%&gt;</p><p>X-Ray Date: &lt;%medical_xray_date%&gt;</p><p>Medical Reference Number: &lt;%medical_reference_number%&gt;</p><p>TRN: &lt;%medical_TRN%&gt;</p><p>HAP ID: &lt;%HAP_ID%&gt;</p><p>Location: &lt;%medical_exam_location%&gt;</p><p>Please contact us on &lt;%company_phone_1%&gt; or &lt;%company_email%&gt; if you have any questions.</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9424, 109721, 109721, 7224, 0, 'General', 'Email', 'Police Clearance (Character)', 'RE: Your Police Clearance 1', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;,<p>We have applied for your police clearance for &lt;%1_country_of_PCC%&gt; on &lt;%1_PCC_application_date%&gt;.</p><p>Your Reference Number for this application is &lt;%1_PCC_reference_number%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9425, 109721, 109721, 7224, 0, 'General', 'Email', 'General Follow Up', 'RE: Follow Up', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<div><br><p>This email is to follow up from our recent conversation.</p><p>Please respond to us as soon as possible either by calling on &lt;%company_phone_1%&gt; or by emailing us on &lt;%company_email%&gt;.</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p></div>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9426, 109721, 109721, 7224, 0, 'General', 'Email', 'Draft Application', 'RE: Your Draft Application', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p><br></p><p>We have completed drafting the application for your &lt;%visa_subclass%&gt; matter.</p><p>Please log in to your client portal Click:&nbsp;<a href="http://secure.officio.com.au">http://secure.officio.com.au</a>&nbsp;to access the draft of your application.</p><p>It is important that you review the information on your application. Please correct any information on this form if you believe it is not correct or complete, and inform us of any changes. Please confirm by email if the draft of application is correct.</p><p>Remember to save the form after you have updated any fields. If you are not able to make changes to the form online, you can also print and hand-write your changes on the form. Once completed, you may upload the scanned copy of your draft application to your client portal.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by email on &lt;%company_email%&gt; if you have any difficulties.</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9427, 109721, 109721, 7224, 0, 'General', 'Email', 'Letter to Department of Immigration - Application Letter', 'RE: Applicaction', '', '', '', 'To,<p>&lt;%immigration_office%&gt;</p><p>Date: &lt;%today_date%&gt;</p><p>Subject: &lt;%visa_subclass%&gt; Application for Client: &lt;%given_names%&gt; &lt;%family_name%&gt;; Date of Birth: &lt;%DOB%&gt;.</p><p><br></p><p>Dear Sir/Madam,</p><p><br></p><p>Please find herewith &lt;%visa_subclass%&gt; application of our client: &lt;%given_names%&gt; &lt;%family_name%&gt;; Date of Birth: &lt;%DOB%&gt;.</p><p>Following documents are attached:</p><p><font color="#ff0000"><b>&lt;&lt;Insert list of Documents Here&gt;&gt;</b></font></p><p>Please feel free to contact us if you require any further information for this application.</p><p>our contact details:</p><p>&lt;%company_name%&gt;</p><p>&lt;%company_address%&gt; &lt;%company_city%&gt;</p><p>&lt;%company_state%&gt; - &lt;%company_zip%&gt;, &lt;%company_country%&gt;</p><p>Telephone: &lt;%company_phone_1%&gt;</p><p>Fax: &lt;%company_fax%&gt;</p><p>Email: &lt;%company_email%&gt;</p><p><br></p><p>Thanks and Regards,</p><p>&lt;%registered_migrant_agent%&gt;</p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9428, 109721, 109721, 7224, 0, 'General', 'Email', 'Declaration of Other Names', 'RE: Declaration of Other Names - Statutory Declaration', '', '', '', 'Commonwealth of Australia<p align="center">STATUTORY DECLARATION</p><p align="center"><i>StatutoryDeclarations Act 1959</i></p><table border="0" cellspacing="0" cellpadding="0" width="100%"><tbody><tr><td width="14%" valign="top"><p></p><p><i>1 Insert the name, address and occupation of person making the declaration</i></p></td><td width="85%" valign="top"><p></p><p>I,<sup>1</sup></p><p><sup>&lt;%given_names%&gt; &lt;%family_name%&gt; Date of Birth: &nbsp;&lt;%DOB%&gt; residing at &lt;%address_1%&gt; &lt;%address_2%&gt; &lt;%city%&gt; &lt;%state%&gt; &lt;%zip_code%&gt; &lt;%country%&gt;;</sup></p><p></p><p></p><p></p><p>make the following declaration under the<i>Statutory Declarations Act1959:</i><b></b></p></td></tr><tr><td width="14%" valign="top"><p></p><p><i>2 Set out matter declared to in numbered paragraphs</i></p></td><td width="85%" valign="top"><p></p><p><sup>2</sup></p><p><font size="2">I am also known by the following names:</font></p><p><font size="2"><br></font></p><p><font size="2">1. &lt;%other_names%&gt;</font></p><p><sup><br></sup></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p>I understand that a person who intentionally makes a false statement in a statutory declaration is guilty of an offence under section 11 of the<i>Statutory Declarations Act 1959</i>,<i></i>and I believe that the statements in this declaration are true in every particular.</p><p></p></td></tr><tr><td width="14%" valign="top"><p><i>3 Signature of person making the declaration</i></p></td><td width="85%" valign="top"><p><sup>3</sup></p><p></p><p><sup></sup></p></td></tr><tr><td width="14%" valign="top"><p><i>4 Place</i></p><p><i>5 Day</i></p><p><i>6 Month</i><i>and year</i></p></td><td width="85%" valign="top"><p>Declared at<sup>4</sup>on<sup>5</sup>of<sup>6</sup></p><p></p><p>Before me,</p><p><sup></sup></p></td></tr><tr><td width="14%" valign="top"><p><i>7 Signature of person before whom the declaration is made (see over)</i></p><p><i></i></p></td><td width="85%" valign="top"><p><sup>7</sup></p><p></p><p><sup></sup></p></td></tr><tr><td width="14%" valign="top"><p><i>8 Full name, qualification and address of person before whom the declaration is made (in printed letters)</i></p></td><td width="85%" valign="top"><p><sup>8</sup></p><p></p><p></p><p></p><p><sup></sup></p></td></tr></tbody></table><p><i>Note 1</i>Aperson who intentionally makes a false statement in a statutory declaration isguilty of an offence, the punishment for which is imprisonment for a term of 4years see section 11 of the<i>StatutoryDeclarations Act 1959</i>.</p><p><i>Note 2</i>Chapter2 of the<i>Criminal Code</i>applies to alloffences against the<i>StatutoryDeclarations Act 1959</i> see section 5A of the<i>Statutory Declarations Act 1959</i>.</p><p><b>A statutory declaration under the<i>Statutory Declarations Act 1959</i>may be made before</b></p><p>(1) a person who is currently licensed or registered under a law to practise in one of thefollowing occupations:</p><p>Chiropractor Dentist Legalpractitioner</p><p>Medical practitioner Nurse Optometrist</p><p>Patent attorney Pharmacist Physiotherapist</p><p>Psychologist Trademarks attorney Veterinarysurgeon</p><p>(2) a person who is enrolled on the roll of the Supreme Court of a State or Territory, orthe High Court of Australia, as a legal practitioner (however described); or</p><p>(3) a person who is in the following list:</p><p>Agent of the Australian Postal Corporation who isin charge of an office supplying postal services to the public</p><p>Australian Consular Officer or AustralianDiplomatic Officer (within the meaning of the<i>Consular Fees Act 1955</i>)</p><p>Bailiff</p><p>Bank officer with 5 or more continuous years ofservice</p><p>Building society officer with 5 or more years ofcontinuous service</p><p>Chief executive officer of a Commonwealth court</p><p>Clerk of a court</p><p>Commissioner for Affidavits</p><p>Commissioner for Declarations</p><p>Credit union officer with 5 or more years ofcontinuous service</p><p>Employee of the Australian Trade Commission who is:</p><p>(a) in a country or place outside Australia; and</p><p>(b) authorised under paragraph 3 (d) of the<i>ConsularFees Act 1955</i>; and</p><p>(c) exercising his or her function in that place</p><p>Employee of the Commonwealth who is:</p><p>(a) in a country or place outside Australia; and</p><p>(b) authorised under paragraph 3 (c) of the<i>ConsularFees Act 1955</i>; and</p><p>(c) exercising his or her function in that place</p><p>Fellow of the National Tax Accountants Association</p><p>Finance company officer with 5 or more years ofcontinuous service</p><p>Holder of a statutory office not specified inanother item in this list</p><p>Judge of a court</p><p>Justice of the Peace</p><p>Magistrate</p><p>Marriage celebrant registered under Subdivision Cof Division 1 of Part IV of the<i>Marriage Act 1961</i></p><p>Master of a court</p><p>Member of Chartered Secretaries Australia</p><p>Member of Engineers Australia, other than at thegrade of student</p><p>Member of the Association of Taxation andManagement Accountants</p><p>Member of the Australasian Institute of Miningand Metallurgy</p><p>Member of the Australian Defence Force who is:</p><p>(a) an officer; or</p><p>(b) a non-commissioned officer within the meaningof the<i>Defence Force Discipline Act 1982</i>with 5 or more years ofcontinuous service; or</p><p>(c) a warrant officer within the meaning of thatAct</p><p>Member of the Institute of Chartered Accountants inAustralia, the Australian Society of Certified Practising Accountants or theNational Institute of Accountants</p><p>Member of:</p><p>(a) the Parliament of the Commonwealth; or</p><p>(b) the Parliament of a State; or</p><p>(c) a Territory legislature; or</p><p>(d) a local government authority of a State orTerritory</p><p>Minister of religion registered under Subdivision Aof Division 1 of Part IV of the<i>Marriage Act 1961</i></p><p>Notary public</p><p>Permanent employee of the Australian PostalCorporation with 5 or more years of continuous service who is employed in anoffice supplying postal services to the public</p><p>Permanent employee of:</p><p>(a) the Commonwealth or a Commonwealth authority;or</p><p>(b) a State or Territory or a State or Territoryauthority; or</p><p>(c) a local government authority;</p><p>with 5 or more years of continuous service who isnot specified in another item in this list</p><p>Person before whom a statutory declaration may bemade under the law of the State or Territory in which the declaration is made</p><p>Police officer</p><p>Registrar, or Deputy Registrar, of a court</p><p>Senior Executive Service employee of:</p><p>(a) the Commonwealth or a Commonwealth authority;or</p><p>(b) a State or Territory or a State or Territoryauthority</p><p>Sheriff</p><p>Sheriffs officer</p><p>Teacher employed on a full-time basis at a schoolor tertiary education institution</p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9430, 109721, 109721, 7224, 0, 'General', 'Email', 'Documents Request', 'RE: Documents Request', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>The Department of Immigration has started processing your application and your case officer has requested the following documents:</p><p>&lt;%miss_docs_description%&gt;</p><p>We request you to upload these documents to your client portal as soon as possible.</p><p>Alternatively, you may email these documents to your Registered Migration Agent on &lt;%company_email%&gt;. You may also post these documents to - &lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_state%&gt; &lt;%company_zip%&gt; &lt;%company_country%&gt;.</p><p>Please note that the last day to submit these documents to your case officer is &lt;&lt;Insert Date&gt;&gt;.</p><p>You may contact us on &lt;%company_phone_1%&gt; or email us on &lt;%company_email%&gt; if you have any questions.</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9431, 109721, 109721, 7224, 0, 'General', 'Email', 'Letter to the Department - Post Lodgement', 'RE: Letter to the Department of Immigration', '', '', '', 'To,<p>&lt;%immigration_office%&gt;</p><p>Date: &lt;%today_date%&gt;</p><p><br></p><p>Subject: &lt;%visa_subclass%&gt; Application: File Number: &lt;%file_number%&gt;; TRN: &lt;%visa_application_TRN%&gt;; File Number: &lt;%visa_application_file_number%&gt;; &lt;%given_names%&gt; &lt;%family_name%&gt; Date of Birth: &lt;%DOB%&gt;</p><p><br></p><p>Dear Sir/Madam,</p><p>Please find attached Documents as requested for this client:</p><p>&lt;%miss_docs_description%&gt;</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by sending an email to &lt;%company_email%&gt; if you require any further documents or information to finalise our client\'s application.</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9432, 109721, 109721, 7224, 0, 'General', 'Email', 'Statement of Service', 'RE: Statement of Services', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p><br></p><p>Please find below Statement of Services with regards to your &lt;%visa_subclass%&gt; matter.</p><p>&lt;%aud_curr_fin_transaction_table%&gt;</p><p>Please feel free to contact us if you have any questions,</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9433, 109721, 109721, 7224, 0, 'General', 'Email', 'Withdrawal Template Client Request', 'RE: Withdrawal of Application', '', '', '', 'From: &lt;%given_names%&gt; &lt;%family_name%&gt;<br>Date: &lt;%today_date%&gt;<p>Subject: Withdrawal of &lt;%visa_subclass%&gt; Application</p><p><br></p><p>I, &lt;%given_names%&gt; &lt;%family_name%&gt;; Date of Birth &lt;%DOB%&gt; residing at &lt;%address_1%&gt; &lt;%address_2%&gt; &lt;%city%&gt; &lt;%state%&gt; &lt;%zip_code%&gt; &lt;%country%&gt;; would like to withdraw my &lt;%visa_subclass%&gt; Application.</p><p><br></p><p>Below are the details of my application:</p><p><br></p><p>Date of Application: &lt;%visa_application_date%&gt;</p><p>File Number: &lt;%visa_application_file_number%&gt;</p><p>TRN: &lt;%visa_application_TRN%&gt;</p><p>Visa Subclass: &lt;%visa_subclass%&gt;</p><p><br></p><p>Dependents Included in the Application (If Any):</p><p><br></p><p>I understand that no further action will be taken once the application has been withdrawn. I also, understand that I may not be eligible for any refund.</p><p><br></p><p>Yours Sincerely,</p><p>&lt;%given_names%&gt; &lt;%family_name%&gt;</p><p><br></p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9434, 109721, 109721, 7224, 0, 'General', 'Email', 'Withdrawal of Application Agent Request', 'RE: Withdrawal of Application', '', '', '', 'To,<p>The Department of Immigration and Border Protection,</p><p>&lt;%immigration_office%&gt;</p><p>Date: &lt;%today_date%&gt;</p><p>Subject: Withdrawal of &lt;%visa_subclass%&gt; Application of our Client: &lt;%given_names%&gt; &lt;%family_name%&gt;; Date of Birth: &lt;%DOB%&gt;; File Number &lt;%visa_application_file_number%&gt;; TRN &lt;%visa_application_TRN%&gt;; Application ID &lt;%visa_application_ID%&gt;.</p><p><br></p><p>Dear Sir/Madam,</p><p><br></p><p>Our above mentioned client has instructed us to withdraw their &lt;%visa_subclass%&gt; Application.</p><p><br></p><p>Dependents included in the Application:</p><p><br></p><p><b>Details of Application:</b></p><p>Date of Application: &lt;%visa_application_date%&gt;</p><p>TRN: &lt;%visa_application_TRN%&gt;</p><p>File Number: &lt;%visa_application_file_number%&gt;</p><p>Application ID: &lt;%visa_application_ID%&gt;</p><p>Visa Subclass: &lt;%visa_subclass%&gt;</p><p><br></p><p>Please see attached authorisation from client to withdraw this application.</p><p><br></p><p>Please feel free to contact us if you have any questions:</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9435, 109721, 109721, 7224, 0, 'General', 'Email', 'Confirmation of Withdrawal', 'RE: Confirmation of Withdrawal of Application', '', '', '', '<font face="tahoma, arial, helvetica, sans-serif">Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;</font><p>We refer to our conversation with regards to withdrawal of your &lt;%visa_subclass%&gt; Application. You have advised us that you would like to withdraw the above application which is under assessment as of today.</p><p>Please note that no further action will be taken on this application following its withdrawal. Please confirm this in writing so that we can communicate accordingly with the Department of Immigration.</p><p style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;">Please feel free to contact us should you have any questions.</p><p>Regards,</p><p style="font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;">&lt;%current_user_email_signature%&gt;</p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9436, 109721, 109721, 7224, 0, 'General', 'Email', 'Notification of Grant', 'RE: Notification of Grant', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>We are pleased to inform you that your &lt;%visa_subclass%&gt; Application has been approved.</p><p>Your Visa Approval Date is: &lt;%visa_outcome_date%&gt;</p><p>Your Visa Expiry Date is: &lt;%visa_expiry_date%&gt;</p><p>Your Visa Grant Number is: &lt;%visa_number%&gt;</p><p>Please log in to your client portal to find a copy of your approval letter. To access your client portal click: <a href="http://secure.officio.com.au">http://secure.officio.com.au</a></p><p>We have attached a copy of the approval letter with this email. It contains important information including the validity and conditions of your visa.</p><p>Congratulations, and please feel free to contact us if you have any questions.</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9438, 109721, 109721, 7224, 0, 'General', 'Email', 'Receipt of Documents', 'RE: Receipt of Documents', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>Thank you for providing requested documents.</p><p>We acknowledge receipt of the following documents:</p><p><font color="#ff0000"><b>&lt;&lt;List Documents&gt;&gt;</b></font></p><p>Following Documents are still pending for your &lt;%visa_subclass%&gt; matter:</p><p>&lt;%miss_docs_description%&gt;</p><p>Please upload documents to your online Client Portal. To access your client portal, click: <a href="http://secure.officio.com.au">http://secure.officio.com.au</a> Alternatively, you may choose to email these documents to &lt;%registered_migrant_agent%&gt;.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by Email &lt;%company_email%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9440, 109721, 109721, 7224, 0, 'General', 'Email', 'Fax Template', 'RE: Fax', '', '', '', '<font size="2">Fax</font><p></p><p></p><table border="1" cellspacing="0" cellpadding="0" width="100%"><tbody><tr><td width="8%"><p>To:</p></td><td width="40%"><p></p></td><td width="8%"><p>From:</p></td><td width="41%"><p>&lt;%company_name%&gt;</p></td></tr><tr><td width="8%"><p>Fax:</p></td><td width="40%"><p></p></td><td width="8%"><p>Pages:</p></td><td width="41%"><p></p></td></tr><tr><td width="8%"><p>Phone:</p></td><td width="40%"><p></p></td><td width="8%"><p>Date:</p></td><td width="41%"><p>&lt;%today_date%&gt;</p></td></tr><tr><td width="8%"><p>Re:</p></td><td width="40%"><p>&lt;%given_names%&gt; &lt;%family_name%&gt;&nbsp;</p></td><td width="8%"><p>Ref:</p></td><td width="41%"><p>&lt;%file_number%&gt;</p></td></tr></tbody></table><p></p><p><br></p><p><br></p><p><br></p><p></p><br><p><font size="2">&lt;%current_user_email_signature%&gt;</font></p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9441, 109721, 109721, 7224, 0, 'General', 'Email', 'Form 956 Agent End Appointment', 'RE: End Of Appointment Form 956', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>You have instructed us to end our appointment as your Registered Migration Agent for your &lt;%visa_subclass%&gt; matter.</p><p>Please find attached Form 956 to be signed by you.</p><p>Please upload this form on your client portal. To access your client portal, click: <a href="http://secure.officio.com.au">http://secure.officio.com.au</a></p><p>Alternatively, you may return signed form either by emailing it to &lt;%registered_migrant_agent%&gt; or by Post&lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_state%&gt; &lt;%company_zip%&gt; &lt;%company_country%&gt;</p><p>Please forward your new contact details to The Department of Immigration to receive further correspondence for your matter. &lt;%agent%&gt; will not be able to correspond with regards to the above mentioned matter you once this form is submitted.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by Email &lt;%company_email%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
