	(9445, 109721, 109721, 7224, 0, 'General', 'Email', 'Police Clearance 3', 'RE: Your Police Clearance 3', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;,<p>We have applied for your police clearance for &lt;%3_country_of_PCC%&gt; on &lt;%3_PCC_application_date%&gt;.</p><p>Your Reference Number for this application is &lt;%3_PCC_reference_number%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p><p><br></p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
	(9447, 109721, 109721, 7224, 0, 'General', 'Email', 'Cessation of Employment', 'RE: Cessation of Employment', '', '', '', 'Dear Sir/Madam<p></p><p><b>VisaTransaction Reference Number (TRN):</b> &lt;%visa_application_TRN%&gt;<br><b>Visa Application ID:</b> &lt;%visa_application_ID%&gt;<br><b>Name of Approved Visa Holder:</b> &lt;%given_names%&gt; &lt;%family_name%&gt;<br><b>Passport Number:</b> &lt;%passport_number%&gt;<br><b>Visa Expiry:</b> &lt;%visa_expiry_date%&gt;<br><b>Name of Sponsor:</b> &lt;%link_to_employer_case%&gt;<br><b>Sponsorship/Agreement Application ID: </b>&lt;%sponsorship_agreement_number%&gt;</p><p></p><p>We wish to advise that &lt;%given_names%&gt; has ceased work with the sponsoring employer as of &lt;%nomination_termination_date%&gt;. </p><p></p><p>&lt;%given_names%&gt; can be contacted at the following:</p><p></p><p>Residential/postal address: &lt;%address_1%&gt; &lt;%address_2%&gt; &lt;%city%&gt; &lt;%state%&gt; &lt;%zip_code%&gt; &lt;%country%&gt;</p><p>Email: &lt;%email%&gt;</p><p>Phone: &lt;%phone_main%&gt;</p><p></p><p>Please do not hesitate to contact me if you require any further information.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>', '2014-06-10 00:00:00', '2014-06-10 00:00:00', 'N', 0),
