	(10211, 109721, 109721, 7223, 5, 'General', 'Email', 'Test CA', 'Test', '', '', '', '<div style="text-align: right;"><img id="companyImageLogo" src="http://secure.officio.com.au/clients/index/get-client-company-logo/company_id/4/" hspace="2" vspace="2" border="0" align="bottom" alt="Logo"></div><div style="text-align: right;"><br></div><div style="text-align: left;"><h1><a>CLIENT SERVICEAGREEMENT</a></h1><h2><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a><u>AGENTDETAILS</u></a><u></u></h2><p>Name:  &lt;&lt;INSERT MIGRATION AGENTS NAME &gt;&gt;<br>MARA Registration No:  <a></a>&lt;&lt;INSERT YOUR MARA NUMBER &gt;&gt;</p><h2><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a><u>BUSINESS DETAILS</u></a><u></u></h2><p>Name: &lt;&lt;FRANCHISE NAME &gt;&gt;</p><p> ANINDEPENDENT HUNT MIGRATION FRANCHISE BUSINESS<br>Business Address:  &lt;&lt;YOUR BUSINESS ADDRESS &gt;&gt;<br>Email:  &lt;&lt;YOUR EMAIL ADDRESS &gt;&gt;<br>Phone:  &lt;&lt;YOUR TELEPHONE NUMBER &gt;&gt; </p><h2><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a><u>CLIENT DETAILS</u></a><u></u></h2><p>Name: &lt;&lt;INSERT CLIENT NAME &gt;&gt;<br>Address: &lt;&lt;INSERT CLIENT ADDRESS &gt;&gt;<br>Email: &lt;&lt;INSERT CLIENT EMAIL &gt;&gt;<br>Contact Phone No: &lt;&lt;INSERT CLIENT MOBILE NUMBER &gt;&gt;</p><h2><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a><u>FEES AND CHARGES</u></a><u></u></h2><p>Fees and charges payable are asset out in the Schedule of Fees at the end of this document.</p><h2><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a>WORK TO BE PERFORMED</a></h2><p>Preparation and filing of visaapplication &lt;&lt; SET OUT DETAILE DESCRIPTION OF WORK TO BE PERFORMED&gt;&gt;</p><p></p><p></p><p><b>IMPORTANT INFORMATION FOR CLIENTS: The terms and conditions of this agreementare set out below. Make sure you haveread and understood the conditions before entering into the agreement. If you wish to seek independent legal adviceabout this agreement, you should do so before signing this agreement. By initialling the bottom of each page, youare indicating that you have read and understood the terms on that page. </b></p><table cellpadding="0" cellspacing="0" align="left"> <tbody><tr>  <td width="1" height="3"></td> </tr> <tr>  <td></td>  <td><img width="670" height="2" src="file:///C:/Users/abhishek/AppData/Local/Temp/msohtmlclip1/01/clip_image003.png" v:shapes="Straight_x0020_Connector_x0020_7"></td> </tr></tbody></table><p><b></b></p><br><p><b>I have read and understood the terms below and I agree to bebound by this agreement. I understandthis agreement is with an independent Hunt Migration Franchise business andcontractual right are created with that franchise business only and noliability rest with any other part of the Hunt Migration brand or organisation.</b></p><p><b></b></p><p><b>Signed by the Client<u>: </u>Date: /  /2014</b></p><p><b><br>Signed by the Registered Migration Agent<u>:  </u>Date  / /2014</b></p><h1><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a>1TERMS AND CONDITIONS</a></h1><h2><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a>1.1APPOINTMENT OF AGENT</a></h2><p>TheClient appoints the Agent to represent the Client and to perform the servicesdescribed in this agreement.</p><p>Theclient understands and accepts that Hunt Migration works under a franchisesystem and that he/she is contracting work from the agent, lawyer or entitymentioned in this agreement only and will not hold liable any other entity notspecifically mentioned in this agreement.</p><p>Theclient acknowledges that Hunt Migration is not liable for the actions of anindependent franchise unit. Anyreference to Hunt Migration in this agreement, unless specifically statedotherwise, is a reference to the particular franchise unit stated on the firstpage of this agreement.</p><p>Theclient authorizes the franchisee, Hunt Migration (Aust) or any related bodycorporate to review the clients file at any time for quality control or anyother reason necessary for the proper conduct of the visa application.</p><p></p><h2><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a>1.2CODE OF CONDUCT (THE CODE)</a></h2><p>(a)TheCode is intended to regulate the conduct of registered migration agents byintroducing a proper standard for the conduct of business as a registeredmigration agent and establishes the minimum attributes and abilities that aperson must demonstrate to perform as a registered migration agent.</p><p>(b)TheAgent guarantees to provide a copy of the Code to the Client immediately onrequest. It is also available atwww.themara.com.au.</p><p>(c)Ifthe Code (which is prescribed in Schedule 2 of the Migration Agent Regulations1998) is amended in a way that is inconsistent with this agreement, the Agentand Client agree to vary this agreement to comply with the new Code.</p><p>(d)Ifthe Code is inconsistent with the agents obligations as a legal practitioneror otherwise, or is inconsistent with the laws of the Country in which theAgent is operating, the Agent and the Client agree to vary this agreement tocomply with the laws of that Country, to the extent of any inconsistency.</p><p></p><h2><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a>1.3SERVICES TO BE PROVIDED</a></h2><p>The services to be providedunder this agreement include the following: </p><p>(a)Provideadvice relating to the Clients migration goals and their choice of visacategory.</p><p>(b)Providefrank and candid advice regarding the prospects of success (An agent must notguarantee the success of an application.If you believe you have been guaranteed success then do not sign thisagreement and discuss with your agent before proceeding.)</p><p>(c)Analysecurrent Immigration Law relating to the nominated visa category or reviewapplication.</p><p>(d)Assistin the completion and/or checking of relevant application forms.</p><p>(e)Provideadvice and assistance relating to documentation required to support theapplication.</p><p>(f)Prepareany necessary supporting submissions to the relevant Assessing Authority,Department or review body</p><p>(g)Submitthe application to the relevant Assessing Authority, Department or review bodyfor processing as soon as possible.</p><p>(h)Whereverpossible, supply any further documentation or information requested by the Departmenton receipt of documents from the Client.</p><p>(i)Whereverpossible, assist the Client to comply with any request made by the Departmentor review body.</p><p>(j)Keepthe Client fully informed of all developments concerning the progress of theapplication.</p><p>(k)Promptlyadvise the Client of any communications from the Department or review body.</p><p>(l)Duringthe processing of the application, advise the Client of any changes to the lawor Departmental policy requirements affecting the visa application.</p><p>(m)Advisethe Client promptly of the outcome of the application. </p><p>(n)Providepost grant migration advice regarding visa conditions and requirements.</p><p><b></b></p><h2><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a>1.4WHO WILL PERFORM THE WORK</a></h2><p>(a)Allimmigration assistance will be provided by the responsible agent designated onthe first page of this agreement or another registered agent in the employ ofthe firm or:</p><p>(b)Anyother migration agents or administrative staff in the same firm or consultingto the firm of the Responsible Agent may work on your matter from time to time.</p><p>(c)Administrativeservices may be provided by other staff.The Responsible Agent will properly supervise the work carried out byany staff working for the Agent. </p><p> </p><h2><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a>1.5THE AGENT GUARANTEES THAT HE OR SHE:</a></h2><p>(a)Isregistered with the Migration Agents Registration Authority.</p><p>(b)Maintainsthe required level of Professional Indemnity Insurance.</p><p>(c)Hasno conflict of interest in terms of Part 2 of the Code.</p><p>(d)Willinform the Client in writing if they may receive a financial benefit as aresult of providing advice of a non-migration nature to the Client.</p><p>(e)Willact in accordance with the law and in the best interests of the Client, anddeal with the Client competently, diligently and fairly.</p><p>(f)Willprovide courteous and attentive service.</p><p>(g)Willensure that the Client has access to an interpreter if necessary. (The Clientwill be required to pay any fees charged by the interpreter.)</p><p>(h)Will,on request, provide the Client with a copy of their application and any relateddocuments (The Agent is entitled to charge a reasonable amount for copies.)</p><p>(i)Hassufficient knowledge of the relevant laws to be able to competently provide theagreed services. </p><p>(j)Willadvise the Client in writing, if in the Agents opinion, the application isvexatious or grossly unfounded. </p><p>(k)Will,if providing translating or interpreting services, include the Agents name andregistration number on a prominent part of the translated document.</p><p></p><h2><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a>1.6THE CLIENT AGREES THAT:</a></h2><p>(a)TheAgent is able to advise the Client about immigration law at a particular pointin time but is unable to predict future changes in the law and the clientacknowledges that any changes in law, regulation policy or procedure are beyondthe Agents control.</p><p>(b)TheClient will respond promptly to requests by the Agent for further informationor documents.</p><p>(c)TheClient will not hold the Agent responsible for delays caused by the clientsfailure to promptly provide information or documents.</p><p>(d)TheAgent will be under no obligation to submit the Clients application to theDepartment or review body until payment has been made in full of all fees dueand payable at that stage.</p><p>(e)TheAgent has provided the Client with a copy of the booklet titled Information onthe Regulation of the Migration Advice Profession published by MARA and a copyof Your Right To Challenge Legal Costs published by the Queensland LawSociety.</p><p>(f)Thefinal decision on an application submitted to the Department is beyond theAgents control as is any change in legislation, regulation, policy orprocedure.</p><p>(g)TheAgent has not guaranteed the success of any application.</p><p>(h)TheAgent will not be liable for any loss arising from changes to the law affectingthe Clients application, which occurs after the application has been lodged.</p><p>(i)TheClient will not sell property, leave employment or finalise any business orpersonal affairs without first notifying the Agent.</p><p>(j)Allinformation provided to the Agent is, to the best of the Clients knowledge andbelief, true and current and that all documents supplied are genuine andauthentic.</p><p>(k)TheClient will, during the processing of an application, notify the Agent of anymaterial changes in the circumstances of the client or the clients immediatefamily.</p><p>(l)TheAgents professional fees can be invoiced on behalf of the Agent by the Agentsbusiness entity, as listed on the MARA Register of Migration Agents or by anyassociated entity.</p><p>(m)Ifthe Agent has advised the Client in writing that in the Agents opinion, anapplication would be vexatious or grossly unfounded; the Client will providewritten acknowledgement of the receipt of the advice, if notwithstanding theadvice, the Client still wants the Agent to lodge the application.</p><p>(n)Fromtime to time Government Departments, skills assessing authorities and otherentities involved in the migration process will change their fees for services(e.g. filing fees, skills assessment fees, translations). The client agrees that the fees outlined inthis agreement are subject to change and fees charged will be those charged bythe third party supplier, irrespective of what is contained within thisagreement.</p><p></p><h2><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a>1.7PAYMENT OF FEES AND DEFAULT</a></h2><p>(a)Theclient will pay all fees and outgoings invoiced under this agreement as andwhen they fall due.</p><p>(b)Ifthe clients defaults in the payment of any invoice rendered under the terms ofthis agreement, the client shall indemnify the Agent and the Firm from andagainst all the Agents and Firms legal costs and disbursements for collectionor attempted collection of the defaulted amount.</p><p>(c)Intereston overdue invoices shall accrue daily from the date when payment becomes dueand payable until the date of payment at a rate of 10% per month calculatedmonthly.</p><p>(d)Thefirm shall not commence work on any application until such time as professionalfees are received into trust, or until the first payment is made under aninstalment agreement.</p><p></p><h2><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a>1.8TERMINATION OF AGREEMENT</a></h2><p>(a)TheClient may terminate this agreement at any time.</p><p>(b)TheAgent may terminate the agreement at any time, provided they provide reasonablewritten notice to the Client. Thisnotice must comply with the requirements in Clause 10.1A of the Code. If the Agent terminates the agreement, theymust comply with the requirements of Clause 10.1B of the Code.</p><p>(c)TheAgent must terminate the agreement if a conflict of interest listed in Part 2of the Code arises. In this case theAgent will notify the Department that they no longer act for the Client andwill advise the Client about appointing another agent.</p><p>(d)Ifthe agreement is terminated, the Client must pay any fees outstanding for workalready performed by the Agent. TheClient is not required to pay any fees for work not yet performed by theAgent. </p><p>(e)Whenthe agreement is terminated, the Agent must deal with the Clients file inaccordance with Part 10 of the Code.</p><p>(f)TheAgent will terminate this agreement immediately upon becoming aware the clienthas knowingly supplied false or fraudulent material as part of the application.</p><h2></h2><h2><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a>1.9RETENTION OF DOCUMENTS</a></h2><p>(a)Thefirm agrees to keep securely and in a way which will ensure confidentiality alldocuments provided by, or on behalf of, the Client or paid for by, or on behalfof, the Client until the earlier of:</p><p>7years after the date of the last action on the file for the Client; or</p><p>Whenthe documents are given to the Client or dealt with in accordance with theClients written instructions.</p><p>(b)TheAgent agrees to keep all other records required by Clause 6.1 of the Code for 7years after the date of the last action on the file for the Client.</p><p>(c)Afterthis date the Agent may destroy the documents and records above in a way whichwill ensure confidentiality.</p><p></p><h2><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a>1.10CONFIDENTIALITY</a></h2><p>(a)TheAgent will preserve the confidentiality of the Client. The Agent will not disclose or allow too bedisclosed confidential information about the Client or the Clients businesswithout the Clients written consent, unless required by law. </p><p>(b)Ifapplicable, the Agent will preserve the confidentiality of the Clients medicalrecords and documents in accordance with the Privacy Act.</p><p>(c)Theclient authorizes the Agent, the Firm or other associated entity to use allinformation about the client for the purposes of assessing the clients creditworthiness or for furthering the clients application as required. The firm may disclose any and all informationconcerning the client in circumstances of default of payment of the Agents,Firms or associated entities fees, to credit reporting agencies and creditproviders. The client consents todisclosure and this consent is consent for disclosure under the provisions ofthe Privacy Act 1988.</p><p></p><h2><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a>1.11RESOLUTION OF DISPUTES</a></h2><p>(a)Ifa dispute arisesout of or relating to this agreement, or the breach,termination, validity, or subject matter thereof, or as to any related claim inrestitution or at law, in equity or pursuant to any statutethe parties agreeto discuss the dispute with the aim of reaching an agreement that is acceptableto both sides.</p><p>(b)Theagreement will be documented in writing, dated and signed by both the Agent andthe Client. </p><p>(c)Ifone party requests an opportunity to discuss the dispute, the parties shouldattempt to reach an agreement within 21 days of that request (or a longerperiod if agreed between the parties).</p><p>(d)Ifthe parties cannot reach an agreement within 21 days, the parties agree torefer the dispute to the Australian Commercial Disputes Centre (ACDC) for finalsettlement by a single arbitrator appointed in accordance with the Rules of theACDC, or by another dispute resolution process suggested by ACDC and acceptedby the parties. It is expected that anyfees payable to ACDC or to the person appointed by ACDC will be paid by theparties equally.</p><p>(e)Ifthe parties have been unable to resolve their dispute through ACDC, eitherparty may commence Court proceedings but not before the expiry of 28 days fromthe date of referral to ACDC.</p><p>(f)AClient may vary the procedure set out in this clause if the Client can establishthat DIAC may require the Client to depart Australia. </p><p></p><br><p></p><h1 align="center"><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a>SCHEDULE OF FEES</a></h1><h2><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a>FEETYPE</a> </h2><p>(a)Lump Sum Agreement</p><p>(b)Hourly Rate(Only applicable to Tribunal or Court related work)</p><p> *Strike out whichever is notapplicable. This agreement will beconsidered a fixed fee agreement if no selection made.</p><p></p><h2><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a>FEE ESTIMATE</a></h2><p>Part5 of the Code requires Agents to set and charge a fee that is reasonable in thecircumstances.</p><p>(a)ForLump Sum agreements, the professional fees for the preparation of this file are$ &lt;&lt;INSERT&gt;&gt; incl. GST (AUD).</p><p><s>(b)</s><s>ForHourly rates our range of fees for the matter from between $ and $ incl. GST (AUD).</s></p><p>TheAgent must give the Client written notice of any material change to theestimated cost as soon as the Agent becomes aware of the likelihood of a changeoccurring.</p><h2><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a>OTHERCHARGES</a></h2><p>Thesecharges are in addition to the fees noted above and may attract GST. The Agentmay, at any time, withdraw money from the Clients account for disbursements(i.e. charges) that are required to be paid to the Department, or any otheragency, for the client. Please note Departmental application fees generally areincreased in July of each year, and there may be a necessity for the Client topay the balance in the event the application fees rise after receiving anymonies and before the application fees fall due. The Client agrees to pay outgoing in onelump sum at the beginning of this agreement as outlined in 4(h) same to coverprinting, faxing, emails, phone calls, couriers, postage and other associatedcharges. The Client agrees that noindependent itemised account will be rendered for these charges and the Clientagrees they are otherwise reasonable in the circumstances.</p><p>a)  DIBP Application Fee (subject to change) A$ </p><p>c)  Translations/Interpreters (quoteto be supplied as required)</p><p>d)  English Language Testing   (to be paid directly by client)</p><p>e)  Other including Expert Witnesses A$ </p><p>f)  Instalment Agreement (administrative fee) A$ 275.00 (incl. gst)</p><p>g)  Outgoings A$ 110.00 (incl. gst)<img width="616" height="2" src="file:///C:/Users/abhishek/AppData/Local/Temp/msohtmlclip1/01/clip_image004.png" v:shapes="Straight_x0020_Connector_x0020_8"><b></b></p><p><b>TOTAL OTHER CHARGES A$</b></p><p><b>TOTAL FEESINCLUDING PROFESSIONAL FEES A$</b></p><p>Theclient is liable to pay all outgoings incurred by the Agent, the Business, HuntMigration (Aust) Pty Ltd or the Hunt Group No. 1 Pty Ltd. Outgoings shall include, but are not limitedto faxes, telephone calls, photocopying, couriers, registered or express post,mail, email and any other items incidental to the clients application. </p><p>Incircumstances where the Agent, Firm or related entity incurs any bank fees as aresult of payments made by clients, same by be billed to the client by way ofreimbursement. GST will be charged toclients on all outgoings and administration fees if required.</p><h2><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a>PAYMENT METHOD AND STRUCTURE</a></h2><p>(a)Feeslisted under Other Charges are not included in instalments and must be paidon request within seven (7) days.</p><p>(b)Allpayment should be made by direct payment into the appropriate client account orif paying by instalment under an instalment agreement, then payments should bemade as directed by that written agreement.</p><p>(c)TheFranchisee will issue an appropriate invoice for services upon the return ofthe Client Service Agreement.</p><p>(d)HuntMigration will hold all fees paid in advance in the client account designatedon the client invoice until authorised to disperse same as per this agreementunless payment is made by instalment.</p><p>(e)TheAgent will be entitled to invoice for a block of work performed when determinednecessary by the Agent.</p><p>(f)TheAgent, Firm or associate entity will be entitled to charge the first block ofwork after issuing the client the necessary advice letter and a clientagreement is signed by the client. Theinitial charge shall be 25% of the professional fees associated with theirapplication. The client agrees that this payment is in consideration of the Agentstime, training and application of knowledge to the clients individualcircumstances in assessing the clients need and issuing initial advice.</p><p>(g)TheAgent, Firm or associate entity will be entitled to charge the second block ofwork after issuing the client the necessary questionnaire and check listassociated with their application but such a block is not to be charged at morethan 25% of total professional fees quoted and not within 14 days of the clientexecuting this agreement.</p><p>(h)Thefinal balance of fees are due and payable by the client once the clientsapplications is ready for filing and the agent notifies the client of same.</p><p>(i)Suchinvoices in total not to exceed the agreed professional fees if this agreementis issued on a Lump Sum basis as per Item 1 of the schedule. </p><p>(j)Incircumstances where there is delay or failure by the client to supply allnecessary documents for the preparation and filing of a visa application asagreed, the Agent shall be entitled to issue a final bill for payment ofprofessional fees whether or not a valid application has been filed for thetotal amount of this agreement. (30 days without supply of requested documentsor satisfactory explanation shall constitute delay).</p><p>(k)Anyinvoice issued shall detail the particulars of each block of work performed;and the charge made in respect of each such service; </p><p>(l)Whena payment is made under the terms of this agreement the client authorises theFranchisee or Hunt Migration (Australia) Pty Ltd or Hunt Migration (Aust)Franchising Pty Ltd to draw those fees and disburse directly from the clientaccount to a third party as is required for the general operation of thebusiness at Hunt Migrations discretion.</p><p><b></b></p><h2><a></a><a></a><a></a><a></a><a></a><a></a><a></a><a>STANDINGAUTHORITY</a></h2><p>Upon presentation of an invoiceto a client (via post, email or other means) by the Agent then Hunt Migration isauthorized to immediately pay same out of the client account unless otherwisenotified of a bona fide dispute in relation to the invoice by the client.</p><p>Hunt Migration and its relatedentities are also directed to immediately release funds from the client accountin payment of third party expenses paid on the clients behalf (e.g. DIBPfiling fees). This includes release offees in preparation for filing by placing same on Hunt Migration corporatecredit card for payment to DIBP.</p><p></p><p></p><p>ClientSignature......................................................................</p><p></p><p>&nbsp;</p></div>', '2014-11-19 00:00:00', '2014-11-19 00:00:00', 'N', 0),
	(10406, 109721, 109721, 7223, 4, 'General', 'Email', 'CSA - HM', 'CSA - HM', '', '', '', '<div><span style="font-size:14px"><strong>CLIENT SERVICE AGREEMENT AGENT DETAILS</strong></span>\n\n<p>&nbsp;</p>\n\n<p>Name: &lt;%current_user_fName%&gt;&lt;%current_user_lName%&gt;<br />\nMARA Registration No: &lt;&lt; INSERT YOUR MARA NUMBER &gt;&gt;</p>\n\n<p>&nbsp;</p>\n\n<p>BUSINESS DETAILS</p>\n\n<p>Name: &lt;%company_name%&gt;<br />\n&nbsp;</p>\n\n<p>&lsquo;AN INDEPENDENT HUNT MIGRATION FRANCHISE BUSINESS&rdquo;</p>\n\n<p>Business Address: &lt;%company_address%&gt;<br />\nEmail: &lt;%company_email%&gt;<br />\nPhone: &lt;%company_phone_1%&gt;</p>\n\n<p>&nbsp;</p>\n\n<p>CLIENT DETAILS</p>\n\n<p>Name: &lt;%given_names%&gt;&lt;%family_name%&gt;<br />\nAddress: &lt;%address_1%&gt;<br />\nEmail: &lt;%email%&gt;<br />\nContact Phone No: &lt;%phone_main%&gt;</p>\n\n<p>&nbsp;</p>\n\n<p>FEES AND CHARGES</p>\n\n<p>Fees and charges payable are as set out in the &lsquo;Schedule of Fees&rsquo; at the end of this document.</p>\n\n<p>WORK TO BE PERFORMED</p>\n\n<p>Preparation and filing of visa application (SET OUT DETAILE DESCRIPTION OF WORK TO BE PERFORMED)</p>\n\n<p>IMPORTANT INFORMATION FOR CLIENTS: The terms and conditions of this agreement are set out below. Make sure you have read and understood the conditions before entering into the agreement. If you wish to seek independent legal advice about this agreement, you should do so before signing this agreement. By initialling the bottom of each page, you are indicating that you have read and understood the terms on that page.</p>\n\n<p>I have read and understood the terms below and I agree to be bound by this agreement. I understand this agreement is with an independent Hunt Migration Franchise business and contractual right are created with that franchise business only and no liability rest with any other part of the Hunt Migration brand or organisation.</p>\n\n<p>Signed by the Client: Date: / /2014</p>\n\n<p>Signed by the Registered Migration Agent: Date / /2014</p>\n\n<p>&nbsp;</p>\n\n<p><strong>1 TERMS AND CONDITIONS</strong></p>\n\n<p><strong>1.1APPOINTMENT OF AGENT</strong></p>\n\n<p>The Client appoints the Agent to represent the Client and to perform the services described in this agreement.</p>\n\n<p>The client understands and accepts that Hunt Migration works under a franchise system and that he/she is contracting work from the agent, lawyer or entity mentioned in this agreement only and will not hold liable any other entity not specifically mentioned in this agreement.</p>\n\n<p>The client acknowledges that Hunt Migration is not liable for the actions of an independent franchise unit. Any reference to Hunt Migration in this agreement, unless specifically stated otherwise, is a reference to the particular franchise unit stated on the first page of this agreement.</p>\n\n<p>The client authorizes the franchisee, Hunt Migration (Aust) or any related body corporate to review the client&rsquo;s file at any time for quality control or any other reason necessary for the proper conduct of the visa application.</p>\n\n<p><strong>1.2 CODE OF CONDUCT (THE CODE)</strong></p>\n\n<p>(a)The Code is intended to regulate the conduct of registered migration agents by introducing a proper standard for the conduct of business as a registered migration agent and establishes the minimum attributes and abilities that a person must demonstrate to perform as a registered migration agent.</p>\n\n<p>(b)The Agent guarantees to provide a copy of the Code to the Client immediately on request. It is also available at www.themara.com.au.</p>\n\n<p>(c)If the Code (which is prescribed in Schedule 2 of the Migration Agent Regulations 1998) is amended in a way that is inconsistent with this agreement, the Agent and Client agree to vary this agreement to comply with the new Code.</p>\n\n<p>(d)If the Code is inconsistent with the agent&rsquo;s obligations as a legal practitioner or otherwise, or is inconsistent with the laws of the Country in which the Agent is operating, the Agent and the Client agree to vary this agreement to comply with the laws of that Country, to the extent of any inconsistency.</p>\n\n<p><strong>1.3 SERVICES TO BE PROVIDED</strong></p>\n\n<p>The services to be provided under this agreement include the following:</p>\n\n<p>(a)Provide advice relating to the Client&rsquo;s migration goals and their choice of visa category.</p>\n\n<p>(b)Provide frank and candid advice regarding the prospects of success (An agent must not guarantee the success of an application. If you believe you have been guaranteed success then do not sign this agreement and discuss with your agent before proceeding.)</p>\n\n<p>(c)Analyse current Immigration Law relating to the nominated visa category or review application.</p>\n\n<p>(d)Assist in the completion and/or checking of relevant application forms.</p>\n\n<p>(e)Provide advice and assistance relating to documentation required to support the application.</p>\n\n<p>(f)Prepare any necessary supporting submissions to the relevant Assessing Authority, Department or review body</p>\n\n<p>(g)Submit the application to the relevant Assessing Authority, Department or review body for processing as soon as possible.</p>\n\n<p>(h)Wherever possible, supply any further documentation or information requested by the Department on receipt of documents from the Client.</p>\n\n<p>(i)Wherever possible, assist the Client to comply with any request made by the Department or review body.</p>\n\n<p>(j)Keep the Client fully informed of all developments concerning the progress of the application.</p>\n\n<p>(k)Promptly advise the Client of any communications from the Department or review body.</p>\n\n<p>(l)During the processing of the application, advise the Client of any changes to the law or Departmental policy requirements affecting the visa application.</p>\n\n<p>(m)Advise the Client promptly of the outcome of the application.</p>\n\n<p>(n)Provide post grant migration advice regarding visa conditions and requirements.</p>\n\n<p><strong>1.4 WHO WILL PERFORM THE WORK</strong></p>\n\n<p>(a)All immigration assistance will be provided by the responsible agent designated on the first page of this agreement or another registered agent in the employ of the firm or:</p>\n\n<p>(b)Any other migration agents or administrative staff in the same firm or consulting to the firm of the Responsible Agent may work on your matter from time to time.</p>\n\n<p>(c)Administrative services may be provided by other staff. The Responsible Agent will properly supervise the work carried out by any staff working for the Agent.</p>\n\n<p><strong>1.5 THE AGENT GUARANTEES THAT HE OR SHE:</strong></p>\n\n<p>(a)Is registered with the Migration Agents Registration Authority.</p>\n\n<p>(b)Maintains the required level of Professional Indemnity Insurance.</p>\n\n<p>(c)Has no conflict of interest in terms of Part 2 of the Code.</p>\n\n<p>(d)Will inform the Client in writing if they may receive a financial benefit as a result of providing advice of a non-migration nature to the Client.</p>\n\n<p>(e)Will act in accordance with the law and in the best interests of the Client, and deal with the Client competently, diligently and fairly.</p>\n\n<p>(f)Will provide courteous and attentive service.</p>\n\n<p>(g)Will ensure that the Client has access to an interpreter if necessary. (The Client will be required to pay any fees charged by the interpreter.)</p>\n\n<p>(h)Will, on request, provide the Client with a copy of their application and any related documents (The Agent is entitled to charge a reasonable amount for copies.)</p>\n\n<p>(i)Has sufficient knowledge of the relevant laws to be able to competently provide the agreed services.</p>\n\n<p>(j)Will advise the Client in writing, if in the Agent&rsquo;s opinion, the application is vexatious or grossly unfounded.</p>\n\n<p>(k)Will, if providing translating or interpreting services, include the Agent&rsquo;s name and registration number on a prominent part of the translated document.</p>\n\n<p><strong>1.6 THE CLIENT AGREES THAT:</strong></p>\n\n<p>(a)The Agent is able to advise the Client about immigration law at a particular point in time but is unable to predict future changes in the law and the client acknowledges that any changes in law, regulation policy or procedure are beyond the Agents control.</p>\n\n<p><span style="font-family:tahoma,arial,helvetica,sans-serif">(b)The Client will respond promptly to requests by the Agent for further information or documents.</span></p>\n\n<p>(c)The Client will not hold the Agent responsible for delays caused by the client&rsquo;s failure to promptly provide information or documents.</p>\n\n<p>(d)The Agent will be under no obligation to submit the Client&rsquo;s application to the Department or review body until payment has been made in full of all fees due and payable at that stage.</p>\n\n<p>(e)The Agent has provided the Client with a copy of the booklet titled Information on the Regulation of the Migration Advice Profession published by MARA and a copy of &ldquo;Your Right To Challenge Legal Costs&rsquo; published by the Queensland Law Society.</p>\n\n<p>(f)The final decision on an application submitted to the Department is beyond the Agent&rsquo;s control as is any change in legislation, regulation, policy or procedure.</p>\n\n<p>(g)The Agent has not guaranteed the success of any application.</p>\n\n<p>(h)The Agent will not be liable for any loss arising from changes to the law affecting the Client&rsquo;s application, which occurs after the application has been lodged.</p>\n\n<p>(i)The Client will not sell property, leave employment or finalise any business or personal affairs without first notifying the Agent.</p>\n\n<p>(j)All information provided to the Agent is, to the best of the Client&rsquo;s knowledge and belief, true and current and that all documents supplied are genuine and authentic.</p>\n\n<p>(k)The Client will, during the processing of an application, notify the Agent of any material changes in the circumstances of the client or the client&rsquo;s immediate family.</p>\n\n<p>(l)The Agent&rsquo;s professional fees can be invoiced on behalf of the Agent by the Agent&rsquo;s business entity, as listed on the MARA Register of Migration Agents or by any associated entity.</p>\n\n<p>(m)If the Agent has advised the Client in writing that in the Agent&rsquo;s opinion, an application would be vexatious or grossly unfounded; the Client will provide written acknowledgement of the receipt of the advice, if notwithstanding the advice, the Client still wants the Agent to lodge the application.</p>\n\n<p>(n)From time to time Government Departments, skills assessing authorities and other entities involved in the migration process will change their fees for services (e.g. filing fees, skills assessment fees, translations). The client agrees that the fees outlined in this agreement are subject to change and fees charged will be those charged by the third party supplier, irrespective of what is contained within this agreement.</p>\n\n<p><strong>1.7 PAYMENT OF FEES AND DEFAULT</strong></p>\n\n<p>(a)The client will pay all fees and outgoings invoiced under this agreement as and when they fall due.</p>\n\n<p>(b)If the client&rsquo;s defaults in the payment of any invoice rendered under the terms of this agreement, the client shall indemnify the Agent and the Firm from and against all the Agents and Firms legal costs and disbursements for collection or attempted collection of the defaulted amount.</p>\n\n<p>(c)Interest on overdue invoices shall accrue daily from the date when payment becomes due and payable until the date of payment at a rate of 10% per month calculated monthly.</p>\n\n<p>(d)The firm shall not commence work on any application until such time as professional fees are received into trust, or until the first payment is made under an instalment agreement.</p>\n\n<p><strong>1.8 TERMINATION OF AGREEMENT</strong></p>\n\n<p>(a)The Client may terminate this agreement at any time.</p>\n\n<p>(b)The Agent may terminate the agreement at any time, provided they provide reasonable written notice to the Client. This notice must comply with the requirements in Clause 10.1A of the Code. If the Agent terminates the agreement, they must comply with the requirements of Clause 10.1B of the Code.</p>\n\n<p>(c)The Agent must terminate the agreement if a conflict of interest listed in Part 2 of the Code arises. In this case the Agent will notify the Department that they no longer act for the Client and will advise the Client about appointing another agent.</p>\n\n<p>(d)If the agreement is terminated, the Client must pay any fees outstanding for work already performed by the Agent. The Client is not required to pay any fees for work not yet performed by the Agent.</p>\n\n<p>(e)When the agreement is terminated, the Agent must deal with the Client&rsquo;s file in accordance with Part 10 of the Code.</p>\n\n<p>(f)The Agent will terminate this agreement immediately upon becoming aware the client has knowingly supplied false or fraudulent material as part of the application.</p>\n\n<p><strong>1.9 RETENTION OF DOCUMENTS</strong></p>\n\n<p>(a)The firm agrees to keep securely and in a way which will ensure confidentiality all documents provided by, or on behalf of, the Client or paid for by, or on behalf of, the Client until the earlier of:</p>\n\n<p>&middot;7 years after the date of the last action on the file for the Client; or</p>\n\n<p>&middot;When the documents are given to the Client or dealt with in accordance with the Client&rsquo;s written instructions.</p>\n\n<p>(b)The Agent agrees to keep all other records required by Clause 6.1 of the Code for 7 years after the date of the last action on the file for the Client.</p>\n\n<p>(c)After this date the Agent may destroy the documents and records above in a way which will ensure confidentiality.</p>\n\n<p><strong>1.10 CONFIDENTIALITY</strong></p>\n\n<p>(a)The Agent will preserve the confidentiality of the Client. The Agent will not disclose or allow too be disclosed confidential information about the Client or the Client&rsquo;s business without the Client&rsquo;s written consent, unless required by law.</p>\n\n<p>(b)If applicable, the Agent will preserve the confidentiality of the Client&rsquo;s medical records and documents in accordance with the Privacy Act.</p>\n\n<p>(c)The client authorizes the Agent, the Firm or other associated entity to use all information about the client for the purposes of assessing the client&rsquo;s credit worthiness or for furthering the client&rsquo;s application as required. The firm may disclose any and all information concerning the client in circumstances of default of payment of the Agents, Firms or associated entities fees, to credit reporting agencies and credit providers. The client consents to disclosure and this consent is consent for disclosure under the provisions of the Privacy Act 1988.</p>\n\n<p><strong>1.11 RESOLUTION OF DISPUTES</strong></p>\n\n<p>(a)If a dispute arises&mdash;out of or relating to this agreement, or the breach, termination, validity, or subject matter thereof, or as to any related claim in restitution or at law, in equity or pursuant to any statute&mdash;the parties agree to discuss the dispute with the aim of reaching an agreement that is acceptable to both sides.</p>\n\n<p>(b)The agreement will be documented in writing, dated and signed by both the Agent and the Client.</p>\n\n<p>(c)If one party requests an opportunity to discuss the dispute, the parties should attempt to reach an agreement within 21 days of that request (or a longer period if agreed between the parties).</p>\n\n<p>(d)If the parties cannot reach an agreement within 21 days, the parties agree to refer the dispute to the Australian Commercial Disputes Centre (ACDC) for final settlement by a single arbitrator appointed in accordance with the Rules of the ACDC, or by another dispute resolution process suggested by ACDC and accepted by the parties. It is expected that any fees payable to ACDC or to the person appointed by ACDC will be paid by the parties equally.</p>\n\n<p>(e)If the parties have been unable to resolve their dispute through ACDC, either party may commence Court proceedings but not before the expiry of 28 days from the date of referral to ACDC.</p>\n\n<p>(f)A Client may vary the procedure set out in this clause if the Client can establish that DIAC may require the Client to depart Australia.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>SCHEDULE OF FEESFEE TYPE</strong></p>\n\n<p>(a)Lump Sum Agreement</p>\n\n<p>(b)Hourly Rate (Only applicable to Tribunal or Court related work)</p>\n\n<p>*Strike out whichever is not applicable. This agreement will be considered a fixed fee agreement if no selection made.</p>\n\n<p>FEE ESTIMATE</p>\n\n<p>Part 5 of the Code requires Agents to set and charge a fee that is reasonable in the circumstances.</p>\n\n<p>(a)For Lump Sum agreements, the professional fees for the preparation of this file are $ &lt;&lt;INSERT&gt;&gt; incl. GST (AUD).</p>\n\n<p>(b)For Hourly rates our range of fees for the matter from between $ and $ incl. GST (AUD).</p>\n\n<p>The Agent must give the Client written notice of any material change to the estimated cost as soon as the Agent becomes aware of the likelihood of a change occurring.</p>\n\n<p>OTHER CHARGES</p>\n\n<p>These charges are in addition to the fees noted above and may attract GST. The Agent may, at any time, withdraw money from the Client&rsquo;s account for disbursements (i.e. charges) that are required to be paid to the Department, or any other agency, for the client. Please note Departmental application fees generally are increased in July of each year, and there may be a necessity for the Client to pay the balance in the event the application fees rise after receiving any monies and before the application fees fall due. The Client agrees to pay outgoing in one lump sum at the beginning of this agreement as outlined in 4(h) same to cover printing, faxing, emails, phone calls, couriers, postage and other associated charges. The Client agrees that no independent itemised account will be rendered for these charges and the Client agrees they are otherwise reasonable in the circumstances.</p>\n\n<p>a) DIBP Application Fee (subject to change)A$</p>\n\n<p>c) Translations/Interpreters (quote to be supplied as required)</p>\n\n<p>d) English Language Testing (to be paid directly by client)</p>\n\n<p>e) Other including Expert Witnesses A$</p>\n\n<p>f) Instalment Agreement (administrative fee) A$ 275.00 (incl. gst)</p>\n\n<p>g) Outgoings A$ 110.00 (incl. gst)</p>\n\n<p>TOTAL OTHER CHARGES A$</p>\n\n<p>TOTAL FEES INCLUDING PROFESSIONAL FEES A$</p>\n\n<p>The client is liable to pay all outgoings incurred by the Agent, the Business, Hunt Migration (Aust) Pty Ltd or the Hunt Group No. 1 Pty Ltd. Outgoings shall include, but are not limited to faxes, telephone calls, photocopying, couriers, registered or express post, mail, email and any other items incidental to the client&rsquo;s application.</p>\n\n<p>In circumstances where the Agent, Firm or related entity incurs any bank fees as a result of payments made by clients, same by be billed to the client by way of reimbursement. GST will be charged to clients on all outgoings and administration fees if required.</p>\n\n<p>PAYMENT METHOD AND STRUCTURE</p>\n\n<p>(a)Fees listed under &lsquo;Other Charges&rsquo; are not included in instalments and must be paid on request within seven (7) days.</p>\n\n<p>(b)All payment should be made by direct payment into the appropriate client account or if paying by instalment under an instalment agreement, then payments should be made as directed by that written agreement.</p>\n\n<p>(c)The Franchisee will issue an appropriate invoice for services upon the return of the Client Service Agreement.</p>\n\n<p>(d)Hunt Migration will hold all fees paid in advance in the client account designated on the client invoice until authorised to disperse same as per this agreement unless payment is made by instalment.</p>\n\n<p>(e)The Agent will be entitled to invoice for a block of work performed when determined necessary by the Agent.</p>\n\n<p>(f)The Agent, Firm or associate entity will be entitled to charge the first block of work after issuing the client the necessary advice letter and a client agreement is signed by the client. The initial charge shall be 25% of the professional fees associated with their application. The client agrees that this payment is in consideration of the Agents time, training and application of knowledge to the clients individual circumstances in assessing the clients need and issuing initial advice.</p>\n\n<p>(g)The Agent, Firm or associate entity will be entitled to charge the second block of work after issuing the client the necessary questionnaire and check list associated with their application but such a block is not to be charged at more than 25% of total professional fees quoted and not within 14 days of the client executing this agreement.</p>\n\n<p>(h)The final balance of fees are due and payable by the client once the clients applications is ready for filing and the agent notifies the client of same.</p>\n\n<p>(i)Such invoices in total not to exceed the agreed professional fees if this agreement is issued on a Lump Sum basis as per Item 1 of the schedule.</p>\n\n<p>(j)In circumstances where there is delay or failure by the client to supply all necessary documents for the preparation and filing of a visa application as agreed, the Agent shall be entitled to issue a final bill for payment of professional fees whether or not a valid application has been filed for the total amount of this agreement. (30 days without supply of requested documents or satisfactory explanation shall constitute delay).</p>\n\n<p>(k)Any invoice issued shall detail the particulars of each block of work performed; and the charge made in respect of each such service;</p>\n\n<p>(l)When a payment is made under the terms of this agreement the client authorises the Franchisee or Hunt Migration (Australia) Pty Ltd or Hunt Migration (Aust) Franchising Pty Ltd to draw those fees and disburse directly from the client account to a third party as is required for the general operation of the business at Hunt Migrations discretion.</p>\n\n<p>STANDING AUTHORITY</p>\n\n<p>Upon presentation of an invoice to a client (via post, email or other means) by the Agent then Hunt Migration is authorized to immediately pay same out of the client account unless otherwise notified of a bonafide dispute in relation to the invoice by the client.</p>\n\n<p>Hunt Migration and its related entities are also directed to immediately release funds from the client account in payment of third party expenses paid on the client&rsquo;s behalf (e.g. DIBP filing fees). This includes release of fees in preparation for filing by placing same on Hunt Migration corporate credit card for payment to DIBP.</p>\n\n<p>&nbsp;</p>\n\n<p>Client Signature......................................................................</p>\n</div>', '2014-12-24 00:00:00', '2014-12-24 00:00:00', 'N', 0),
	(10448, 109721, 109721, 7223, 3, 'General', 'Email', 'Test Burn', 'Testing a Template Formatting', '', '', '', '<div>Dear&nbsp;&lt;%given_names%&gt;&nbsp;&lt;%family_name%&gt;,\n<div>&nbsp;</div>\n\n<div>This email is to test formatting issues with the program. I will now copy and paste this same section a few times to replicate a long email. This email is to test formatting issues with the program. I will now copy and paste this same section a few times to replicate a long email. This email is to test formatting issues with the program. I will now copy and paste this same section a few times to replicate a long email. This email is to test formatting issues with the program. I will now copy and paste this same section a few times to replicate a long email.</div>\n\n<div>&nbsp;</div>\n\n<div>This email is to test formatting issues with the program. I will now copy and paste this same section a few times to replicate a long email. This email is to test formatting issues with the program. I will now copy and paste this same section a few times to replicate a long email. This email is to test formatting issues with the program. I will now copy and paste this same section a few times to replicate a long email. This email is to test formatting issues with the program. I will now copy and paste this same section a few times to replicate a long email.</div>\n\n<div>&nbsp;</div>\n\n<div>Thanks and Regards,</div>\n\n<div>&nbsp;</div>\n\n<div>&lt;%current_user_email_signature%&gt;</div>\n\n<div>&nbsp;</div>\n\n<div>&nbsp;</div>\n\n<div>Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<br />\n<br />\nThank you for your email, we endeavour&nbsp;to reply as soon as possible.<br />\n<br />\n<br />\n<br />\nRegards,<br />\n&lt;%current_user_email_signature%&gt;</div>\n</div>', '2015-01-13 00:00:00', '2015-01-13 00:00:00', 'N', 1),
